	(6907,563,6,'Alimento balanceado medicado para gallinas de postura de 17 a 18 semanas de edad.ALIMENTO PREPOSTURA es un alimento diseñado, formulado y elaborado para satisfacer lasnecesidades de la gallina de postura de 17 a 18 semanas justo para arrancar el periodo de postura.Con ingredientes altamente digestibles que asegura mejor conversión, logrando una mayor saludintestinal y menor huevo sucio.Contiene carotenoides naturales para una óptima pigmentación de la yema. DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, para gallinas de 17 a 18 semanas. ADVERTENCIAS: Retirar 15 días previos al sacrificio de los animales destinados al consumo humano.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos yprotegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto conparedes.                    USO VETERINARIO. ','2018-12-13 04:46:12','2018-12-13 04:46:12'),
	(6895,562,4,'10','2018-12-13 04:45:43','2018-12-13 04:45:43'),
