	(1057,1,6,'ABABE PLUS es el primer alimento seco para becerros y terneras, empiece a suministrarlo desde los 5 días de edad en pequeñas cantidades de 10 a 12 g adicionales al día, aparte de su ración diaria de leche más agua. Los primeros días, coloque en la boca del animal unos cuantos comprimidos frescos (no sobrantes del pesebre) hasta que se acostumbre a comerlo. El objeto de esta reducida cantidad de ABABE PLUS es el promover consumo de alimento sólido a temprana edad para estimular la actividad del Rumen.  Una vez que se ha acostumbrado a comerlo, ponga al alcance de la ternera en comedero limpio ABABE PLUS para que lo consuma por sí sola. A las 4 ó 5 semanas de edad, su consumo deberá haber aumentado hasta 500g diarios aproximadamente y a la 6ª ó 7ª semana en unos 800g al día.De la 7ª semana en adelante su consumo debe ser gradualmente mayor, hasta que el animal a los 4 meses de edad esté comiendo de 2 a 2 ½ kg al día. Recuerde que desde la 8ª semana de edad, debe proporcionar forrajes secos de leguminosas (alfalfa o trébol) de buena calidad y forrajes húmedos hasta los 6 meses. No debe faltar agua potable, limpia y fresca siempre al alcance de los animales. ADVERTENCIAS: No almacene este alimento en lugares húmedos, mal ventilados o calientes, almacénelo en sitios secos y al abrigo de la luz solar directa, libre de roedores, insectos y otros animales nocivos.Estíbelo sobre tarimas o polines pero nunca directamente sobre el suelo y se evitará que el alimento absorba humedad del suelo.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.           \n','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1058,2,6,'ABABE PLUS es el primer alimento seco para becerros y terneras, empiece a suministrarlo desde los 5 días de edad en pequeñas cantidades de 10 a 12 g adicionales al día, aparte de su ración diaria de leche más agua. Los primeros días, coloque en la boca del animal unos cuantos comprimidos frescos (no sobrantes del pesebre) hasta que se acostumbre a comerlo. El objeto de esta reducida cantidad de ABABE PLUS es el promover consumo de alimento sólido a temprana edad para estimular la actividad del Rumen.  Una vez que se ha acostumbrado a comerlo, ponga al alcance de la ternera en comedero limpio ABABE PLUS para que lo consuma por sí sola. A las 4 ó 5 semanas de edad, su consumo deberá haber aumentado hasta 500g diarios aproximadamente y a la 6ª ó 7ª semana en unos 800g al día.De la 7ª semana en adelante su consumo debe ser gradualmente mayor, hasta que el animal a los 4 meses de edas esté comiendo de 2 a 2 ½ kg al día. Recuerde que desde la 8ª semana de edad, debe proporcionar forrajes secos de leguminosas (alfalfa o trébol) de buena calidad y forrajes húmedos hasta los 6 meses. No debe faltar agua potable, limpia y fresca siempre al alcance de los animales. ADVERTENCIAS: No almacene este alimento en lugares húmedos, mal ventilados o calientes, almacénelo en sitios secos y al abrigo de la luz solar directa, libre de roedores, insectos y otros animales nocivos.Estíbelo sobre tarimas o polines pero nunca directamente sobre el suelo y se evitará que el alimento absorba humedad del suelo.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.          USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1059,3,6,'INDICACIONES: Alimento balanceado para vacas secas.Este producto es un alimento balanceado que satisface las necesidades de las hembras jóvenes en gestación y vacas adultas secas. ABAHOR PLUS desarrolla animales normales vigorosos en buen estado de carnes, sin grasa superflua preparándolos adecuadamente para sus funciones de reproducción y producción lechera futura. A las vacas jóvenes como a las adultas secas en gestación, les proporciona los nutrientes necesarios para ella y el becerro en formación, conservándolas en las mejores condiciones para su parto feliz. Mantener en todo momento agua limpia y fresca para su ganado. DOSIS Y VIA DE ADMINISTRACION: Oral. Ofrecer ABAHOR PLUS a razón del 1 al 3% del peso vivo, de acuerdo a la etapa del animal. A los 4 ó 5 días del parto, sustituya gradualmente ABAHOR PLUS por el alimento para vacas productoras según las necesidades de los animales y de acuerdo con los forrajes que suministren.                  \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1060,4,6,'ABALAC 32% tiene un alto valor nutritivo y es ideal para mezclar con granos y otros ingredientes; cuenta con un elevado nivel de proteína de alta calidad, y está formulado y elaborado con grasa de sobrepaso, amortiguadores del pH ruminal, y fuentes que proporcionan un elevado contenido de proteína de sobrepaso, así como metionina y lisina, que en su conjunto proporcionarán una buena producción en sus vacas lecheras. Mezclado en proporción adecuada con granos rolados o molidos de buena calidad, se obtiene un alimento balanceado que satisface las necesidades de mantenimiento y producción del ganado lechero.  RECOMENDACIÓN DE USO: Dependiendo de lo requerido en el alimento final, deberá de mezclar este concentrado con granos u otros ingredientes en diferentes proporciones.Por ejemplo, para producir un alimento de 16% proteína, mezclar 300 kg de ABALAC 32% y 700 kg de granos (sorgo, maíz, trigo o su combinación); y para producir un alimento de 18% proteína, mezclar 400 kg de ABALAC 32% y 600 kg de granos (sorgo, maíz, trigo o su combinación). Del alimento preparado, deberá ofrecer alrededor de 1 kg. por cada 3 litros de leche producida, además de forraje de buena calidad.Para formulación especial de ración integral con el uso de este concentrado, favor de contactar con el Servicio Técnico de maltaCleyton®.Mantener en todo momento agua limpia y fresca para sus animales.  CONSEJOS PRÁCTICOS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.            \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1061,5,6,'Concentrado proteico para mezclarse con granos para alimentación de rumiantes.ABAMEL 40%  es un concentrado proteico, hecho para satisfacer las necesidades de sostenimiento y crecimiento del ganado, manteniéndolo en condiciones óptimas para cumplir sus funciones de desarrollo, reproducción, producción de leche o engorda.ABAMEL 40% es ideal por su alto valor nutritivo, tanto por su elevado nivel de proteinasde alta calidad, como por las vitaminas y minerales que contiene y que el ganado necesita.Mantener en todo momento agua fresca y limpia  para su ganado.DOSIS Y VIA DE ADMINISTRACION: Oral.Para el ganado de engorda de los 300 kg de peso en adelante, suministre de 500 a 750 gramos diarios por cabeza, mezclado con granos.Para formulación especial con este concentrado, favor de contactar al Servicio Técnico de maltaCleyton®, y podrá solicitar la información necesaria para el uso de este producto para el ganado mayor en crecimiento o producción de leche o bien, para el ganado menor, tomando en cuenta los pastos de la región y granos de que se disponga.ADVERTENCIAS : No almacenar el alimento en lugare húmedos, calientes y mal ventilados, hágaloen sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Dé salida al alimento que tenga mas tiempo en sus bodegas para evitar su envejecimiento y pérdidade propiedades nutrimentales.                \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1062,6,6,'Alimento balanceado medicado para gallinas de postura de 17 a 18 semanas de edad.ALIMENTO PREPOSTURA es un alimento diseñado, formulado y elaborado para satisfacer lasnecesidades de la gallina de postura de 17 a 18 semanas justo para arrancar el periodo de postura.Con ingredientes altamente digestibles que asegura mejor conversión, logrando una mayor saludintestinal y menor huevo sucio.Contiene carotenoides naturales para una óptima pigmentación de la yema. DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, para gallinas de 17 a 18 semanas. ADVERTENCIAS: Retirar 15 días previos al sacrificio de los animales destinados al consumo humano.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos yprotegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto conparedes.                    USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1063,7,6,'Alimento balanceado medicado para gallinas de postura de 17 a 18 semanas de edad.ALIMENTO PREPOSTURA es un alimento diseñado, formulado y elaborado para satisfacer lasnecesidades de la gallina de postura de 17 a 18 semanas justo para arrancar el periodo de postura.Con ingredientes altamente digestibles que asegura mejor conversión, logrando una mayor saludintestinal y menor huevo sucio.Contiene carotenoides naturales para una óptima pigmentación de la yema. DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, para gallinas de 17 a 18 semanas. ADVERTENCIAS: No requiere tiempo de retiro.No debe de usarse en patos, gansos y palomas.No agregar o mezclar con otras drogas u otro antibiótico.No usarse en rumiantes.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos yprotegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimentodirectamente sobre el suelo y/o en contacto con paredes.                  USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1064,8,6,'Alimento balanceado diseñado, formulado y elaborado para cubrir los requerimientos nutrimentales de conejos de engorda y conejos reproductores en condiciones de explotación extensiva, contienel balance ideal de energía, grasa, fibra digestible e indigestible, proteina, aminoácidosesenciales, minerales, vitaminas y aditivos, siendo un producto completo de buena calidad que proporcionará a sus conejos un óptimo rendimiento productivo y reproductivo.DOSIS Y VIA DE ADMINISTRACION.:OralCONEJOS EN ENGORDA: Alimentación a libre acceso.HEMBRAS VACÍAS: 100 a 120 gramos al día.HEMBRAS GESTANTES: 125 a 175 gramos al día durante los primeros 20 días de la gestación; y 175 a 250 gramos al día durante los últimos 10 días de la gestación.HEMBRAS LACTANTES: Alimentación a libre acceso.Al final de la lactancia es probable que la hembra junto con su camada puedan consumir más de 500 gramos al día.MACHOS ACTIVOS: 150 a 200 gramos al día, dependiendo de la actividad sexual y de su condición corporal.MACHOS EN REPOSO: 100 a 125 gramos, dependiendo de su condición corporal.      ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.            USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1065,9,6,'Alimento balanceado diseñado, formulado y elaborado para cubrir los requerimientos nutrimentales de conejos de engorda y conejos reproductores en condiciones de explotación extensiva, contienel balance ideal de energía, grasa, fibra digestible e indigestible, proteina, aminoácidosesenciales, minerales, vitaminas y aditivos, siendo un producto completo de buena calidad que proporcionará a sus conejos un óptimo rendimiento productivo y reproductivo.DOSIS Y VIA DE ADMINISTRACION.:OralCONEJOS EN ENGORDA: Alimentación a libre acceso.HEMBRAS VACÍAS: 100 a 120 gramos al día.HEMBRAS GESTANTES: 125 a 175 gramos al día durante los primeros 20 días de la gestación; y 175 a 250 gramos al día durante los últimos 10 días de la gestación.HEMBRAS LACTANTES: Alimentación a libre acceso.Al final de la lactancia es probable que la hembra junto con su camada puedan consumir más de 500 gramos al día.MACHOS ACTIVOS: 150 a 200 gramos al día, dependiendo de la actividad sexual y de su condición corporal.MACHOS EN REPOSO: 100 a 125 gramos, dependiendo de su condición corporal.      ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.            USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
