	(1079,23,6,'Alimento balanceado medicado para gallinas de postura de segundo cicloALIMENTO PELECHA COMPLETO es un alimento diseñado, formulado y elaborado para satisfacerlas necesidades de la gallina de postura de segundo ciclo o al final del primero.Su presentación en harina con molienda gruesa asegura mejor conversión, logrando una mayor saludintestinal y menor huevo sucio.Contiene carotenoides naturales para una óptima pigmentación de la yema.DOSIS Y VIA DE ADMINISTRACION. A libre acceso oral, para gallinas de sgundo ciclo.ADVERTENCIAS: Retirar 15 dias previos al sacrificio de los animales destinadosal consumo humanoNo almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secosy protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1080,24,6,'Alimento balanceado medicado para gallinas de postura de segundo cicloALIMENTO PELECHA COMPLETO es un alimento diseñado, formulado y elaborado para satisfacerlas necesidades de la gallina de postura de segundo ciclo o al final del primero.Su presentación en harina con molienda gruesa asegura mejor conversión, logrando una mayor saludintestinal y menor huevo sucio.Contiene carotenoides naturales para una óptima pigmentación de la yema.DOSIS Y VIA DE ADMINISTRACION. A libre acceso oral, para gallinas de sgundo ciclo.ADVERTENCIAS: No requiere teimpo de retiroNo debe usarse en patos, gansos y palomas.No agregar o mezclar con otras drogas u otro antibióticoNo usarse en rumiantesNo almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secosy protegidos de roedores , insectos y otros animales.Estibar sobre tarimasy nunca dejar el alimento directamente en el suelo y/o en contacto con paredes                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1081,25,6,'Alimento balanceado medicado con monensina para vacas lecheras.APILECHE 17%, es un alimento diseñado, formulado y elaborado con ingredientes de excelente calidad, que proveen los nutrimentos necesarios y de fácil digestión para vacas lecheras en producción.Este alimento es un concentrado, por lo que además deben de suministrarse forrajes de buena calidad (que nos aporta fibra necesaria para una buena digestión).Mantener en todo momento agua limpia y fresca.  DOSIS Y VÍA DE ADMINISTRACIÓN Oral. La cantidad a ofrecer de este alimento depende además de otros factores, de la producción promedio de leche. Se recomienda ofrecer 1 kg de estealimento por cada 3 litros de leche producida.Para formulación especial de ración integral con el uso de este alimento, favor de contactar con el Servicio Técnico de maltaCleyton.® ADVERTENCIAS: Suspender el consumo 3 días antes del sacrificio de los animales destinados para consumo humano.No se administre a equinos.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento ypérdida de propiedades nutrimentales.                             \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
