	(1111,55,6,'ESPECIE(S) DESTINO: Camarón (Litopenaeus vannamei). INDICACIONES: Alimento balaceado para Camarón en estanquería de engorda, hasta que alcancen el peso de cosecha. DOSIS Y VIA DE ADMINISTRACION: 5.6 % de la Biomasa con un peso de 4 g del camarón, 3.8 % de la Biomasa cuando el peso del camarón es de 7 g, 3.1 % de la Biomasa con un peso del camarón de 10 g,  2.8 % de la Biomasa cuando el peso del camarón es de 12 g  y 2.5 % de la Biomasa cuando el peso del camarón es de 15 g. Oral. ADVERTENCIAS: Almacene este alimento al resguardo de la luz solar directa, lluvia y otros agentes externos. Estíbelo sobre tarimas, nunca en contacto directo con el piso y paredes para evitar que el alimento absorba humedad. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                    \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
