	(1115,59,6,'ESPECIE(S) DESTINO: Camarón (Litopenaeus vannamei).Alimento balanceado para camarón en el periodo de pre-cria en raceways.La falta de un alimento bien balanceado nutricionalmente incrementa la incidencia de enfermedadasí mismo un buen alimento favorece la ganancia de peso, disminuyendo el tiempo de engordalo cual incrementa la rentabilidad.Apicamarón Raceways 0 es un alimento iniciador hasta 800 micras desarrollado con ingredientes tales como: proteinas marinas de alta digestibilidad, aminoácidos, fosfolípidos minerales orgánicosácidos grasos omeda 3 y 6, colesterol, para dar el máximo potencial de crecimiento.DOSIS Y VIA DE ADMINISTRACIÓN : Oral. Guia de alimentación         Edad camarón       Tasa de alimentación (%BW)         pl.- 18,19                        24         pl.-20,21                         23         pl.- 22,23                        22         pl.-24,25                         21         pl.-26,27                         20         pl.-28,29,30                   19         pl.- 31,32                        18         pl.-33,34                         17         pl.-35                               16         pl.-36                               15         pl.-37                               14         pl.-38                                13ADVERTENCIAS: No almacene este alimento en lugares húmedos , mal ventilados o claientes,Colóoquelo en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otrosanimales nocivos al alimento. Estíbelo sobre tarimas o polines y nunca sobre el suelo directopara evitar que el alimento absorva humedad. Evite el acceso a sus bodegas a perosnas extrañasy toda clase de animales. De salida al alimento que tenga más tiempo en sus bodegas paraevitar su envejecimiento.       \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1116,60,6,'Alimento balanceado para camarón en estanquería de engorda, desde los 15 g. de peso y hasta que alcancen el peso de cosecha.ESPECIE(S) DESTINO: Alimento balanceado para Camarón (Litopenaeus vannamei).DOSIS Y VÍA DE ADMINISTRACIÓN: Vía Oral.Administrar 2.5 de la Biomasa cuando el peso del camarón es de 15 g, 2.2% de la Biomasa cuando el pesodel camarón es de 18 g, 2.1% de la Biomasa cuando el peso del camarón es de 20 g y 1.7 % de la Biomasacuando el peso del camarón llega a los 23 g.ADVERTENCIAS:No almacene este alimento en lugares húmedos, mal ventilados o calientes. Estíbelos sobre tarimasnunca en contacto directo con el piso y paredes para evitar que el alimento absorba humedad.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimentoque tenga más tiempo en sus bodegas para evitar su envejecimiento.                       \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1117,61,6,'Alimento balanceado para camarónUSO Y ESPECIES EN LA QUE SE EMPLEA: Alimento balanceado para Camarón (LitopenaeusVannamei) en estanqueria de engorda, desce los 15g de peso hasta alcancen el peso de cosechaDOSIS Y VIA DE ADMINISTRACION: 2.5% de la Biomasa cuando el peso del camarón es de 15  g 2.2% de la Biomasa cuando el peso del camarón es de 18 g, 2.1% de la Biomasa cuando el pesodel camarón es de 20 g y de 1.7% de la Biomasa cuando el peso del camarón llega a los 23 g Oral.ADVERTENCIAS:Almacene este alimento al resguardo de la luz solar directa, lluvia y otros agentes externos. Estíbelosobre tarimas, nunca en contacto directo con el piso y paredes para evitar que el alimento absorbahumedad. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimentoque tenga más tiempo en sus bodegas para evitar su envejecimiento.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1118,62,6,'Alimento balanceado para camarónUSO Y ESPECIES EN LA QUE SE EMPLEA: Alimento balanceado para Camarón (LitopenaeusVannamei) posterior a la pre cria y en fase de iniciación o en los estanques de engorda desde los3 - 4 g y hasta que alcancen los 15 g de peso.DOSIS Y VIA DE ADMINISTRACION: 5.6 % de la Biomasa con un peso de 4 g del camarón, 3.8 % de la Biomasa cuando el peso del camarón es de 7 g, 3.1% de la Biomasa cuando el pesodel camarón es de 10 g, 2.8% de la Biomasa cuando el peso del camarón es de 12 g y de 2.5 %de la Biomasa cuando el peso del camarón es de 15 g . OralADVERTENCIAS:Almacene este alimento al resguardo de la luz solar directa, lluvia y otros agentes externos. Estíbelosobre tarimas, nunca en contacto directo con el piso y paredes para evitar que el alimento absorbahumedad. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimentoque tenga más tiempo en sus bodegas para evitar su envejecimiento.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1119,63,6,'ESPECIE(S) DESTINO: Camarón (Litopenaeus vannamei).APICAMARÓN 1 (Post-larva) 30% de proteína es un alimento, diseñado para ser suministrado desde que los juveniles alcanzan los 7 g de peso hasta que adquieran aproximadamente 16 g de peso.APICAMARÓN 1 (Post-larva) 30% de proteína es un alimento en pellet estable en el agua, lo que permite el aprovechamiento del alimento. La cantidad a suministrar dependerá de las densidades de siembra; los parámetros físico-químicos del agua, las condiciones de productividad del estanque y su sanidad.La formulación de APICAMARÓN 1 (Post-larva) 30% de proteína incluye recientes avances nutricionales. Contiene los requerimientos adecuados de aminoácidos, ácidos grasos, vitaminas y minerales, para producir óptimas tasas de crecimiento y conversión alimenticia.DOSIS Y VIA DE ADMINISTRACION: Oral. RECOMENDACIONES PARA SU USODe 5 a 7 semanas con 7-8g de peso, biomasa de 5-6% Dar 21 kg si hay 5 POST-LARVAS/m e 2,dar 42 kg si hay 10 POST-LARVAS/m e 2, dar 63 kg si hay 15 POST-LARVAS/m e 2, De 7 A 9 semanas con 3-5gde peso, biomasa de 4-5% Dar 20 kg si hay 5 POST-LARVAS/m e 2,dar 40 kg si hay 10 POST-LARVAS/m e 2,dar 60 kg si hay 15 POST-LARVAS/m e 2, De 9 A 10  semanas con 5-7g de peso, biomasa de 4% Dar 18kg kg si hay 5 POST-LARVAS/m e 2,dar 36 kg si hay 10 POST-LARVAS/m e 2, dar 54 kg si hay 15 POST-LARVAS/m e 2, De 10 a 11 semanas con 10-12g de peso, biomasa de 3.5-4% Dar 20 kg si hay 5 POST -LARVAS/m e 2,dar 40 kg si hay 10 POST-LARVAS/m e 2, dar 60 kg si hay 15 POST-LARVAS/m e 2, De 11 a 12 semanas con 12-14g de peso, biomasa de 3-3.3% Dar 21 kg si hay 5 POST-LARVAS/m e 2,dar 42 kg si hay 10 POST-LARVAS/m e 2, dar 63 kg si hay 15 POST-LARVAS/m e 2, De 12 a 13 semanas con 14-16g de peso, biomasa de 2.5-3% Dar 20 kg si hay 5 POST-LARVAS/m e 2,dar 42 kg si hay 10 POST-LARVAS/m e 2, dar 63 kg si hay 15 POST-LARVAS/m e 2.Estos datos no toman en cuenta la mortandad, ni los parámetros físico-químicos del estanque; porlo cual sólo deben usarse como una guía.ADVERTENCIAS: Almacene este alimento al resguardo de la luz solar directa, lluvia, y otros agentes externos. Estibelos sobre tarimas , nunca en contacto directo con el piso y paredes para evitar que el alimento absorba humedad. No almacene este alimento en lugares húmedos, mal ventilados o calientes . Evite el acceso a sus bodegas a personas extrañas  y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1120,64,6,'ESPECIE(S) DESTINO: Camarón (Litopenaeus vannamei).USO Y ESPECIES EN LAS QUE SE EMPLEA:Alimento balanceado y diseñado para camarón en estado de post-larva ya sea que hayan sido sembrados en Pre-criadores o a engordar directa.Se deberá suministrar por un periodo de 1 a 1.5 meses o hasta ue la post-larva alcance entre 1-2g                                                         RECOMENDACIONES PARA USO                                                  (Pre-criadero con densidad de 120 pl/m?2)                            Ración de alimento                                           Frecuencia de alimentación Veces por díaDIAS              Peso (g)        Biomasa(%)       (kg/ha)                                 1                         2                  3   2-10               0.05-0.10           20                       12                                   4                         4                410-19            0.10-0.25            18                       21                                   7                         7                720-28            0..25-0.40           15                       45                                  15                        15              15  29-37            0.40-0.60            13                       90                                  30                        30              3038-46            0.60-0.90            12                    120                                   40                        40               40>46                  >0.90              12                    120                                   40                         40              40    Estos datos no toman en cuenta la mortandad, ni los parámetros fisicoquímicos del estanque por lo que solo deben usarse como una guía.ADVERTENCIAS: Almacene este alimento al resguardo de la luz solar directa, lluvia y otros agentes externos, Estíbelo sobre tarimas, nunca en contacto directo con el piso y paredes para evitar que el alimento absorba humedad. No almacene este alimento en lugares húmedos, mal ventilados o o calientes. Evite el accceso a sus bodegas a personas extrañas y toda clase de animales. De salida al alimentoque tenga mas tiempo en sus bodegas para evitar su envejecimiento.              \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1121,65,6,'ESPECIE(S) DESTINO: Camarón (Litopenaeus vannamei). De 0.6 g a 1.1g. de pesoAlimento balanceado y diseñado para ser suministrado a los camarones en el periodo posterior al pre-criadero. Una vez sembrados en los estanques de engorda, por un periodo aproximado de 28 o días desde que las post-larvas hayan alcanzado entre 0.6 g. hasta que adquieran la talla de aproximadamente 1.1 g de peso.DOSIS Y VIA DE ADMINISTRACIÓN: OralPara calcular las primeras raciones se multiplica la biomasa total del estanque por el 25% de pesocorporal y esta se divide entre el número de raciones que se quieran ofrecer.ADVERTENCIAS:No almacene este alimento en lugares húmedos, mal ventilados o calientes. Estíbelos sobre tarimasnunca en contacto directo con el piso y paredes para evitar que el alimento absorba humedad.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimentoque tenga más tiempo en sus bodegas para evitar su envejecimiento.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1122,66,6,'ESPECIE(S) DESTINO: Camarón (Litopenaeus vannamei). De 1.1 g. a 2.5g. De peso.Alimento balanceado y diseñado para ser suministrado a los camarones en el periodo posterior al pre-criadero. Una vez sembrados en los estanques de engorda, por un periodo aproximado de 30 días o desde que las post-larvas hayan alcanzado entre 1.1 g. hasta que adquieran la talla de aproximadamente 2.5 g de peso.DOSIS Y VIA DE ADMINISTRACIÓN: OralPara calcular las primeras raciones se multiplica la biomasa total del estanque por el 25% de pesocorporal y esta se divide entre el número de raciones que se quieran ofrecer.ADVERTENCIAS:No almacene este alimento en lugares húmedos, mal ventilados o calientes. Estíbelos sobre tarimasnunca en contacto directo con el piso y paredes para evitar que el alimento absorba humedad.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimentoque tenga más tiempo en sus bodegas para evitar su envejecimiento.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1123,67,6,'ESPECIE(S) DESTINO: Camarón (Litopenaeus vannamei). De 0.003 g a 0.6g. De pesoAlimento balanceado y diseñado para ser suministrado a los camarones en el periodo de pre-críaUna vez sembrados en los estanques, por un periodo aproximado de 28 dìas desde que laspost-larvas hayan alcanzado entre 0.003 g. hasta que adquieran la talla de aproximadamente 0.6 g de peso.DOSIS Y VIA DE ADMINISTRACIÓN: OralPara calcular las primeras raciones se multiplica la biomasa total del estanque por el 25% de pesocorporal y esta se divide entre el número de raciones que se quieran ofrecer.ADVERTENCIAS:No almacene este alimento en lugares húmedos, mal ventilados o calientes. Estíbelos sobre tarimasnunca en contacto directo con el piso y paredes para evitar que el alimento absorba humedad.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimentoque tenga más tiempo en sus bodegas para evitar su envejecimiento.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1124,68,6,'ESPECIE(S) DESTINO: Camarón (Litopenaeus vannamei). Etapa engorda inicial.Alimento balanceado medicado con oxitetraciclina, antibiótico de amplio espectro, y efecto bactericida, para el tratamiento de los siguientes géneros bacterianos, que afectan al camarón:Rickettsia spp. (Hepatopancreatitis necrotizante, NHP), Vibrio spp, Pseudomonas spp., Aeromonasspp. Está diseñado para ser suministrado a los camarones en la fase inicial de crecimiento entre los 16 g y hasta que adquieran la talla de aproximadamente 22 g de peso, a una densidad de 4 camarones pormetro cuadrado. DOSIS Y VIA DE ADMINISTRACION:ORALEl suministro de alimento es calcculado en base al 20% de la biomasa obtenida y dividido entre el número veces que se requiera servir de acuerdo al manejo de cada granja. Se administra durante un periodo de 7 a 14 días consecutivos.ADVERTENCIAS:No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que absorba humedad. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.Retirar este alimento 30 días previos a la cosecha de los camarones destinados al consumo humano.                 \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1125,69,6,'Alimento balanceado diseñado para ser suministrado a los camarones en el periodo posterior al pre-criadero, en la fase de iniciación. Una vez sembrados en los estanques de engorda, por un periodo aproximado de la 1° a la 5° semana o desde que las post-larvas hayan alcanzado entre 1-2 g hasta que adquieran apróx. 7 g de peso.  DOSIS Y VIA DE ADMINISTRACION: Oral.RECOMENDACIONES PARA SU USO: Tabla de Alimentación (kg/Ha/día)Semanas: 1 - 2 Peso (g): 1  3 Biomasa (%): 12  10POST-LARVAS POR m2: 5: 6.0 10: 12.0 15: 18.0 30: 36.0 60: 72.0 120: 144.0Semanas: 2 - 3 Peso (g): 3  5 Biomasa (%): 10  8POST-LARVAS POR m2: 5: 15.0 10: 30.0 15: 45.0 30: 90.0 60: 180.0 120: 360.0Semanas: 3 - 5 Peso (g): 5  7 Biomasa (%): 8  6POST-LARVAS POR m2: 5: 20.0 10: 40.0 15: 60.0 30: 120.0 60: 240.0 120: 480.0Estos datos no toman en cuenta la mortandad, ni los parámetros fisicoquímicos del estanque, por lo que sólo deben usarse como una guía. ADVERTENCIAS: Almacene este alimento al resguardo de la luz solar directa, lluvia y otros agentes externos, Estíbelo sobre tarimas, nunca en contacto directo con el piso y paredes para evitar que el alimento absorba humedad. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar en su envejecimiento.            IMPORTADO POR ALIMPORT LA HABANA CUBA\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1126,70,6,'ESPECIE(S) DESTINO: Camarón (Litopenaeus vannamei). Etapa engorda inicial.Alimento balanceado medicado con oxitetraciclina, antibiótico de amplio espectro, y efecto bactericida, para el tratamiento de los siguientes géneros bacterianos, que afectan al camarón:Rickettsia spp. (Hepatopancreatitis necrotizante, NHP), Vibrio spp, Pseudomonas spp., Aeromonasspp. Diseñado para ser suministrado a los camarones en la fase inicial de crecimiento una vez sembradosen los estanques de engorda, por un periodo aproximado de 28 días o desde que los camarones hayan alcanzado entre 2.5 g. de peso y hasta que adquieran la talla de aproximadamente 5 g de peso.DOSIS Y VIA DE ADMINISTRACION: OralEl suministro de alimento es calcculado en base al 20% de la biomasa obtenida y dividido entre el número de veces que se requiera servir de acuerdo al manejo de cada granja. Se administra duranteun periodo de 7 a 14 días consecutivos.ADVERTENCIAS:No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que absorba humedad. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.Retirar este alimento 30 días previos a la cosecha de los camarones destinados al consumo humano.                 \r','2017-07-27 13:25:02','2017-07-27 17:25:02');
