	(1133,77,6,'Alimento balanceado diseñado para ser suministrado para ser suministrado a los camarones en el periodo posterior al pre-criadero, en la fase de iniciación. Una vez sembrados en los estanques deengorda, por un periodo aproximado de la 13° a la 18° semana o desde que las post-larvas hayanalcanzado entre 16 g hasta que adquieran la talla de cosecha de aproximadamente 22 g de peso.DOSIS Y VIA DE ADMINISTRACION: Oral. RECOMENDACIONES PARA SU USO:Tabla de alimentación (kg/Ha/día) De 1 a 2 semanas con 1-3g de peso, biomasa de 10-12% Dar 6 kg si hay 5 larvas/m e 2,dar 12 kg si hay 10larvas /m e 2, dar 18 kg si hay 15 larvas/m e 2, dar 36 kg si hay 30 larvas/m e 2, dar 72 kg si hay 60 larvas/m e 2, dar 144 kg si hay 120 larvas/m e 2.De 2 a 3 semanas con 3-5g de peso, biomasa de 8-10% Dar 15 kg si hay 5 larvas/m e 2,dar 30 kg si hay 10larvas /m e 2, dar 45 kg si hay 15 larvas/m e 2, dar 90 kg si hay 30 larvas/m e 2, dar 180 kg si hay 60 larvas/m e 2, dar 360 kg si hay 120 larvas/m e 2.De 3-5 semanas con 5-7 g, Biomasa de 6-8%. Dar 20 kg si hay 5 larvas/me2, dar 40 kg si hay 10laravas/me2, dar 60 kg si hay 15 larvas/me2, dar 120 kg si hay 30 larvas/me2, dar 240 kg si hay 60larvas/me2, dar 480 kg  si hay 120 larvas/me2Estos datos no toman en cuenta la mortandad, ni los parámetros fisicoquímicos del estanque, por lo que sólo deben usarse como guía.ADVERTENCIAS: Almacene este alimento al resguardo de la luz solar directa,lluvia y otros agentesexternos. Estíbelo sobre tarimas, nunca en contacto directo con el piso y paredes para evitar que elalimento absorba humedad. No almacene este alimento en lugares húmedos, mal ventilados o calientes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimentoque tenga más tiempo en sus bodegas para evitar su envejecimiento.         IMPORTADO POR ALIMPORT LA HABANA CUBA\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
