	(1152,96,6,'Alimento balanceado para vacas lecherasAPILECHE PLUS 17% es un alimento diseñado, formulado y elaborado con ingredientes de excelente calidad que proveen los nutrimientos necesarios y de fácil digestión para vacas lecheras en producción .Este alimento es un concentrado, por lo que ademas deben de suministrarse forrajes de buena calidad (que nos aporta fibra necesaria para buena digestión). Mantener en todo momento agualimpia y fresca.DOSIS Y VIA DE ADMINISTRACIÓN. Oral. La cantidad a ofrecer de este alimento depende además de otros factores de la producción promedio de lechePara vacas que producen menos de 9 litros/día, ofrecer ½ kg. por cada 2 litros de leche producida, más forrajes de buena calidad.Para vacas que producen entre 9 y 18 litros/día, ofrecer ½ kg. por cada 1  1/2 litros de leche producida, más forrajes de buena calidad.Para vacas que producen entre 18 y 22 litros/día, ofrecer ½ kg. por cada 1 litro de leche producida, más forrajes de buena calidad.Para vacas que producen más de 22 litros/día, ofrecer todo el alimento que puedan consumir, más forrajes de buena calidad.Para formulación especial de racion integral con el uso de este alimento favor de contactar al servicio Tecnico de maltacleyton®.               USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
