	(1155,99,6,'Alimento diseñado, formulado y elaborado para satisfacer las necesidades del macho  reproductor semipesado  de  19 a 39 semanas de edad. Con ingredientes altamente digestibles que asegura mejor conversión, logrando una mayor salud intestinal,  que se refleja en mejor fertilidad. Contiene carotenoides naturales.USO Y ESPECIES EN LAS QUE SE EMPLEA: Aves. Alimento para machos reproductores en etapa de reproducción. DOSIS Y VIA DE ADMINISTRACION: Oral. De 120 a 130 gramos por gallo.ADVERTENCIAS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. No usar para la engorda de pollos y aves jóvenes.                        \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1156,100,6,'Alimento balanceado para rumiantes.APIMEL está diseñado, formulado y elaborado con ingredientes de buena calidad, ideal para complementar la alimentación de rumiantes, que principalmente se tienen en condiciones de pastoreo de forrajes de mala a regular calidad, así como alimentados con rastrojos, pajas y otros subproductos agrícolas y agroindustriales y/o complementados también con granos disponibles. Mantener en todo momento agua limpia y fresca para sus vacas. DOSIS Y VIA DE ADMINISTRACION: Oral. Dependiendo de la condición particular, este alimento se ofrecerá a razón del 1 al 3% del peso vivo de animal. Para formulación especial de raciones con el uso de este alimento, favor de contactar con el Servicio Técnico de maltaCleyton®.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1157,101,6,'Alimento balanceado medicado con zilpaterol para finalización de ganado bovinoAPINOVILLO SUPER ENGORDA, es un alimento diseñado, formulado y elaborado con ingredientes debuena calidad, que proveen los nutrimientos necesarios y de fácil digestion para ganado bovino en finalizción; incluye clorhidrato de zipaterol, el cual es un promotor no esteroidal que mejora el rendimiento de la canal, reduce la cantidad de grasa, y ademas mejora la ganancia de peso y conversión alimenticia.DOSIS Y VIA DE ADMINISTRACIÓN: Oral. Durante la finalización, últimos 30 días de la engorda del ganado bovino, ofrecer este alimentoo a libre acceso con la indicación de que para ganado de entre400 y 500 kilos de peso vivo, el consumo aproximado deberá de ser  de 10 y 12 kilos por cabeza por diaMantener en todo momento agua limpia y fresca para su ganado. Para alguna formulación especialcon este alimento, favor de contactar al servicio técnico de maltaCleyton®.ADVERTENCIAS: Este alimento debe de retirarse 3 días antes del sacrificio del ganado que será destinado a consumo humano                            USO VETERINARIO.CONSULTE AL MEDICO VETERINARIO \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1158,102,6,' Alimento Completo Para Iniciacion De Truchas. API-TRUCHA 1 (INICIACION) Es un alimento completo cientificamente balanceado y diseñado paraser suministrado a las Truchas en el periodo posterior a la etapa de alevinaje hasta que alcancen laetapa de DESARROLLO aproximadamente los 50 gramos de peso. API-TRUCHA 1 (INICIACION) Es un alimento flotante extruido que permite un mejor aprovechamientodel alimento a la vez que permite un examen visual constante de las TRUCHAS durante la alimentacion. La cantidad a suministrar dependera de: La temperatura del estanque, oxigeno disuelto, productividaddel agua y sanidad de la misma. La formulacion de API-TRUCHA 1 (iniciacion) Incluye los mas recientes avances tecnologicos ynutricionales en el alimento acuicola, contiene los requerimientos relativos a los perfiles de aminoaciodos, acidos grasos, omega 3 y 6, vitaminas y minerales para producir optimas tasas de crecimiento y conversion alimenticia. CONSEJOS PRACTICOSProtejalos de la luz solar directa por el alto contenido de vitaminas y aceite, estibelo sobre tarimas enlugar seco para evitar que el alimento absorba humedad del suelo, libre de plagas, insectos, reodoresy animales nocivos.             \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1159,103,6,' Alimento Completo Para Iniciacion De Truchas. API-TRUCHA 1 (INICIACION) Es un alimento completo cientificamente balanceado y diseñado paraser suministrado a las Truchas en el periodo posterior a la etapa de alevinaje hasta que alcancen laetapa de DESARROLLO aproximadamente los 50 gramos de peso. API-TRUCHA 1 (INICIACION) Es un alimento flotante extruido que permite un mejor aprovechamientodel alimento a la vez que permite un examen visual constante de las TRUCHAS durante la alimentacion. La cantidad a suministrar dependera de: La temperatura del estanque, oxigeno disuelto, productividaddel agua y sanidad de la misma. La formulacion de API-TRUCHA 1 (iniciacion) Incluye los mas recientes avances tecnologicos ynutricionales en el alimento acuicola, contiene los requerimientos relativos a los perfiles de aminoaciodos, acidos grasos, omega 3 y 6, vitaminas y minerales para producir optimas tasas de crecimiento y conversion alimenticia. CONSEJOS PRACTICOSProtejalos de la luz solar directa por el alto contenido de vitaminas y aceite, estibelo sobre tarimas enlugar seco para evitar que el alimento absorba humedad del suelo, libre de plagas, insectos, reodoresy animales nocivos.             \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1160,104,6,' API-TRUCHA 3 (ENGORDA) Es un alimento completo cientificamente balanceado y diseñado paraser suministrado a las Truchas a partir de los 100g hasta la cosecha. API-TRUCHA 3 (ENGORDA) Es un alimento extruido de undimiento lento que permite un mejoraprovechamiento del mismo alimento. Dependiendo de las condiciones de manejo y calidad del agua se puede esperar conversiones de entre 1.5.1 Y 1.8.1 CONSEJOS PRACTICOSProtejalos de la luz solar directa por el alto contenido de vitaminas y aceite, estibelo sobre tarimas enlugar seco para evitar que el alimento absorba humedad del suelo, libre de plagas, insectos, reodoresy animales nocivos.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1161,105,6,' API-TRUCHA 3 (ENGORDA) Es un alimento completo cientificamente balanceado y diseñado paraser suministrado a las Truchas a partir de los 100g hasta la cosecha. API-TRUCHA 3 (ENGORDA) Es un alimento extruido de undimiento lento que permite un mejoraprovechamiento del mismo alimento. Dependiendo de las condiciones de manejo y calidad del agua se puede esperar conversiones de entre 1.5.1 Y 1.8.1 CONSEJOS PRACTICOSProtejalos de la luz solar directa por el alto contenido de vitaminas y aceite, estibelo sobre tarimas enlugar seco para evitar que el alimento absorba humedad del suelo, libre de plagas, insectos, reodoresy animales nocivos.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1162,106,6,'Alimento balanceado de mantenimiento para aves 100% de traspatio después de la 4ª semana de edad.AVES REGIO es un alimento diseñado, formulado y elaborado para satisfacer las necesidades de las aves 100% de traspatio. Después de la cuarta semana de edad.Su presentación en migaja gruesa asegura mayor consumo. Contiene pigmentos naturales. DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, después de la cuarta semana de edad. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos yprotegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1163,107,6,'Alimento balanceado medicado para avestruces reproductoras de la semana 20 de edad y durantetodo el ciclo de producción.AVESTRUZ REPRODUCTORA es un alimnto científicamente balanceado con granos, pastas oleaginosas  y subproductos de maíz, vitaminas y minerales, para cubrir las necesidades nutricionales en la fasede reproduccion ademas de tener la relación calcio fosforo ideal para formación de una buena calidad de cascarón.DOSIS Y VIA DE ADMINISTRACION : a libre acceso vía oral, de la semana 20 de edad y durante todoel ciclo de producción.ADVERTENCIAS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secosy protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1164,108,6,'Concentrado proteico para mezclar con granos, forrajes o TRM.  Puede usarse para mezclarse con granos y otras materias primas para elaborar un alimento terminado para la producción lechera. USO Y ESPECIES EN LAS QUE SE EMPLEA: Bovinos. Para alimentación de vacas lecheras al inicio o en alta producciónDOSIS Y VIA DE ADMINISTRACION: Oral. Utilizar de 2 a 4 Kg por vaca al día, dependiendo del nivel de producción y de la composición de la ración base. Para formulación especial de ración integral con el uso de este concentrado y mayor información de su uso, favor de contactar con el servicio técnico de maltaCleyton®.Mantener en todo momento agua limpia y fresca para las vacas. ADVERTENCIAS: Ofrezca el alimento diariamente y no permita que consuman alimento en mal estado. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que absorba  humedad. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al  alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1165,109,6,'Concentrado proteico medicado con monensina para mezclar con granos, forrajes o TRM; indicado para la prevención de la coccidiosis causada por Eimeria bovis y E. zoemii; mejora la producción de leche; y en animales con problemas de cetosis.Apropiado para raciones a base de silo de maíz o deficitarias en nitrógeno soluble. Puede usarse para mezclarse con granos y otras materias primas para elaborar un alimento terminado para producción lechera. USO Y ESPECIES EN LAS QUE SE EMPLEA: Bovinos. Para alimentación de vacas lecheras en producción.DOSIS Y VIA DE ADMINISTRACION: Oral. Utilizar de 1 a 4 Kg por vaca al día dependiendo del nivel de producción.  Para formulación especial de ración integral con el uso de este concentrado y mayor información de su uso, favor de contactar con el servicio técnico de maltaCleyton®Mantener en todo momento agua limpia y fresca para las vacas.ADVERTENCIAS:Ofrezca el alimento diariamente y no permita que consuman alimento en mal estado. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que absorba humedad. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.Suspender el consumo 3 días antes del sacrificio de animales para consumo humano. No se administrarse con equinos                \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
