	(1168,112,6,'El alimento BECERRO ENGORDA 16% está diseñado, formulado y elaborado con ingredientes de buena calidad, adecuado para complementar la alimentación de ganado bovino de engorda, que principalmente se tiene en condiciones de pastoreo de forrajes de mala a regular calidad, así como alimentados con rastrojos, pajas y otros subproductos agrícolas y agroindustriales y/o complementados también con granos disponibles. Dependiendo de la condición particular, este alimento se  puede ofrecer a razón del 1 al 3% del peso vivo de animal. Para mayor información del uso de este producto, favor de contactar a su distribuidor o al asesor pecuario de maltaCleyton®. Mantener en todo momento agua limpia y fresca para su ganado.CONSEJOS PRÁCTICOS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1169,113,6,'El alimento BECERRO ENGORDA 16% está diseñado, formulado y elaborado con ingredientes de buena calidad, adecuado para complementar la alimentación de ganado bovino de engorda, que principalmente se tiene en condiciones de pastoreo de forrajes de mala a regular calidad, así como alimentados con rastrojos, pajas y otros subproductos agrícolas y agroindustriales y/o complementados también con granos disponibles. Dependiendo de la condición particular, este alimento se  puede ofrecer a razón del 1 al 3% del peso vivo de animal. Para mayor información del uso de este producto, favor de contactar a su distribuidor o al asesor pecuario de maltaCleyton®. Mantener en todo momento agua limpia y fresca para su ganado.CONSEJOS PRÁCTICOS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1170,114,6,'El alimento BECERRO ENGORDA 16% está diseñado, formulado y elaborado con ingredientes de buena calidad, adecuado para complementar la alimentación de ganado bovino de engorda, que principalmente se tiene en condiciones de pastoreo de forrajes de mala a regular calidad, así como alimentados con rastrojos, pajas y otros subproductos agrícolas y agroindustriales y/o complementados también con granos disponibles. Dependiendo de la condición particular, este alimento se  puede ofrecer a razón del 1 al 3% del peso vivo de animal. Para mayor información del uso de este producto, favor de contactar a su distribuidor o al asesor pecuario de maltaCleyton®. Mantener en todo momento agua limpia y fresca para su ganado.CONSEJOS PRÁCTICOS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1171,115,6,'Alimento balanceado medicado para bovinos con registro en exposiciónBEEF ROL EXPO es un alimento diseñado, formulado y elaborado para que el ganado de registromanifieste su potencial genético en las exposiciones, expresando vigor, musculatura y pelo brillanteIncluye ingredientes que proveen de una excelente fuente de proteina de sobrepaso 100% vegetallos cual garantiza que lleguen suficientes aminoácidos especialmente lisina, metionina y treoninaal intestino delgado, los cuales son muy importantes para la síntesis del tejido muscular.BEEF ROL EXPO  contiene minrales quelatados como el cobre y el zinc (metionina de zinc)los cuales producen pelo brillante. Mantener en todo momento agua limpia y fresca para su ganadoDOSIS Y VIA DE ADMINISTRACION: Oral. Para conseguir un acabado perfecto ofrecer a libre acceso 80% de BEEF ROL EXPO y 20% de forraje.Para formulación o uso especial de este alimento favor de contactar al Servicio Técnico de maltaCleyton®.ADVERTENCIAS. Retirar este alimento 3 dias previos al sacrificio de los animales destinados al consumo humano.                    \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1172,116,6,'Alimento balanceado medicado con zilpaterol para finalización de ganado bovinoBEEF ROL MAX es un alimento diseñado, formulado y elaborado con ingredientes de buena calidadque proveen los nutrimientos necesarios y de fácil digestión para ganado bovino en finalización; incluye clorhidrato de zilpaterol , el cual es un promotor no esteroidal que mejora el rendimiento de lacanal, reduce la cantidad de grasa, y además mejora la ganancia de peso y la conversión alimenticia DOSIS Y VIA DE ADMINISTRACION: Oral. Durante la finalización, últimos 30 días de engroda del ganado bovino, ofrecer este alimento a libre acceso; con la indicación de que para ganado de entre 400 y 500 kilos de peso vivo, el consumo aproximado deberá de ser de 10 y 12 kilos por cabeza por día. Mantener en todo momento agua limpia y freca para su ganado. Para alguna información especial con este alimento, favor de contactar al Servicio Tecnico de maltaCleyton®. ADVERTENCIAS: Este alimento debe de retirarse 3 días antes del sacrificio del ganado que seradestinado al consumo humano                 USO VETERINARIO.CONSULTE AL MEDICO VETERINARIO \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1173,117,6,'Alimento balanceado para peces, desarrollado con los últimos avances tecnológicos en todo tipo de sistemas de producción; semi-intensivos, intensivos e híper-intensivos abarcando estanqueria de concreto, membranas y jaulas. Por su perfil nutricional está recomendado para ser utilizado en cultivos de climas templados y tropicales y para suministrarse a peces una vez que dejan de consumirel alimento de harina  de 50% de proteina (alevinaje). Por sus dos presentaciones en extruido flotante de 1.5 mm  y 2.5 mm se garantiza una mejor asimilación de los nutrientes que se traducen en mejores conversiones alimenticias y se eficientiza el proceso de alimentación ya que se puede determinarcon certeza el % de alimento a suministrar  una vez que se puede confirmar el consumo del mismo al mantenerse en la superficie.ESPECIE(S) DESTINO : Peces. Tilapias (Oreochromis niloticus) Mojarra,Truchas (Oncorhynchus mykiss)Trucha Arcoiris, Bagre (Ictalurus punctatus) Bagre de canal.DOSIS Y VIA DE ADMINISTRACION: Oral. Recomendado para ser suministrado a peses de 5 g y hasta que alcancen los 40 g de peso ofreciendo en esta etapa el 6%- 5 % de su biomasa en por lo menos 5-4 raciones al día.ADVERTENCIAS :Protéjalo de la luz solar directa, lluvia y otros agentes externos. Estíbelo sobre tarimas, nunca en contacto directo con el piso y paredes para evitar que el alimento absorba humedad, No almacene este alimento en lugares húmedos mal ventilados o calientes. Evite el acceso a sus bodegasa personas extrañas y toda clase de animales. De salida al alimento que tenga más tiempo en susbodegas para evitar su envejecimiento.                \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1174,118,6,'Alimento balanceado para peces, desarrollado con los últimos avances tecnológicos en todo tipo de sistemas de producción; semi-intensivos, intensivos e híper-intensivos abarcando estanqueria de concreto, membranas y jaulas. Por su perfil nutricional está recomendado para ser utilizado en cultivos de climas templados y tropicales y para suministrarse a peces una vez que dejan de consumirel alimento de harina  de 50% de proteina (alevinaje). Por sus dos presentaciones en extruido flotante de 1.5 mm  y 2.5 mm se garantiza una mejor asimilación de los nutrientes que se traducen en mejores conversiones alimenticias y se eficientiza el proceso de alimentación ya que se puede determinarcon certeza el % de alimento a suministrar  una vez que se puede confirmar el consumo del mismo al mantenerse en la superficie.ESPECIE(S) DESTINO : Peces. Tilapias (Oreochromis niloticus) Mojarra,Truchas (Oncorhynchus mykiss)Trucha Arcoiris, Bagre (Ictalurus punctatus) Bagre de canal.DOSIS Y VIA DE ADMINISTRACION: Oral. Recomendado para ser suministrado a peses de 5 g y hasta que alcancen los 40 g de peso ofreciendo en esta etapa el 6%- 5 % de su biomasa en por lo menos 5-4 raciones al día.ADVERTENCIAS :Protéjalo de la luz solar directa, lluvia y otros agentes externos. Estíbelo sobre tarimas, nunca en contacto directo con el piso y paredes para evitar que el alimento absorba humedad, No almacene este alimento en lugares húmedos mal ventilados o calientes. Evite el acceso a sus bodegasa personas extrañas y toda clase de animales. De salida al alimento que tenga más tiempo en susbodegas para evitar su envejecimiento.                \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1175,119,6,'Alimento balanceado medicado para borregas reproductorasBORREGAS REPRODUCTORAS es un alimento balanceado, diseñado, formulado y elaborado con ingredientes de buena calidad, que proveen los nutrimentos necesarios y de fácil digestión y aprovechamiento para borregas de cría. Está formado de granos rolados y molidos que proveen la energía necesaria para ganancias de peso adecuadas, complementado con ingredientes de primera calidad que proporcionan el resto de las necesidades de proteína, minerales, vitaminas y aditivosPuede solicitar mayor información y asesoría del uso de este alimento al servicio técnico de maltaCleyton®.Importante mantener en todo momento agua limpia y fresca para sus borregos. DOSIS Y VIA DE ADMINISTRACION: Oral. Para borregas en gestación, complementar al forraje que estén consumiendo con BORREGAS REPRODUCTORAS a razón de 250 a 500 gramos/día durante los primeros 4 meses, y de aquí hasta el parto ofrecer 500 a 1000 gramos/día.Para borregos de lactancia, complementar el forraje que estén consumiendo con borregas reproductoras a razón de 1000-1500 gramos/día dependiendo de la condición corporal y de su número de corderos amamantando (en caso de perdida de condición corporal incremente la cantidad de alimento y consulte a nuesto asesor pecuario).ADVERTENCIAS. No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y frescos. Prtegidos de redores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto de paredes                \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1176,120,6,'Alimento balanceado medicado para borregos.BORREGO GANADOR es un alimento balanceado completo, diseñado, formulado y elaborado con ingredientes de buena calidad, que proveen los nutrimentos necesarios y de fácil digestión y aprovechamiento para borregos en el periodo de engorda y finalización, así como para borregas de cría.Está formado de granos rolados y/o molidos que proveen la energía necesaria para ganancias de peso adecuadas, complementado con ingredientes que proporcionan el resto de las necesidades de proteína, minerales, vitaminas y aditivos.  DOSIS Y VIA DE ADMINISTRACION:Para borregos en engorda, ofrecer BORREGO GANADOR a libre acceso, más forraje de lastre (rastrojos, pajas, etc.)Para borregas en gestación, complementar al forraje que estén consumiendo con BORREGO GANADOR  a razón de 250 a 500 gramos/día durante los primeros 4 meses, y de aquí hasta el parto ofrecer 500 a 1000 gramos/día.Para borregas en lactancia, complementar al forraje que estén consumiendo con BORREGO GANADOR  a razón de 1000-1500 gramos/día, dependiendo de la condición corporal y del número de corderos amamantando (en caso de pérdida de condición corporal incremente la cantidad de alimento y consulte a nuestro asesor pecuario).Importante mantener en todo momento agua limpia y fresca para sus borregos.  ADVERTENCIAS: No almacenar el alimento terminado en lugares húmedos, calientes, y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo o en contacto con paredes.            \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1177,121,6,'Alimento balanceado multipartículas medicado para engorda de borregosBORREGOS FORTE es un alimento balanceado multipartículas, diseñado, formulado y elaborado con ingredientes de excelente calidad, que proveen los nutrimentos necesarios y de fácil digestión y aprovechamiento para borregos en el periodo de engorda y finalización.Está formado de una mezcla de granos enteros o rolados o molidos  que proveenla energía necesaria para ganancias de peso adecuadas, y que además mejoran el consumo, la conversión alimenticia y la calidad de la canal. Complementado con otras fuentes que proporcionanel resto de las necesidades de proteína, minerales, vitaminas y aditivos para mejorar el desempeño de sus borregos.Importante mantener en todo momento agua limpia y fresca para sus borregos. Puede solicitar mayor información de este alimento al servicio técnico de maltaCleyton®.DOSIS Y VIA DE ADMINISTRACION: Oral. Ofrecer el alimento BORREGOS FORTE a libre acceso en el periodo señalado. Incluir forraje de lastre de buena calidad.ADVERTENCIAS. No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y frescos. Prtegidos de redores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto de paredes                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1178,122,6,'Alimento balanceado multipartículas medicado para engorda de borregosBORREGOS FORTE es un alimento balanceado multipartículas, diseñado, formulado y elaborado con ingredientes de excelente calidad, que proveen los nutrimentos necesarios y de fácil digestión y aprovechamiento para borregos en el periodo de engorda y finalización.Está formado de una mezcla de granos enteros o rolados o molidos  que proveenla energía necesaria para ganancias de peso adecuadas, y que además mejoran el consumo, la conversión alimenticia y la calidad de la canal. Complementado con otras fuentes que proporcionanel resto de las necesidades de proteína, minerales, vitaminas y aditivos para mejorar el desempeño de sus borregos.Importante mantener en todo momento agua limpia y fresca para sus borregos. Puede solicitar mayor información de este alimento al servicio técnico de maltaCleyton®.DOSIS Y VIA DE ADMINISTRACION: Oral. Ofrecer el alimento BORREGOS FORTE a libre acceso en el periodo señalado. Incluir forraje de lastre de buena calidad.ADVERTENCIAS. No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y frescos. Prtegidos de redores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto de paredes                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1179,123,6,'BOVANS INICIACIÓN POLLAS Es un alimento para Pollitas de postura de 11 A 16 semanas de edad, diseñado, formulado y elaborado con ingredientes de excelente calidad, y alta digestibilidad  que proveen los nutrimentos necesarios y de fácil digestión para las pollitas de postura en la fase de crecimiento. RECOMENDACIONES: Su presentación en migaja   asegura mayor consumo, logrando mejores pesos, dando un  óptimo arranque de la pollita, mejora el proceso de maduración del aparato digestivo, logrando mejores uniformidades en la parvada. Aporte de nutrientes y aditivos que estimula y activan  el desarrollo temprano del aparato inmune.Miniminiza los riesgos de presencia de factores  antinutricionales o tóxicos durante esta etapaMantenga una temperatura constante 32 C  la primera semana de vida,  suministre  agua limpia  y alimento a libertad.                     BOVANS CRECE POLLAS TE \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
