	(1191,135,6,'CABALLO GANADOR 12 % es un alimento ideal para caballos, pues además de estar elaborado con selectos granos; contiene todas las vitaminas y minerales que el organismo del animal requiere para mantenerse en las mejores condiciones.Su presentación facilita su consumo y ofrece ventajas como su mejoraprovechamiento pues al suministrar los granos molidos sin su cubierta se dirigen mejor que los granos enteros yno irrita la mucosa de la nariz de los caballos como lo hacen las harinas.Caballo Ganador 12% es un alimentobalanceado para caballos de Alto Desempeño, elaborado con los más selectos ingredientes, enriquecido convitaminas y minerales para que el equino se mantenga en óptimas condiciones. Su procesamiento ofrece cualidadescomo mayor digestibilidad y aumeento de la palatabilidad, ya que los granos son sometidos a un cocimiento antes de ser rolados o peletizados, lo cual aumenta su valor nutritivo. DOSIS Y VIA DE ADMINITRACION.OralCABALLO GANADOR 12% , debe comenzar a suministrarse en forma paulatina desde los doce meses de edad, además de la alfalfa o pastos que consumen en la pradera. CABALLOS DE CHARRERIA: Suministre la ración de CABALLO GANADOR 12%  repartida en tres porciones durante el día: de 1.5 a 2.0 kg por la mañana, 0.5 a 1.0 kg al medio día y de 1.0  a 1.5 kg por la tarde, complementar su dieta con heno de buena calidad. CABALLOS DE CARRERA, POLO , ADIESTRAMIENTO , se recomienda dar el concentrado repartido en tres raciones durante el día de la siguiente forma; Dar de 1.5 a 2.0 kg de CABALLO GANADOR 12 % con el primer pienso , cuatro horas antes del entrenamiento o después de efectuar este, siempre y cuando el animal se encuentre en reposo o sin síntomas de fatiga. La segunda porción de CABALLO GANADOR 12 % debe darse al medio día con el pienso, en una cantidad no mayor a ½ kg a 1.0 kg. La tercera porción de CABALLO GANADOR 12 % se debe dar con el pienso al final de la tarde en una cantidad 1.0 a 1.5 kg dependiendo del trabajo realizado. HEMBRAS EN GESTACIÓN: Durante los 8 primeros meses suministre de 2 a 3 Kg de CABALLO GANADOR 12% diarios, divididos en tresporciones durante el día, dependiendo de las condiciones de la yegua y calidad de forrajes.HEMBRAS DURANTE LA LACTANCIA: Aumente la ración de CABALLO GANADOR 12% hasta 4 ó 6 Kg.diarios. El suministro del agua en relación al alimento, se recomienda dar de 12 a 15 litros al día peroque no esté muy fría para evitar cólicos. Es conveniente dar primero el forraje, después el agua ypor último CABALLO GANADOR 12%. En caso de dar el CABALLO GANADOR 12% junto con el forrajees preferible dar el agua para facilitar la digestión. Para desarrollar mejores caballos suministreantes del destete y desde los 15 días de edad Royal Horse B300,  el primer alimento seco quedeben comer los potrillos comenzando con unos cuantos comprimidos y aumentandogradualmente hasta llegar a 2 o 2.5 Kg. de Royal Horse B-300 al 5° ó 6° mes de edad para sustituir Royal Horse B  300 paulatinamente poco antes de los 12 meses de edad por CABALLO GANADOR 12%ADVERTENCIAS: No almacenar  el alimento en lugares húmedos, calientes, y mal ventilados,hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a pesonas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1192,136,6,'CABALLO GANADOR 13 %  es un alimento ideal para caballos, pues además de estar elaborado con los más selectos granos; cebada, avena, maíz, sorgo, está enriquecido con harina de soya y otras oleaginosas ricas en aminoácidos esenciales, contiene todas las vitaminas del complejo B así como A, D y E estabilizadas y los minerales que el organismo del animal requiere para mantenerse en las mejores condiciones.Su presentación en comprimidos pequeños facilita su consumo y ofrece cualidades como su mejor aprovechamiento por el caballo pues al suministrar los granos molidos sin su cubierta se digieren  mejor que los granos enteros y no irrita la mucosa de la nariz de los caballos como lo hacen las harinas.DOSIS Y VIA DE ADMINISTRACION:CABALLO GANADOR 13%, debe comenzar a suministrarse en forma paulatina desde los doce meses de edad, además de la alfalfa,  pastos que consumen en la pradera y forraje suministrado en la praderaCABALLOS DE CHARRERIA: Suministre la ración de CABALLO GANADOR 13%  repartida en dos porciones durante el día: de 1.5 a 2.0 kg por la mañana y de 1 a 1.5 kg doce horas después, en la tarde.CABALLOS DE CARRERA: Polo, carreras de obstáculos. y otras actividades.  Dar de 2.0 a 2.5 kg con el primer pienso, cuatro horas antes del entrenamiento o después de efectuar éste siempre y cuando el animal se encuentre en reposo o sin síntomas de fatiga o darse a medio día con el pienso en una cantidad no mayor de 1.75 a 2.3 kg.HEMBRAS EN GESTACIÓN: Durante los 8 primeros meses suministre de 2 a 3 Kg de CABALLO GANADOR13% diarios, dependiendo de las condiciones de la yegua y calidad de forrajes.HEMBRAS DURANTE LA LACTANCIA: Aumente la ración de CABALLOS GANADOR 13% hasta 4 ó 6 Kg. diarios.Suministro del agua en relación al alimento, se recomienda dar de 12 a 15 litros al día pero que no esté muy fría para evitar cólicos. Es conveniente dar primero el forraje, después el agua y por último el CABALLO GANADOR 13%. En caso de dar el CABALLO GANADOR 13% junto con el forraje espreferible dar el agua para facilitar la digestión. Para desarrollar mejores caballos suministre antesdel destete y desde los 15 días de edad Royal Horse B  300,  el primer alimento seco que deben comer los potrillos comenzando con unos cuantos comprimidos y aumentando gradualmente hastallegar a 2 o 2.5 Kg. de Royal Horse B - 300  al 5° ó 6° mes de edad para sustituir Royal Horse B  300paulatinamente poco antes de los 12 meses de edad por CABALLO GANADOR 13%.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágaloen sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a personal no autorizado a sus instalaciones y toda clase de animales.De salida al alimento que tenga mas tiempo en sus bodegas para evitar suenvejecimiento.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1193,137,6,'CABALLO GANADOR MAX MANZANA es un alimento para caballos, elaborado con selectos granos; contiene todas las vitaminas y minerales que el organismo del animal requiere para mantenerse en las mejores condiciones. Su presentación facilita el consumo y ofrece ventajas como mejor aprovechamiento pues sus ingredientes son sometidos a altas temperaturas que dan un proceso de pre cocción facilitando su digestibilidad .CABALLO GANADOR MAX MANZANA formulado con 14% deproteína, enriquecido con vitaminas, minerales y levaduras para que el equino se mantenga en óptimascondidiciones de salud cuenta además con un delicioso sabor a manzana que lo hace mas apetecible para el caballo.DOSIS Y VIA DE ADMINISTRACION: Oral. CABALLO GANADOR MAX MANZANA, debe comenzar a suministrarse en forma paulatina desde los doce meses de edad además de la alfalta o pastos que consumen en la pradera. CABALLOS DE CHARRERIA: Suministre la ración de CABALLO GANADOR MAX MANZANA  repartida en tres porciones DURANTE EL DÍA:DE 1.5 a 2.okg por la mañana, 0.5 a 1.0 kg al medio día y de 1.0  a 1.5 kg por la tarde, complementar su dieta con heno de buena calidad. CABALLOS DE CARRERA, POLO, ADIESTRAMIENTO,se recomienda dar el concentrado  repartido en tres raciones durante el día de la siguiente forma: Dar de 1.5 a 2.0 kg de CABALLO GANADOR MAX MANZANA con el primer pienso, cuatro horas antes del entrenamiento o después deefectuar éste, siempre y cuando el animal se encuentre en reposo o sin síntomas de fatiga. La segundaporción de CABALLO GANADOR MAX MANZANA debe darse al medio día  con el pienso, en una cantidad no mayor a ½ kg a 1.0 kg. La tercera porción de CABALLO GANADOR MAX MANZANA se debedar con el pienso al final de la tarde en una cantidad 1.0 a 1.5 kg  dependiendo del trabajo realizado.HEMBRAS EN GESTACIÓN: Durante los 8 primeros meses suministre de 2 a 3kg de CABALLO GANADORMAX MANZANA diarios, divididos en tres porciones durante el día, dependiendo de las condiciones dela yegua y calidad de forrajes. HEMBRAS DURANTE LA LACTANCIA: Aumente la ración de CABALLO GANADOR MAX MANZANA hasta 4 ó 6 Kg. diarios El suministro del agua en relación al alimento sese recomienda dar de 12 a 15 litros al día pero que no esté muy fría para evitar cólicos. Es convenientedar primero el forraje, después el agua y por último CABALLO GANADOR MAX MANZANA. En caso dar el agua antes para facilitar la digestión. Para desarrollar mejores caballossuministre antes del destete y desde los 15 días de edad Royal Horse B  300, el primer alimento seco que deben comer los potrillos comenzando con unos cuantos comprimidos y aumentando gradualmente hasta llegar a 2 o 2.5 Kg. de Royal Horse B - 300  al 5° o 6° mes de edad para sustituirRoyal Horse B  300 paulatinamente poco antes de los 12 meses de edad por CABALLO GANADOR MAX MANZANA. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes Evite el acceso a sus bodegas a personas extrañas y toda clase  \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1194,138,6,'CABALLO GANADOR  es un alimento ideal para caballos, pues además de estar elaborado con los más selectos granos; contiene todas las vitaminas y minerales que el organismo del animal requiere para mantenerse en las mejores condiciones.Su presentación facilita su consumo y ofrece ventajas como su mejor aprovechamiento pues al suministrar los granos molidos sin su cubierta se dirigen mejor que los granos enteros y no irrita la mucosa de la nariz de los caballos como lo hacen las harinas.Caballo Ganador es un alimento balanceado para caballos de Alto Desempeño, elaborado con los más selectos ingredientes, enriquecido con vitaminas y minerales para que el equino se mantenga en óptimas condiciones.Su procesamiento ofrece cualidades, como mayor digestibilidad y aumento de la palatabilidad, ya que los granos son sometidos a un cocimiento antes de ser rolados o peletizados, lo cual aumenta su valor nutritivo.DOSIS Y VIA DE ADMINISTRACION: Oral.CABALLO GANADOR , debe comenzar a suministrarse en forma paulatina desde los doce meses de edad, además de la alfalfa o pastos que consumen en la pradera. CABALLOS DE CHARRERIA: Suministre la ración de CABALLO GANADOR  repartida en tres porciones durante el día: de 1.5 a 2.0 kg por la mañana, 0.5 a 1.0 kg al medio día y de 1.0  a 1.5 kg por la tarde, complementar su dieta con heno de buena calidad. CABALLOS DE CARRERA, POLO , ADIESTRAMIENTO , se recomienda dar el concentrado repartido en tres raciones durante el día de la siguiente forma; Dar de 1.5 a 2.0 kg de CABALLO GANADOR  con el primer pienso , cuatro horas antes del entrenamiento o después de efectuar este , siempre y cuando el animal se encuentre en reposo o sin síntomas de fatiga. La segunda porción de CABALLO GANADOR  debe darse al medio día con el pienso, en una cantidad no mayor a ½ kg a 1.0 kg. La tercera porción de CABALLO GANADOR se debe dar con el pienso al final de la tarde en una cantidad 1.0 a 1.5 kg dependiendo del trabajo realizado. HEMBRAS EN GESTACIÓN: Durante los 8 primeros meses suministre de 2 a 3 Kg de CABALLO GANADOR  diarios, divididos en tres porciones durante el día, dependiendo de las condiciones de la yegua y calidad de forrajes. HEMBRAS DURANTE LA LACTANCIA: Aumente la ración de CABALLO GANADOR  hasta 4 ó 6 Kg. diarios. Elsuministro del agua en relación al alimento, se recomienda dar de 12 a 15 litros al día pero que noesté muy fría para evitar cólicos. Es conveniente dar primero el forraje, después el agua y por último CABALLO GANADOR. En caso de dar el CABALLO GANADOR  junto con el  forraje es preferible dar el agua para facilitar la digestión. Para desarrollar mejores caballos suministre antes del destete y desde los 15 días de edad Royal Horse B  300,  el primer alimento seco que deben comer los potrillos comenzando con unos cuantos comprimidos y aumentando gradualmentehasta llegar a 2 o 2.5 Kg. de Royal Horse B  300 paulatinamente poco antes de los 12 meses deedad por CABALLO GANADOR. \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1195,139,6,'Calf Manna es un suplemento nutricional peletizado para bovinos de engorda, lechero, equinos, ovinos, caprinos, conejos y aves que cuando se integra en sus raciones alimenticias comunes o pobres en elementos nutritivos, ayuda en el desempeño de los mismos. Calf Manna puede ser administrado en animales en todas las etapas de desarrollo, a los que se encuentran en etapas reproductivas y en aquellos que realizan actividades atléticas. Calf Manna es elaborado con finos ingredientes que ofrece palatabilidad, digestibilidad, así como proteína y energía de calidad que lo convierten en un producto para mantener adecuadamente suplementados nutricionalmente a sus animales en periodos de estrés.USO Y ESPECIES EN LAS QUE SE EMPLEA: Calf Manna es un suplemento nutricional peletizado parabovinos de engorda, lechero, equinos, ovinos, caprinos, conejos y aves.DOSIS Y VIA DE ADMINISTRACIÓN:Potros: 1/2 libra por día o 227 g   Cabras: 1/4 a 1/2 libra por día o de 114 a 227gCaballos de crecimiento:1 a 1 1/2 libras por día o de 454 a 680 g Lechones:1/8 a 1/4 de libra por día o 57 a 114gCaballos en actividad:1a2 libras por día o de 454 a 910g Cerdas lactantes:1/2 a 3/4 de libra por día o de 227 a 340gYeguas de cría y sementales 1 1/2 a 2 libras por día o 680 a 910g Cerdas gestantes: 1/8 a 1/4 de libra por día o de 57 a 114 gBecerros de vaca lechera:Arriba de 1 libra por día o 454g Cerdos de exposición:1/2 a 1 libra por día o de 227 a 454gVacas lactantes:1 a 1 1/2 libras por día o de 454 a 680g  Cerdos sementales:1/4 a 1/2 libra por día o de 114 a 227gGanado de exposición:1 a 2 libras por día o de 454 a 910g    Conejos en crecimiento 1 cucharadita por díaVacas de cria: 1 libra por día o 454gConejos lactantes: 1 cucharada por díaToros: 1 libra por día o 454 g     Aves: 1 cucharada por día o del 5 al 10% de la ración.ADVERTENCIAS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados,hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. De salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1196,140,6,'Alimento balanceado medicado completo para pollos de engorda de alta genética.CAPORINA FASE 3 PLUS es un alimento diseñado, formulado y elaborado con ingredientes de excelente calidad, y alta digestibilidad que proveen los nutrimentos necesarios y de fácil digestión para los pollos de engorda.Su presentación en migaja  asegura mayor consumo, logrando mejores pesos, al mercado, con menor conversión alimenticia.Proporciona una adecuada pigmentación en el pollo de engorda en los mercados más exigentes. DOSIS Y VIA DE ADMINISTRACION: A libre acceso vía oral, a partir de los 36 días hasta 5 días antes de ser enviados al mercado. ADVERTENCIAS: Suspender el alimento 3 días antes del sacrificio de los animales destinados para el consumo humano. No se administre a equinos.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                  \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
