	(1205,149,6,'Alimento balanceado medicado para pollos de engorda desde el día 22 hasta los 35 días de edad.Caporina Crecimiento es un alimento completo, contiene 19% de proteína y fuentes naturales de pigmento (xantofilas y carotenoides). Proporcionar a partir de los 22 a los 35 días de edad en zonas con alimentación restringida y periodos de engorda mayor a 49 días; y de los 22 hasta los 28 días en programas de alimentación a libre acceso (en zonas con ciclos menores a 42 días).Al día 36 de edad sustituya este alimento por CAPORINA FINALIZADOR,  suministre agua limpia y alimento a libertad. DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, a partir de los 22 a los 35 días de edad. ADVERTENCIAS: Suspender el alimento 3 días antes del sacrificio de los animales destinados para el consumo humano. No se administre a equinos.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
