	(1211,155,6,'Alimento balanceado medicado con monensina para pollitos de engorda del 1er dia de nacidohasta los 21 días de edadCaporina iniciador es un alimento completo, con 22% de proteina. Este alimento esta diseado para pollitos desde el 1er día u octavo día si se utiliza preiniciador hasta los 21 días de edad, aportando los requerimientos de aminoácidos y energía necesarios para que el pollito crezcasano hasta la etapa de engorda.Al día 22 de edad sustituya este alimento por CAPORINA CRECIMIENTO. Mantenga una temperatura constante de 33°C la primera semana de vida suministre agua limpia y alimento a libertad.DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral,desde el 1er día hasta los 21 días de edad.ADVERTENCIAS: Suspender el alimento 3 días antes del sacrificio de los animales destinados para el consumo humano. No se administre a equinos.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                    \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
