	(1213,157,6,'Alimento balanceado medicado con salinomicina para pollitos de engorda del 1er dia de nacidohasta los 21 días de edadCaporina iniciador es un alimento completo, con 22% de proteina. Este alimento esta diseado para pollitos desde el 1er día u octavo día si se utiliza preiniciador hasta los 21 días de edad, aportando los requerimientos de aminoácidos y energía necesarios para que el pollito crezcasano hasta la etapa de engorda.Al día 22 de edad sustituya este alimento por CAPORINA CRECIMIENTO. Mantenga una temperatura constante de 33°C la primera semana de vida suministre agua limpia y alimento a libertad.DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral,desde el 1er día hasta los 21 días de edad.ADVERTENCIAS: Suspender el alimento 4 días antes del sacrificio de los animales destinados parael consumino humano. No debe utilizarse como tratamiento curativo. No debe ser administrado a aves de postura.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1214,158,6,'Alimento balanceado medicado para crecimiento, desarrollo y mantenimiento de cabras.CAPRI CRECIMIENTO es un alimento completo peletizado, diseñado, formulado y elaborado con ingredientes de excelente calidad, que proveen los nutrimentos necesarios, de fácil digestión y aprovechamiento para crecimiento, desarrollo y mantenimiento de cabras;por sus características asegura un rápido crecimiento y maximiza las ganancias de peso.Puede solicitar mayor información y asesoría del uso de este alimento al servicio técnico de maltaCleyton®.Importante mantener en todo momento agua limpia y fresca para sus cabras   DOSIS Y VIA DE ADMINISTRACION: Oral. Ofrecer alimento CAPRI CRECIMIENTO  a libre accesoen el periodo señalado.El consumo es de aproximadamente del 2 al 3 % del peso vivode los animales. Si los animales están en el corral, proporcionarles henos o forrajes de buena calidad.ADVERTENCIAS: No almacenar alimento en lugares húmedos, calientes y mal ventilados, hágalo en Estibar sobre tarimas y nunca dejar el alimento en el suelo y/o en contacto con paredes.                  \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1215,159,6,'Alimento balanceado medicado apra iniciación de cabras.CAPRI INICIO ULTRA es un alimento balanceado, diseñado, formulado y elaborado con ingredientesde excelente calidad, que proveen los nutrimientos necesarios, de fácil digestión y aprovechamiento para la inciación de cabras (desde 1 semana de edad y hasta 2 semanasluego del destete), asegura un rápido crecimiento y maximiza las ganancias de peso.Puede solicitar mayor información y asesoría del uso de este alimento al servicio técnico de maltaCleyton®.Importante mantener en todo momento agua limpia y fresca para sus cabrasDOSIS Y VIA DE ADMINISTRACION: Oral. Ofrecer alimento CAPRI INICIO ULTRA a libreacceso en el periodo señalado; tratar de usar el sistema Creep Feeding, para que este alimento lo consuman solo los cabritos y no sus madres.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventiladoshágalo en sitios secos y frecos.Protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto de paredes                    \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1216,160,6,'Alimento balanceado para cabras lecheras.CAPRI LECHE 18% TEC es un alimento recomendado para cabras lecheras en produccióndiseñado, formulado y elaborado con ingredientes que proveen los nutrimientos necesariosde fácil digestión y aprovechamiento para las cabras. Asegura una buena producciónde leche gracias a su presentación y ayuda a mantener el estado de salud de las cabras.   DOSIS Y VIA DE ADMINISTRACION: Oral, como recomendación general, proporcione 1/2 kg (500g)de alimento CAPRI LECHE 18% TEC por cada 2 litros de leche producida. Ofrecer forrajes decalidad a libre acceso, y muy importante mantener en todo momento agua limpia y frescapara sus cabras.                         \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1217,161,6,'Alimento balanceado para cabras lecheras.CAPRI LECHE 18% es un alimento balanceado, diseñado, formulado y elaborado con ingredientes que proveen los nutrimientos necesarios, de fácil digestión y aprovechamientopara cabras lecheras; asegura una buena producción de leche y auida a mantenerel estado de salud de las cabras.Importante mantener en todo momento agua limpia y fresca para sus cabrasDOSIS Y VIA DE ADMINISTRACION: Oral, Proporcione 1/2 kg (500g) de alimento CAPRILECHE 18% por cada 2 litros de leche producida. Ofrecer henos o forrajes de calidad a libre acceso.                          \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1218,162,6,'Alimento balanceado medicado con ractopamina para finalización de cerdos (últimos 28 días de la engorda),en presentación de pellet que ayuda a consumirlo adecuadamente. Formulado y elaborado con proteínas, granos de cereales procesados, minerales, vitaminas y aditivos que proporcionan los nutrientes necesarios para la  finalización de los cerdos , ayudando a mejorar los parámetros productivos, el rendimiento y calidad de la canal.Mantener en todo momento agua potable y fresca para los cerdos.DOSIS Y VIA DE ADMINISTRACION: Proporcionar a libre acceso. Oral. ADVERTENCIAS: Tratar de evitar la contaminación del alimento. No almacenar el alimento en lugareshúmedos, calientes, y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otrosanimales. De preferencia, estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Este alimento no requiere periodo de retiro antes del sacrificio de los animales destinados al consumo humano.                                                                    USO VETERINARIO.CONSULTE AL MEDICO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1219,163,6,'Alimento concentrado para mezclar con granos molidos para cerdas gestantes, lactantes y sementales.DOSIS Y VIA DE ADMINISTRACION: Recomendaciones generales de uso para elaborar 1 tonelada de alimento terminado            Etapa productiva                         CARNERINA CONCENTRADO                         Granos Molidos                                                                     REPRODUCTORES           Gestación de sementales (1)                               160 kg. (16%)                                         840 kg. (84%)            Lactancia (2)                                             280 kg. (28%)                                       720 kg. (72%)(1) Para mejor resultado y si se tiene disponible, agregar de 50 a 100 kg/ton. de salvado de trigo, quitaresta cantidad de grano molido.(2) Para mejor resultado y si se tiene disponible, agregar de 10 a 20 kg/ton. de sebo o aceite vegetal.quitar esta cantidad de grano molido. Hacer mezcla lo mas homogenea posible en las cantidades sugeridas. Proporcionar el alimento terminado a libre acceso. Oral. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimasy no dejar el alimento directamente sobre el suelo o en contacto con paredes.               \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1220,164,6,'Alimento concentrado formulado y elaborado para cubrir los requerimientos nutrimentales de los cerdos de los 35 kg de peso y hasta que salgan al mercado; ya que ccontiene la energía, proteínaaminoácidos esenciales, macro y micro minerales y vitaminas para mezclar con granos molidos(sorgo, maíz, trigo o combinación de éstos) y obtener un buen alimento completo  paralas etapas señaladas.Recomendaciones generales de uso para elaborar 1 tonelada de alimento terminado:           Etapa productiva                         CARNERINA CONCENTRADO                         Granos Molidos                                                                     CRECIMIENTO-ENGORDA       Crecimiento(35-75kg)                            260 kg. (26%)                                         740 kg. (74%)       Engorda (75 kg-Mercado)                                    200 kg. (20%)                                       800 kg. (80%)     Dependiendo el grano usado y su calidad, el alimento terminado tendrá entre 15 y 17% de proteína y de 0.85 a 0.95% de lisina para crecimiento, y entre 13 y 15% de proteína y de 0.75 a 0.85% de lisina para engorda.Hacer la mezcla lo más homogénea posible y en las cantidades sugeridas.Si tiene algún grano o subproducto en particular, o si requiere formulación especial, puede solicitar al servicio técnico de maltaCleyton la formulación de su alimento, así como las recomendaciones de manejo alimenticio. DOSIS Y VIA DE ADMINISTRACION: Oral. Proporcionar el alimento terminado a libre acceso. ADVERTENCIAS: No almacenar el concentrado y el alimento terminado en lugares húmedos, calientes, y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo o en contactocon paredes.                  \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
