	(1229,173,6,'Alimento balanceado medicado con Febendazol, antihelmintico de amplio espectro para el tratamientode parasitosis gastrointestinales, pulmonares y renales que afecten a los cerdos.DOSIS Y VIA DE ADMINISTRACION: La cantidad de alimento requerido por la cerda lactante, depende de su peso, número de lactancia, de las condiciones ambientales y del número de lechones que se estén amamantando.Al momento del parto no ofrecer alimento. Durante el 1er. día ofrecer ½ kg., después y hasta el día 5° aumentar ½ kg por cada día, posteriormente la alimentación será a libre acceso. Para favorecer el consumo, se recomienda dar alimento mínimo 2 veces al día (una en la mañana y la otra en la tarde). Al momento del destete, la cantidad de alimento ofrecido se baja a 2-2.5 kg durante 2 o 3 días para bajarla producción de leche; posteriormente se les ofrece de 3 a 3.5 kg, y hasta la cubrición. Cuando una cerda sale muy flaca de la lactancia, se le puede dar alimento a libre acceso para que recupere más rápido su condición corporal y entre más pronto en calor para ser cubierta. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo o en contactocon paredes.Este alimento no deberá de ofrecerse 28 días antes del sacrificio de los animales destinadospara consumo humano.               \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1230,174,6,'Alimento balanceado medicado con oxibendazol  para cerdos, antiparasitario de amplio espectro ,con efecto sobre parásitos gastroentéricos tanto en su etapa adulta como en su estado larvarioincluyendo huevecillos.DOSIS Y VIA DE ADMINISTRACION: La cantidad de alimento requerido por la cerda lactante, depende de su peso, número de lactancia, de las condiciones ambientales y del número de lechones que se estén amamantando.Al momento del parto no ofrecer alimento. Durante el 1er. día ofrecer ½ kg., después y hasta el día 5° aumentar ½ kg por cada día, posteriormente la alimentación será a libre acceso. Para favorecer el consumo, se recomienda dar alimento mínimo 2 veces al día (una en la mañana y la otra en la tarde). Al momento del destete, la cantidad de alimento ofrecido se baja a 2-2.5 kg durante 2 o 3 días para bajarla producción de leche; posteriormente se les ofrece de 3 a 3.5 kg, y hasta la cubrición. Cuando una cerda sale muy flaca de la lactancia, se le puede dar alimento a libre acceso para que recupere más rápido su condición corporal y entre más pronto en calor para ser cubierta.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo o en contactocon paredes.Este alimento no deberá de ofrecerse 10 días antes del sacrificio de los animales destinadospara consumo humano.               \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1231,175,6,'Alimento balanceado completo medicadoo con Febendazol antihelmintico de amplio espectro para el tratamiento de parasitosis gastrointestinales, pulmonares y renales que afectan a las cerdas en gestación y sementales.DOSIS Y VIA DE ADMINISTRACION: CERDAS PRIMERIZAS: Ofrecer de 2 a 2.5 kg/día de acuerdo a la condición corporal.CERDAS ADULTAS: Ofrecer de 2.2 a 3.5 kg/día de acuerdo a la condición corporal, al número de parto, y tercio de la gestación. De ser posible alimentar a la cerda  de manera individual.SEMENTALES: Ofrecer de 2 a 3 kg/día, de acuerdo a la condición corporal y a la actividad reproductiva. Oral.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimasy no dejar el alimento directamente sobre el suelo o en contacto con paredes.Este alimento no deberá de ofrecerse 28 días antes del sacrificio de los animales destinados al consumo humano.                                \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1232,176,6,'Alimento balanceado medicado con oxibendazol  para cerdos, antiparasitario de amplio espectro ,con efecto sobre parásitos gastroentéricos tanto en su etapa adulta como en su estado larvarioincluyendo huevecillos para cerdas en gestación y sementales.DOSIS Y VIA DE ADMINISTRACION: CERDAS PRIMERIZAS: Ofrecer de 2 a 2.5 kg/día de acuerdo a la condición corporal.CERDAS ADULTAS: Ofrecer de 2.2 a 3.5 kg/día de acuerdo a la condición corporal, al número de parto, y tercio de la gestación. De ser posible alimentar a la cerda  de manera individual.SEMENTALES: Ofrecer de 2 a 3 kg/día, de acuerdo a la condición corporal y a la actividad reproductiva. Oral.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimasy no dejar el alimento directamente sobre el suelo o en contacto con paredes.Este alimento no deberá de ofrecerse 10 días antes del sacrificio de los animales destinados al consumo humano.                       \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1233,177,6,'Alimento balanceado medicado con ractopamina para finalización de cerdos (últimos 28 días de la engorda),en presentación de pellet que ayuda a consumirlo adecuadamente. Formulado y elaborado con proteínas, granos de cereales procesados, minerales, vitaminas y aditivos que proporcionan los nutrientes necesarios para la  finalización de los cerdos , ayudando a mejorar los parámetros productivos, el rendimiento y calidad de la canal .Mantener en todo momento agua potable y fresca para los cerdos.DOSIS Y VIA DE ADMINISTRACION: Proporcionar a libre acceso. Oral.ADVERTENCIAS: Tratar de evitar la contaminación del alimento. No almacenar el alimento el lugares húmedos, calientes, y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.De preferencia, estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Este alimento no requiere periodo de retiro antes del sacrificio de los animales destinados al consumo humano.                                                           USO VETERINARIO.CONSULTE AL MEDICO VETERINARIO.SU VENTA REQUIERE RECETA MÉDICA CUANTIFICADA Y PARA USO   EXCLUSIVO DEL MÉDICO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1234,178,6,'Alimento balanceado medicado con fenbendazol para el control y tratamiento de las parasitosis pulmonares y la distomatosis hepática en cerdas de gestación, bajo la prescripción y supervisión del médicoveterinario. Tiene presentación de pellet que ayuda a consumirlo adecuadamente. Formulado y elaborado con proteínas, granos de cereales procesados, minerales, vitaminas y aditivos que proporcionan los nutrientes necesarios para la gestación de las cerdas. Mantener en todo momento agua potable y fresca para las cerdas.DOSIS Y VIA DE ADMINISTRACION: Oral. Proporcionar 2 a 3.5 kg/cerda/día. Tratar de ofrecerlo en 2 servidas al díaADVERTENCIAS: Tratar de evitar la contaminación del alimento. No almacenar el alimento en lugareshúmedos, calientes, y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. No destinar para consumo humano la carne de los animales tratados con este producto, hasta pasadoslos últimos 28 días del último tratamiento.                                                                              USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1235,179,6,'Este alimento está formulado y elaborado para cubrir los requerimientos nutrimentales de los cerdosde los 35 kg  de peso y hasta que salgan al mercado ; ya que contiene la energía, proteina, aminoácidos esenciales, macro y micro minerales y vitaminas para mezclar con granos molidos(sorgo, maíz, trigo o combinación de éstos) y obtener un buen alimento completo  paralas etapas señaladas.    Recomendaciones generales de uso para elaborar 1 tonelada de alimento terminado: ETAPA PRODUCTIVA                            CERDIPOWER CONCENTRADO                       GRANOS MOLIDOS                                                                     CRECIMIENTO-ENGORDA  CRECIMIENTO ENGORDA(35-75 kg)                          260 kg (26%)                                    740kg (74%)ENGORDA 75Kg- Mercado                                        200kg(20%)                                      800 kg(8\'%)   Dependiendo el grano usado y su calidad, el alimento terminado tendrá entre 15 y 17% de proteína y de 0.85 a 0.95% de lisina para crecimiento, y entre 13 y 15% de proteína y de 0.75 a 0.85% de lisina para engorda.Hacer la mezcla lo más homogénea posible y en las cantidades sugeridas.Si tiene algún grano o subproducto en particular, o si requiere formulación especial, puede solicitar al servicio técnico de maltaCleyton la formulación de su alimento, así como las recomendaciones de manejo alimenticio. DOSIS Y VIA DE ADMINISTRACION: Proporcionar el alimento terminado a libre acceso. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes, y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo o en contactoparedes.                                       \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1236,180,6,'Alimento balanceado medicado con fenbendazol para el control y tratamiento de las parasitosis pulmonares y la distomatosis hepática en cerdas de lactaciòn, bajo la prescripción y supervisión del médicoveterinario. Tiene presentación de pellet que ayuda a consumirlo adecuadamente. Formulado y elaborado con proteínas, granos procesados, minerales, vitaminas y aditivos que proporcionan los nutrientes necesarios para la lactancia  de las cerdas. Mantener en todo momento agua potable y fresca paralos cerdos. DOSIS Y VIA DE ADMINISTRACION: Proporcionar a libre acceso. Oral.Ofrecerlo al menos en 2, óptimo 4 servidas al día.ADVERTENCIAS: Tratar de evitar la contaminación del alimento. No almacenar el alimento el lugares húmedos, calientes, y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. No destinar para consumo humano la carne de los animales tratados con este producto, hasta pasados los últimos 28 días del último tratamiento.                                                                               USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1237,181,6,'Alimento balanceado medicado con flavomicina para el tratamiento de infecciones causadas por gérmenessensibles a la flavomicina como Salmonella tiphymurium en cerdos no mayores a seis meses de edad bajo la prescripción  y supervisión del médico veterinario, para cerdos entre 30 y 75 kg, en presentación de pellet que ayuda a  consumirlo adecuadamente. Formulado y elaborado con proteinas, granos de cereales procesados, minerales,  vitaminas, y aditivos que proporcionan los nutrientes necesarios para esta etapa. Mantener en todo momento agua potable y fresca para los cerdos.DOSIS Y VIA DE ADMINISTRACIÓN: Proporcionar a libre acceso. Oral.ADVERTENCIAS: Tratar de evitar la contaminación del alimento. No almacenar el alimento en lugares húmedos,calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia, estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contactocon paredes.Suspender el uso de este alimento 7 dìas antes del sacrificio de los animales destinados al consumo humano.                                                                                                 USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1238,182,6,'Complemento alimenticio para mezclar con granos molidos para cerdas gestantes, lactantes ysementales.DOSIS Y VIA DE ADMINSTRACION: Recomendaciones generales de uso para elaborar 1 tonelada dealimento terminado           Etapa productiva                       CERDIPOWER CONCENTRADO                       Granos Molidos                                                            CRECIMIENTO REPRODUCTORAS                 Gestación de sementales (1)                               160 kg. (16%)                                         840 kg. (84%)            Lactancia (2)                                             280 kg. (28%)                                       720 kg. (72%)(1) Para mejor resultado y si se tiene disponible, agregar de 50 a 100 kg/ton. de salvado de trigo, quitaresta cantidad de grano molido.(2) Para mejor resultado y si se tiene disponible, agregar de 10 a 20 kg/ton. de sebo o aceite vegetal.quitar esta cantidad de grano molido. Hacer mezcla lo mas homogenea posible en las cantidades sugeridad. Proporcionar alimento terminado a libre acceso. Oral. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimasy no dejar el alimento directamente sobre el suelo o en contacto con paredes.              \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1239,183,6,'Alimento balanceado medicado con flavomicina para el tratamiento de infecciones causadas por gérmenes sensibles a la flavomicina como Salmonella tiphymurium en cerdos no mayores a seis meses de edad bajo la prescripción y supervisión del médico veterinario, para cerdos entre 75 y 100 kg, en presentación de pellet que ayuda a  consumirlo adecuadamente. Formulado y elaborado con proteinas, granos de cereales procesados, minerales,  vitaminas y aditivos que proporcionan los nutrientes necesarios para esta etapa. Mantener en todo momento agua potable y fresca para los cerdos.DOSIS Y VIA DE ADMINISTRACION: Proporcionar a libre acceso . Oral.ADVERTENCIAS: Tratar de evitar la contaminación del alimento. No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia, estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contactocon paredes.Suspender el uso de este alimento 7 días antes del sacrificio de los animales destinados al consumo humano.                                                                                           USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1240,184,6,'Alimento balanceado medicado con carbadox para el tratamiento de disentería porcina y enteritis bacteriana  en cerdos de 7 a 14 días, bajo la prescripción y supervisión del médico veterinario, para iniciación de cerdosen presentación de pellet que ayuda a consumirlo adecuadamente. Formulado y elaborado con proteínas, granos de  cereales procesados, minerales, vitaminas y aditivos que proporcionan los nutrientes necesarios para esta etapa. Mantener en todo momento agua potable y fresca para los cerdos.DOSIS Y VIA DE ADMINISTRACION: Proporcionar a libre acceso. Oral.ADVERTENCIAS: Tratar de evitar la contaminación del alimento. No almacenar el alimento el lugares húmedos, calientes, y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Prohibido utilizar en animales de abasto en la última etapa de desarrollo. Se restringe la administración de este producto exclusivamente por vía oral en la primera etapa de desarrollo hasta los 35kg de peso, por tanto la carnede estos animales no se podrá destinar para consumo humano. Posteriormente hasta la etapa de finalizaciónse podrá consumir la carne de estos animales. Prohibido el uso de este producto en porcinos adultos.                                USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1241,185,6,'Alimento balanceado medicado para cerdos de 35 kg de peso y hasta el peso de mercado.  GANACERDOS MULTIUSOS es un alimento peletizado, para cerdos desde 35 kg de peso (*) y hasta que alcancen el peso a mercado. Está elaborado con ingredientes de buena calidad y su formulación provee todos los nutrimentos necesarios, balanceados perfectamente para lograr buenas ganancias de peso. (*) De 20 Kg. a 35 Kg. de peso vivo, utilizar alimento INICIAPORK MEJORADO. DOSIS Y VIA DE ADMINISTRACION: Proporcionar  GANACERDOS MULTIUSOS a libre acceso y evitar la contaminación del alimento. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes, y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Este alimento no deberá de ofrecerse 5 días antes del sacrificio de los animales destinados para consumo humano.                USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1242,186,6,'Alimento balanceado medicado para cerdos de 20 a 35 kg de peso.DOSIS Y VIA DE ADMINISTRACION: Proporcionar a libre acceso en toda la etapa indicada. OralADVERTENCIAS: No use en cerdos de as de 40 kg.Prohibido el uso apra todos los porcinos adultosProhiido el consumo de los animales alimentados con este producto, podrán consumirsehasta la etapa de finalización.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hagalo en sitios secos y protegidos de roedores, insectos y otros animales.De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo o en contacto con paredes                        \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1243,187,6,'CODORNIZ ENGORDA es un alimento completo para codornices en etapa de engorda, que contiene nutrientes para satisfacer las necesidades de la codorniz durante la fase de engorda.Este alimento esta diseñado para codornices desde los 22 dias de edad hasta el sacrificioo la postura, apotando los requerimientos de aminoácidos y energia necesarios para que la codorniz crezca sana hasta el sacrificio o la postura.suministre agua limpia y alimento a libertad.DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, de 22 días de edad al sacriicio.ADVERTENCIAS: Retirar 15 dias previos al sacrificio de los animales destinadosal consumo humanoNo almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secosy protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1244,188,6,'Alimento balanceado medicado para codornices para los primeros 21 días de edad.CODORNIZ INICIO  es un alimento completo para codornices en etapa de iniciación, que contiene nutrientes para satisfacer las necesidades de la codorniz las primeras tres semanas. Este alimento está diseñado para codornices desde el primer día, hasta los 21 días de edad, aportando los requerimientos de aminoácidos y energía necesarios para que la codorniz crezca sana hasta la etapa de engorda y postura.  Mantenga una temperatura constante 33 °C  la primera semana de vida,  suministre agua limpia y alimento a libertad. DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral durante los primeros 21 días de edad. ADVERTENCIAS: Retirar 15 días previos al sacrificio de los animales destinados al consumo humano.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1245,189,6,'Alimento balanceado medicado para codornices ponedoras de alta producción.Codorniz Postura es un alimento diseñado, formulado y elaborado para satisfacer las necesidades de la codorniz de postura, en todo su ciclo productivo. Con ingredientes altamente digestibles que asegura mejor conversión, logrando una mayor salud intestinal y menor huevo sucio. Contiene carotenoides naturales para una óptima pigmentación de la yema.  DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral. ADVERTENCIAS: Retirar 15 días previos al sacrificio de los animales destinados al consumo humano.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                  USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1246,190,6,'Concentrado proteico para mezclarse con granos para alimentación de rumiantes.CONCENTRADO ENGORDA GANADO 40%  es un concentrado proteico, hecho para satisfacer las necesidades de sostenimiento y crecimiento del ganado, manteniéndolo en condiciones óptimas para cumplir sus funciones de desarrollo, reproducción, producción de leche o engorda.CONCENTRADO ENGORDA GANADO 40% es ideal por su alto valor nutritivo, tanto por su elevado nivel de proteínas de alta calidad, como por las vitaminas y minerales que contiene y que el ganado necesita.Mantener en todo momento agua limpia y fresca para su ganado.DOSIS Y VIA DE ADMINISTRACION:Oral.Para el ganado de engorda de los 300 kg de peso en adelante, suministre de 500 a 750 gramos diarios por cabeza, mezclado con granos.Para formulación especial con este concentrado, favor de contactar al Servicio Técnico de maltaCleyton®, y podrá solicitar la información necesaria para el uso de este producto para el ganado mayor en crecimiento o producción de leche o bien, para el ganado menor, tomando en cuenta los pastos de la región y granos de que se disponga.                   USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1247,191,6,'Alimento medicado para mezclar con granos molidos para cerdos de iniciacion (20 a 35 kg)DOSIS Y VIA DE ADMINISTRACION: Recomendaciones generales de uso para elaborar 1 tonelada de alimento terminadoEtapa productiva                             CONCENTRADO INCIADOR(D41)                        GRANOS MOLIDOSINICIACION (20 A 35 kg)                                 320kg (32%)                                        680kg (68%)El alimento terminado se proporcionará a libre acceso en toda la etapa indicada. Oral.ADVERTENCIASNo use en cerdos de mas de 40 kgProhbido el uso para todos los porcinos adultosProhibido el consumo de los animales alimentados con este producto, podrán consumirse hasta la etapa de finalización.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secosy protegidos de roedores , insectos y otros animales.De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo o en contacto con paredes.No usar en alimentación de rumiantes. No usar en cerdos con mas de 40 kg de peso vivo.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1248,192,6,'Concentrado de pastas oleaginosas, vitaminas, minerales y aminoácidos para elaborar alimento para gallinas de postura de primer ciclo.CONCENTRADO POSTURA HY LINE (A 54) es un producto diseñado, formulado y elaborado para ser mezclado con una fuente de grano y carbonato de calcio, para elaborar un alimento completo para satisfacer las necesidades de la gallina de postura de primer ciclo. Contiene carotenoides naturales para una óptima pigmentación de la yema.Modo de prepararse: Concentrado pelecha : 350 kg, Maíz y/o sorgo 590 kg, Carbonato de calcio 60kg.                            \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1249,193,6,'Complemento balanceado para mezclar con granos molidos para cerdos de los 30 kg  y hasta elpeso del mercado. Recomendaciones generales de uso para elaborar 1 tonelada de alimentoterminado            Etapa productiva                        Concentrapork Mejorado (D25)                       Granos MolidosCrecimiento (30 a 70 kg.)                                        260 kg. (26%)                                        740 kg. (74%)            Engorda (70 kg a mercado)                      200 kg. (20%)                                     800 kg. (80%)Hacer la mezcla homogenea posible en las cantidades sugeridas.DOSIS Y VIA DE ADMINISTRACION: Oral. Proporcionar alimento terminado a libre acceso en toda laetapa indicada. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores insectos y otros animales. De preferencia estbar sobre tarimas y no dejar el alimento directamente sobre el suelo o en contacto con las paredes.                    \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
