	(1252,196,6,'Alimento balanceado Premium, diseñado, formulado y elaborado para cubrir los requerimientos nutrimentales de conejos en destete en condiciones de explotación intensiva. Contiene el balance ideal de energía, grasa, fibra digestible e indigestible, proteína, aminoácidos esenciales, minerales, vitaminas y aditivos, siendo un producto completo de excelente calidad que proporcionará a sus conejos el mejor rendimiento  reproductivo en esta etapa de la engorda, dando una buena protección a los problemas entéricos característicos de los gazapos recién destetados.DOSIS Y VIA DE ADMINISTRACION: Proporcionar a libre acceso desde 1 semana antes del destete y hasta 2 semanas posterior al destete. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a sus bodegas de personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento. Este alimento no deberá de ofrecerse 5 días antes del sacrificio de los animales destinados para consumo humano.                   USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1253,197,6,'Alimento balanceado Premium, diseñado, formulado y elaborado para cubrir los requerimientos nutrimentales de conejos en destete en condiciones de explotación intensiva. Contiene el balance ideal de energía, grasa, fibra digestible e indigestible, proteína, aminoácidos esenciales, minerales, vitaminas y aditivos, siendo un producto completo de excelente calidad que proporcionará a sus conejos el mejor rendimiento  reproductivo en esta etapa de la engorda, dando una buena protección a los problemas entéricos característicos de los gazapos recién destetados.DOSIS Y VIA DE ADMINISTRACION: Proporcionar a libre acceso desde 1 semana antes del destete y hasta 2 semanas posterior al destete. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a sus bodegas de personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento. Este alimento no deberá de ofrecerse 1 día antes del sacrificio de los animales destinados para consumo humano.                   USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1254,198,6,'USO Y ESPECIES EN LAS QUE SE EMPLEA: Alimento balanceado Premium, diseñado, formulado y elaborado para cubrir los requerimientos nutrimentales de conejos reproductores en condiciones de explotación intensiva. Dependiendo de la granja, las hembras tienen un periodo de lactancia de entre 30 y 45 días de duración,  también puede ser que una hembra esté gestante y lactante al mismo tiempo, por lo tanto sus requerimientos y cantidad de alimento a consumir serán mayores. DOSIS Y VIA DE ADMINISTRACION HEMBRAS VACÍAS: 100 a 120 gramos al día. HEMBRAS GESTANTES: 125 a 175 gramos al día durante los primeros 20 días de la gestación; y 175 a 250 gramos al día durante los últimos 10 días de la gestación. HEMBRAS LACTANTES: Alimentación a libre acceso. Al final de la lactancia es probable que la hembra junto con su camada puedan consumir más de 500 gramos al día.MACHOS ACTIVOS: 150 a 200 gramos al día, dependiendo de la actividad sexual y de su condición corporal.MACHOS EN REPOSO: 100 a 125 gramos, dependiendo de su condición corporal. ADVERTENCIAS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a sus bodegas de personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento. Este alimento no deberá de ofrecerse 5 días antes del sacrificio de los animales destinados para consumo humano.           \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1255,199,6,'USO Y ESPECIES EN LAS QUE SE EMPLEA: Alimento balanceado Premium, diseñado, formulado y elaborado para cubrir los requerimientos nutrimentales de conejos reproductores en condiciones de explotación intensiva. Dependiendo de la granja, las hembras tienen un periodo de lactancia de entre 30 y 45 días de duración,  también puede ser que una hembra esté gestante y lactante al mismo tiempo, por lo tanto sus requerimientos y cantidad de alimento a consumir serán mayores. DOSIS Y VIA DE ADMINISTRACION HEMBRAS VACÍAS: 100 a 120 gramos al día.HEMBRAS GESTANTES: 125 a 175 gramos al día durante los primeros 20 días de la gestación; y 175 a 250 gramos al día durante los últimos 10 días de la gestación. HEMBRAS LACTANTES: Alimentación a libre acceso. Al final de la lactancia es probable que la hembra junto con su camada puedan consumir más de 500 gramos al día.MACHOS ACTIVOS: 150 a 200 gramos al día, dependiendo de la actividad sexual y de su condición corporal. MACHOS EN REPOSO: 100 a 125 gramos, dependiendo de su condición corporal. ADVERTENCIAS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a sus bodegas de personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento. Este alimento no deberá de ofrecerse 1 día antes del sacrificio de los animales destinados para consumo humano.           \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1256,200,6,'INDICACIONES: USO Y ESPECIES EN LAS QUE SE EMPLEA Las necesidades de nutrimentos y de cantidad de alimento para los conejos en engorda, variansegún la raza, la edad, las condiciones ambientales y el manejo general de la explotaciónentre otros.DOSIS Y VIA DE ADMINISTRACION: Dependiendo de la granja, los gazapos se destetan entre los 30 y 45 días de edad y desde este momento puedo ofrecer este alimento y hasta el peso del mercado(2 a 2.5 kg )CONEJOS EN ENGORDA. Alimentacion a libre acceso ADVERTENCIAS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a sus bodegas de personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento. Este alimento no deberá de ofrecerse 1 día antes del sacrificio de los animales destinados para consumo humano.                    \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1257,201,6,'Alimento balanceado para corderos antes del desteteCORDEROS ULTRA es un alimento completo, en presentación de micropellet, diseñado, formulado y elaborado con ingredientes de excelente calidad, que proveen los nutrimentos necesarios y de fácil digestión y aprovechamiento para corderos desde 1 semana de edad y hasta el destete.Este alimento es ideal para ayudar a desarrollar rápidamente el funcionamiento del rumen de los corderos y así mejorar el aprovechamiento posterior del alimento, maximizando el potencial decrecimiento Suministrar forrajes de buena calidad, y es muy importante mantener en todo momento agua limpia y fresca para sus corderos.Para solicitar mayor información de este alimento al servicio técnico de maltaCleyton®.DOSIS Y VIA DE ADMINISTRACION: Oral, Ofecer Alimento CORDEROS ULTRA  a libre acceso en elperiodo señalado; tratar de usar sistema Creep Feeding , que consiste en ofrecer este alimento en un area en donde no puedan entrar las madres y así solo consuman los corderos. ADVERTENCIAS: No almacenar alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y frescos. Protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento en el suelo y/o en contacto con paredes.                 \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1258,202,6,'Alimento balanceado medicado para crecimiento de cerdo. DOSIS Y VIA DE ADMINISTRACION: Proporcionar a libre acceso. Oral. ADVERTENCIAS:Este alimento no deberá de ofrecerse 10 días antes del sacrificio de los animales destinados al consumo humano.                           USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1259,203,6,'Alimento balanceado medicado con monensina para crecimiento de becerrasCRECIMIENTO BECERRAS es un alimento diseñado, formulado y elaborado con ingredientes de excelente calidad, que proveen los nutrimentos necesarios y de fácil digestión para becerras en crecimiento de entre 200 y 350 kg. de peso vivo. Mantener en todo omento agua limpia y fresca para su ganado.DOSIS Y VIA DE ADMINISTRACIÓN: Oral. Ofrecer alimento CRECIMIENTO BECERRAS a razon de 2%del peso vivo del animal (por lo que el consumo es de alrededor de 4 a 7 kilos para el rango de peso indicado de las becerras), y agregar de 1.5 a 2 kilos de forrajes de lastr de buena calidad.Para formulación especial de ración integral con el uso de este alimento, favor de contactar con el Servicio Técnico de maltaCleyton®.ADVERTENCIAS: Suspender el consumo 3 dias ants del sacrificio de los animales destinados parael consumo humano.No se administre a EquinosNo almacenar el alimento en lugares húmedos, calientes y mal ventilados, hagalo en sitios secosy protegidos de roedores, insectos y otros animales.Estibar sobre tarimasy nunca dejar el alimento directamente en el suelo y/o en contacto con paredesDé salida al alimento que tenga más tiempo en sus bodegas para evitar el envejecimiento y pérdidade propiedades nutrimentales.                USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1260,204,6,'Alimento balanceado medicado para pollitas de postura de 7 a 12 semanas de edad.CRECIMIENTO POLLAS Alimento balanceado medicado para pollitas de posturade 7 a 12 semanas de edad. Es un alimento completo científicamente balanceadopara satisfacer todos los requerimientos nutritivos de las pollas en crecimientoMantenga una temperatura constante 20 °C,  suministre  agua limpia  y alimento a libertad.DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, desde 7 hasta 12 semanas de edad.ADVERTENCIAS: Suspender el alimento 3 días antes del sacrificio de los animales destinados para el consumo humano. No se administre a equinos.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.stibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                       USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1261,205,6,'Alimento balanceado medicado para pollitas de postura de 7 a 12 semanas de edad.CRECIMIENTO POLLAS Alimento balanceado medicado para pollitas de posturade 7 a 12 semanas de edad. Es un alimento completo científicamente balanceadopara satisfacer todos los requerimientos nutritivos de las pollas en crecimientoMantenga una temperatura constante 20 °C,  suministre  agua limpia  y alimento a libertad.DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, desde 7 hasta 12 semanas de edad.ADVERTENCIAS: Suspender el alimento 5 días antes del sacrificio de los animales destinados para el consumo humano. No administrar a aves de postura, productora de huevo para plato destinado para el consumo humano.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                         USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1262,206,6,'Alimento balanceado medicado para pollitas de postura de 7 a 12 semanas de edad.CRECIMIENTO POLLAS Alimento balanceado medicado para pollitas de posturade 7 a 12 semanas de edad. Es un alimento completo científicamente balanceadopara satisfacer todos los requerimientos nutritivos de las pollas en crecimientoMantenga una temperatura constante 20 °C,  suministre  agua limpia  y alimento a libertad.DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, desde 7 hasta 12 semanas de edad.ADVERTENCIAS: Suspender el alimento 4 días antes del sacrificio de los animales destinados para el consumo humano. No debe utilizarse como tratamiento curativo. No debe ser administrado a aves de postura.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.stibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                           USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
