	(1268,212,6,'Es un alimento balanceado, diseñado, formulado y elaborado para cubrir los requerimientos nutrimentalesde todas las etapas de vida de los cuyos. Contiene el balance ideal de energía, grasa, almidón, fibradigestible e indigestible, proteína, aminoácidos esenciales, minerales y vitaminas; esta adicionado con aditivos que favorecen y regulan la actividad intestinal de los cuyos, y al estar adicionado con vitamina C coadyuva en el fortalecimmiento del sistema inmune de estos roedores.DOSIS Y VIA DE ADMINISTRACIÓN: Vía oral. Suministrar este alimento a libre acceso es decir, lo que el cuyo pueda comer.En términos generales el consumo diario es de alrededor de 5% del peso corporal del cuyo. Por ejemplo,si un cuyo pesa 800 gramos, le daremos alrededor de 40 gramos al día. De preferencia esa cantidadrepartida en al menos 2 veces al día.Importante ofrecer a los cuyos agua potable de buena calidad y siempre a disposición.Puede solicitar mayor información del uso este alimento al servicio técnico de MaltaCleytn®ADVERTENCIAS: Evitar la contaminación del alimento. NO almacenar el alimento en lugares húmedoscalientes y mal ventilados, hágalo en sitios frescos, secos y protegidos de roedores, insectos y otros animalesEstibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con las paredes                    \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1269,213,6,'Alimento balanceado medicado con monensina para vacas altas productoras.DAIRY ROL es un alimento diseñado para vacas altas productoras con potencial genético. Está elaborado con ingredientes que aportan proteína de sobrepaso 100% de origen vegetal, (no contiene harina de carne o sangre), con lo que se eliminan los riesgos que conlleva usar proteínas de origen animal mal procesados.El DAIRY ROL ofrece una excelente fuente de lisina y metionina. Cubre los requerimientos de energía de las vacas altas productoras mediante el uso de grasa de sobrepaso, cuyo origen es 100% vegetal.Los minerales usados en la elaboración del DAIRY ROL son quelatados, por ejemplo el selenio, el cual mejora los parámetros reproductivos y la metionina de zinc que disminuye la incidencia de mastitis y problemas de patas.A DAIRY ROL se le adiciona cultivo de levaduras, buffers y modificadores de la fermentación, lo cual favorece la producción controlada de ácido propiónico reduciendo el peligro de acidosis por el alto consumo de concentrado.Mantener en todo momento agua limpia y fresca.  DOSIS Y VIA DE ADMINISTRACION: Oral. Como guía para su uso se debe considerar la calidad del forraje; cuando se esté suministrando forraje de excelente calidad, ofrecer 1 kg de DAIRY ROL por cada 3 lts. de leche producida, si el forraje es de mediana calidad se ofrecerá 1 kg de DAIRY ROL por cada 2.5 lts. de leche producida. La cantidad total de DAIRY ROL se repartirá uniformemente en el número total de comidas servidas en el día, intercalando forraje en cada servida de concentrado.Para formulación especial de ración integral con el uso de este alimento, favor de contactar con el Servicio Técnico de maltaCleyton. ADVERTENCIAS: Suspender el consumo 3 días antes del sacrificio de los animales destinados para consumo humano.No se administre a equinos.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento ypérdida de propiedades nutrimentales.  USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1270,214,6,'Alimento balanceado medicado con monensina para vacas altas productoras.DAIRY ROL es un alimento diseñado para vacas altas productoras con potencial genético. Está elaborado con ingredientes que aportan proteína de sobrepaso 100% de origen vegetal, (no contiene harina de carne o sangre), con lo que se eliminan los riesgos que conlleva usar proteínas de origen animal mal procesados.El DAIRY ROL ofrece una excelente fuente de lisina y metionina. Cubre los requerimientos de energía de las vacas altas productoras mediante el uso de grasa de sobrepaso, cuyo origen es 100% vegetal.Los minerales usados en la elaboración del DAIRY ROL son quelatados, por ejemplo el selenio, el cual mejora los parámetros reproductivos y la metionina de zinc que disminuye la incidencia de mastitis y problemas de patas.A DAIRY ROL se le adiciona cultivo de levaduras, buffers y modificadores de la fermentación, lo cual favorece la producción controlada de ácido propiónico reduciendo el peligro de acidosis por el alto consumo de concentrado.Mantener en todo momento agua limpia y fresca.  DOSIS Y VIA DE ADMINISTRACION: Oral. Como guía para su uso se debe considerar la calidad del forraje; cuando se esté suministrando forraje de excelente calidad, ofrecer 1 kg de DAIRY ROL por cada 3 lts. de leche producida, si el forraje es de mediana calidad se ofrecerá 1 kg de DAIRY ROL por cada 2.5 lts. de leche producida. La cantidad total de DAIRY ROL se repartirá uniformemente en el número total de comidas servidas en el día, intercalando forraje en cada servida de concentrado.Para formulación especial de ración integral con el uso de este alimento, favor de contactar con el Servicio Técnico de maltaCleyton. ADVERTENCIAS: Suspender el consumo 3 días antes del sacrificio de los animales destinados para consumo humano.No se administre a equinos.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento ypérdida de propiedades nutrimentales.  USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1271,215,6,'Alimento balanceado medicado para pollitas de postura de 13 semanas de edad a primer huevoDESARROLLO POLLAS es un alimento completo cientificamente balanceado para satisfacer todos losrequerimientos nutritivos de las pollas en desarrollo.Su presentación en migaja asegura mayor consumo, logrando mejores pesos, logrando mejoresuniformidades en la parvada.Minimiza los riesgos de presencia de factores antinutricionales o tóxicos durante esta etapa.Mantenga una temperatura constante de 20° C, suministre agua limpia y alimento a libertad.DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, desde 13 semanas a primer huevo.ADVERTENCIAS: No requiere tiempo de retiro.No debe de usarse en patos, gansos y palomas.No agregar o mezclar con otras drogas u otro antibiótico.No usarse en rumiantes.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1272,216,6,'Alimento balanceado medicado con monensina; indicado para la prevención de la coccidiosis causada por Eimeria bovis y E. zuemir y en animales con problemas de cetosis. Bajo la prescripción y supervisión del Médico Veterinario.Alimento diseñado, formulado y elaborado con ingredientes que proveen los nutrimentos necesarios para la producción lechera.USO Y ESPECIES EN LAS QUE SE EMPLEA: Bovinos. Para alimentación de vacas lecheras en producción.DOSIS Y VIA DE ADMINISTRACION: Oral. La cantidad a ofrecer de este alimento depende además de otros factores, de la producción promedio de leche. Usar 1 kg por cada 2.5 litros de leche producida. Para mayor información del uso del alimento, favor de contactar con el servicio técnico de maltaCleyton®. Mantener en todo momento agua limpia y fresca para las vacas.ADVERTENCIAS:Ofrezca el alimento diariamente y no permita que consuman alimento del día anterior ó alimento en mal estado. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo ensitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que absorba humedad. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.Suspender el consumo 3 días antes del sacrificio de animales para consumo humano. No se administrarse con equinos               USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1273,217,6,'Alimento balanceado medicado con monensina; diseñado, formulado y elaborado con ingredientes que proveen los nutrimentos necesarios para la producción lechera.USO Y ESPECIES EN LAS QUE SE EMPLEA: Bovinos. Para alimentación de vacas lecheras en producción    DOSIS Y VIA DE ADMINISTRACION: Oral. La cantidad a ofrecer de este alimento depende además de otros factores, de la producción promedio de leche. Usar 1 kg por cada 3 litros de leche producida. Preventivo en la acidosis, cetosis, timpanismo y meteorismo espumoso. Prevención de la coccidiosiscausada por Eimeria bovis y E. zuemii. Está indicado en ganado de carne en corral de engorda y pastoreo, ganado de leche en producción y vaquillas de reemplazo. En Vacas lecheras está indicado enanimales con problemas de cetosis. El cálculo preciso se puede obtener con el especialista vacalechera . Para mayor información contactar con el servicio tecnico de maltaCLeyton ®.Mantener en todo momento agua limpia y fresca para las vacas.ADVERTENCIAS: De preferencia, ofrezca el alimento diariamente y no permita que consuman alimento del dia anterior o en mal estado.No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que absorba humedad. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.Suspender el consumo 3 días antes del sacrificio de animales para consumo humano. No se administrarse con equinos                     USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
