	(1280,224,6,'Alimento balanceado medicado para engorda de borregos.  DOSIS Y VIA DE ADMINISTRACION: Ofrecer el alimento a libre acceso en el periodo señalado. Incluir forraje de lastre de buena calidad.Importante mantener en todo momento agua limpia y fresca para sus borregos.  ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas, y no dejar el alimento directamente sobre el suelo o en contacto con las paredes.Este alimento no deberá de ofrecerse 5 días antes del sacrificio de los animales destinados para consumo humano.                       \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1281,225,6,'Alimento balanceado para engorda de ganado bovino.ENGORDA GANADO es un alimento diseñado, formulado y elaborado con ingredientes que proveen los nutrimentos necesarios y de fácil digestión para bovinos en engorda.  Al iniciar el periodo de engorda deberá de haber una fase de adaptación en donde se deberá de incluir paulatinamente el alimento ENGORDA GANADO y disminuir el forraje de lastre.  Mantener en todo momento agua limpia y fresca para su ganado.  DOSIS Y VIA DE ADMINISTRACION: Oral. Ofrecer alimento ENGORDA GANADO a libre acceso (el consumo es de alrededor de 8 a 10 kilos), más alrededor de 2 a 3 kilos de forrajes de lastre de calidad.                         \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1282,226,6,'Alimento balanceado para engorda de ganado bovino.ENGORDA GANADO es un alimento diseñado, formulado y elaborado con ingredientes que proveen los nutrimentos necesarios y de fácil digestión para bovinos en engorda.  Al iniciar el periodo de engorda deberá de haber una fase de adaptación en donde se deberá de incluir paulatinamente el alimento ENGORDA GANADO y disminuir el forraje de lastre.  Mantener en todo momento agua limpia y fresca para su ganado.  DOSIS Y VIA DE ADMINISTRACION: Oral. Ofrecer alimento ENGORDA GANADO a libre acceso (el consumo es de alrededor de 8 a 10 kilos), más alrededor de 2 a 3 kilos de forrajes de lastre de calidad.                         \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1283,227,6,'Alimento balanceado para engorda de ganado bovino.El alimento ENGORDA GANADO SINALOENSE está diseñado, formulado y elaborado con ingredientes que proporcionan los nutrientes necesarios para la nutrición y alimentación del ganado bovino en engorda.Mantener en todo momento agua limpia y fresca para su ganado. DOSIS Y VIA DE ADMINISTRACION: Proporcionar este alimento a libre acceso, y ofrecer forrajes de calidad que tenga disponibles.                           \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1284,228,6,'Alimento balanceado para engorda de ganado bovino.El alimento ENGORDA GANADO SINALOENSE está diseñado, formulado y elaborado con ingredientes que proporcionan los nutrientes necesarios para la nutrición y alimentación del ganado bovino en engorda.Mantener en todo momento agua limpia y fresca para su ganado. DOSIS Y VIA DE ADMINISTRACION: Proporcionar este alimento a libre acceso, y ofrecer forrajes de calidad que tenga disponibles.                            \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1285,229,6,'Alimento balanceado medicado para cerdos, de los 75 kg y hasta el peso a mercado.ENGORDAPORK MEJORADO es un alimento finalizador peletizado, para cerdos desde 70 kg de peso (*) y hasta que alcancen el peso de mercado. Su formulación provee todos los nutrimentos necesarios, balanceados perfectamente para lograr buenas ganancias de peso.(*) De 35 Kg. a 70 Kg. de peso vivo, utilizar alimento CRECIPORK MEJORADO. Mantenga en todo momento agua potable y fresca para los cerdos. DOSIS Y VIA DE ADMINISTRACION: Proporcionar ENGORDAPORK MEJORADO a libre acceso. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Evite la contaminación del alimento. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo o en contacto con paredes.Este alimento no deberá de ofrecerse 5 días antes del sacrificio de los animales destinados para consumo humano.                USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
