	(1288,232,6,'Alimento balanceado para vacas lecheras.ESTABLERO 18%, es un alimento diseñado, formulado y elaborado con ingredientes de excelente calidad, que proveen los nutrimentos necesarios y de fácil digestión para vacas lecheras en producción.  Mantener en todo momento agua limpia y fresca para sus vacas. DOSIS Y VIA DE ADMINISTRACION: Oral. Dependiendo del nivel de producción, la raza, el peso, el ambiente y manejo, así como de los forrajes disponibles, se deberá de ofrecer 1 kilogramo de este alimento por aproximadamente cada 2 a 2.5 litros de leche producida. Para formulación especial de ración integral con el uso de este alimento, favor de contactar con el Servicio Técnico de maltaCleyton®.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
