	(1295,239,6,'Complemento para alimentación de ganado rumiante.El alimento ESTIAJE SOSTÉN está diseñado, formulado y elaborado con ingredientes de buena calidad, ideal para complementar la alimentación de ganado rumiante, que principalmente se tienen en condiciones de estiaje y/o pastoreo de forrajes de mala a regular calidad, así como alimentados con rastrojos, pajas y otros subproductos agrícolas y agroindustriales o complementados también con granos disponibles. Mantener en todo momento agua limpia y fresca para su ganado. DOSIS Y VIA DE ADMINISTRACION: Oral. Dependiendo de la condición particular, este alimento se ofrecerá a razón del 1 al 3% del peso vivo de animal. Para alguna formulación especial o uso de este alimento, favor de contactar al Servicio Técnico de maltaCleyton®.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1296,240,6,'Complemento para alimentación de ganado rumiante.El alimento ESTIAJE SOSTÉN está diseñado, formulado y elaborado con ingredientes de buena calidad, ideal para complementar la alimentación de ganado rumiante, que principalmente se tienen en condiciones de estiaje y/o pastoreo de forrajes de mala a regular calidad, así como alimentados con rastrojos, pajas y otros subproductos agrícolas y agroindustriales o complementados también con granos disponibles. Mantener en todo momento agua limpia y fresca para su ganado. DOSIS Y VIA DE ADMINISTRACION: Oral. Dependiendo de la condición particular, este alimento se ofrecerá a razón del 1 al 3% del peso vivo de animal. Para alguna formulación especial o uso de este alimento, favor de contactar al Servicio Técnico de maltaCleyton®.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1297,241,6,'Complemento para alimentación de ganado rumiante.El alimento ESTIAJE SOSTÉN está diseñado, formulado y elaborado con ingredientes de buena calidad, ideal para complementar la alimentación de ganado rumiante, que principalmente se tienen en condiciones de estiaje y/o pastoreo de forrajes de mala a regular calidad, así como alimentados con rastrojos, pajas y otros subproductos agrícolas y agroindustriales o complementados también con granos disponibles. Mantener en todo momento agua limpia y fresca para su ganado. DOSIS Y VIA DE ADMINISTRACION: Oral. Dependiendo de la condición particular, este alimento se ofrecerá a razón del 1 al 3% del peso vivo de animal. Para alguna formulación especial o uso de este alimento, favor de contactar al Servicio Técnico de maltaCleyton®.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1298,242,6,'Alimento para caballos elaborado con los más selectos ingredientes y  enriquecidos con vitaminas y minerales para que el animal se mantenga en óptimas condiciones, ofrece ventajas como mayor digestibilidad y palatabilidad ya que los granos son sometidos a un cocimiento antes de ser rolados, lo cual aumenta su valor nutritivo. DOSIS Y VIA DE ADMINISTRACION: Oral. Yeguas gestantes   4.0 - 5.0Yeguas lactantes primeros 3 meses   6.0 - 7.4Yeguas lactantes de 3 - 6 meses   5.2 - 6.3Sementales   4.5 - 5.0 ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                 \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1299,243,6,'FÓRMULA TABASCO  está diseñado, formulado y elaborado con ingredientes de buena calidad, ideal para complementar la alimentación de ganado, que principalmente se tienen en condiciones de pastoreo de forrajes de mala a regular calidad, así como alimentados con rastrojos, pajas y otros subproductos agrícolas y agroindustriales o complementados también con granos disponibles. RECOMENDACIONES: Dependiendo de la condición particular, este alimento se ofrecerá a razón del 1 al 3% del peso vivo de animal. Para mayor información del uso de este producto, favor de contactar a su distribuidor o al asesor pecuario de maltaCleyton®. Mantener en todo momento agua limpia y fresca para su ganado. CONSEJOS PRÁCTICOS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1300,244,6,'Gallo de Oro® Athletic, es una fórmula balanceada altamente especializada para la etapa de postura o entrenamiento de las aves de combate , cuenta con un 18 % de Proteína y diseñado en base a aminoácidos digestibles que permiten cubrir el requerimiento de estos para favorecer la creación de fibras musculares , mientras que su nuevo núcleo extruido energético contiene una variedad de aceites , ricos en Omega 3 y Omega 6 , permiten la formación y almacenamiento en el músculo e hígado  de una reserva energética de alta disponibilidad para ser utilizada al momento del ejercicio y el combate.Esta partícula energética cuenta con el mejor complemento que es la inclusión de L  CARNITINA, ingrediente que puede ser considerado como un tipo de aminoácido que permite el uso y gasto de las reservas energéticas del  gallo  vía mitocondria, logrando un alto desempeño físico  atlético, con una mayor tolerancia al ejercicio, y logrando mantener el nivel de actividad física por mas tiempo.Gallo de Oro® Athletic es complementado con una minuciosa composición de vitaminas y  minerales que complementan el valor nutricional de la fórmula y el buen funcionamiento de diversos órganos y tejidos del gallo. DOSIS Y VIA DE ADMINISTRACION: Oral.Ofrecer Gallo de Oro® Athletic, a razón de 90  110 gr. / ave por día ,  dividiendo esta cantidad en 2 raciones por día, indicándose de 3  4 semanas previas al combate.No debe faltar agua potable, limpia y fresca siempre al alcance de los animales. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.         \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1301,245,6,'Gallo de Oro® Cortador, es un alimento balanceado para aves de combate que se encuentran en la etapa franca del entrenamiento; es decir, de 3 a 4 semanas previas a la fecha del combate ya que por su rica variedad de semillas seleccionadas, su contenido de harina de alfalfa así como por su concentración de vitaminas y minerales ofrecidas por su inclusión de Calf Manna® permiten a las aves una rápida reposición de los nutrientes que son utilizadas para el entrenamiento que en muchas de las veces llega a ser intenso, así como también permite la creación de una reserva energética que podrá ser utilizada el día del combate favoreciendo la velocidad, la agilidad, la resistencia y en conclusión Gallos Cortadores. DOSIS Y VIA DE ADMINISTRACION: Oral.Ofrecer Gallo de Oro® Cortador, a razón de 80  120 gr. / ave por día,  dividiendo esta cantidad en 2 raciones por día.No debe faltar agua potable, limpia y fresca siempre al alcance de los animales. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.               \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1302,246,6,'Alimento para aves de combate diseñado, formulado y elaborado con ingredientes de muy buena calidad, es ideal para complementar la alimentación de las aves o para balancear dietas compuestas a base de leguminosas, y elevar el nivel energético de la ración.Es ideal para incrementar el nivel de energía de las dietas para las diferentes etapas de las aves. DOSIS Y VIA DE ADMINISTRACION: Oral.Gallo de Oro Booster, debe utilizarse siempre en combinación con ingredientes que aportan proteína, minerales y vitaminas o cuando las fuentes de carbohidratos son bajas.Mezclas de Leguminosas; Incorporar Gallo de Oro Booster en un rango de 10  20 % de la mezcla total.Mezclas de Leguminosas con Cereales; Incorporar Gallo de Oro Booster en un rango de 5  9 % de la mezcla total. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                 \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1303,247,6,'Gallo de Oro® Propluma, es una formula balanceada altamente especializada para la recuperación de la pluma del ave de combate, y que como su nombre lo indica Propluma, favorece el desarrollo y crecimiento de la Pluma, además de representar un núcleo concentrado de aminoácidos azufrados que el ave transforma en proteínas (queratina), principal elemento que da estructura a las plumas.Es un alimento diseñado, formulado y elaborado con ingredientes de excelente calidad y alta digestibilidad que provee los nutrimentos necesarios y de fácil digestión que estimula el desarrollo de las microvellosidades.Gallo de Oro® Propluma es complementado con una minuciosa composición de vitaminas y minerales que coadyuvan en la formación de estructura, elasticidad y brillantez del plumaje. DOSIS Y VIA DE ADMINISTRACION: Oral.Ofrecer Gallo de Oro® Propluma, a razón de 80  130 gr.  diarios (de acuerdo al tamaño o tipo de ave), durante todo el periodo de recuperación de la misma.No debe faltar agua potable, limpia y fresca siempre al alcance de los animales. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.              \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1304,248,6,'GALLO DE ORO MANTENIMIENTO, es como su nombre lo indica un alimento balanceado para el periodo de descanso o mantenimiento de las aves de combate, que cubre completamente la demanda nutricional de esta etapa, sin provocar un aumento de peso o engrasamiento de las aves, permitiendo el mantenimiento de su condición corporal, gracias a su inclusión de cereales y semillas, asi como de 3 diferentes micropellets, ricos en vitaminas, minerales (rojo),  un segundo (verde) con alto contenido de fibra y betacarotenos que mejoran la agudeza visual del ave, manteniendo saludables todos sus epitelios y previniéndolo contra enfermedades respiratorias y digestivas y un tercero (marrón)  ricoen energía de rápida asimilación. DOSIS Y VIA DE ADMINISTRACION: Oral.GALLO DE ORO MANTENIMIENTO, debe ofrecerse a razón de 80 gr. Por aves por día , dividido en dos raciones, cuando las aves han concluido su periodo de entrenamiento y peleas, o bien se encuentren convalecientes de un proceso de enfermedad o cicatrización de las heridas sufridas durante los combates y hasta que inicien nuevamente su periodo de  cuida  o entrenamiento para una nueva contienda, momento en el cual deberá hacerse el cambio a Gallo de Oro Entrenamiento o Gallo de Oro Cortador, de acuerdo a la preferencia y experiencia de cada pastor o propietario. No debe faltar agua potable, limpia y fresca siempre al alcance de los animales. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.          \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1305,249,6,'Alimento científicamente balanceado con ingredientes seleccionados y de la más alta calidad para ofrecer a sus ejemplares, todos los ingredientes como proteína, energía, vitaminas A, D, K y complejo B y un adecuado contenido de minerales y humedad que permitan a sus aves de pelea alcanzar el mayor rendimiento físico durante su preparación, lográndose gallos ligeros, vigorosos y muy cortadores. DOSIS Y VÍA DE ADMINISTRACIÓN: Oral.GALLO DE ORO PREPARACIÓN , es una fórmula diseñada , específicamente para alimentar aves de combate mayores a 30 meses de edad que se encuentran entre el periodo de mantenimiento y el de entrenamiento , etapa denominada preparación , que concluye 4 semanas antes del combate , periodo en el que deberá usar GALLO DE ORO ENTRENAMIENTO ; ATHLETIC , o CORTADOR .GALLO DE ORO PREPARACIÓN permite el funcionamiento adecuado de la molleja y evita el engrasamiento de las aves, mantiene la condición corporal adecuada para iniciarlos al periodo de entrenamiento.Ofrecer GALLO DE ORO OREPARACIÓN a razón de 80  120 g diarios por ave, dividiendo esta cantidad en 2 raciones al día. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.            \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1306,250,6,'Gallo de Oro® Cortador, es un alimento balanceado Super Premium para aves de combate que se encuentranen la etapa de cuida, en franco entrenamiento; es decir, de 3 a 4 semanas previas a la fecha del combate ya que por su rica variedad de semillas seleccionadas, su contenido de harina de alfalfa así como por su concentración de vitaminas y minerales ofrecidas por su inclusión de Calf Manna® permiten a las aves una rápida reposición de los nutrientes que son utilizadas para el entrenamiento que en muchas de las veces llega a ser intenso, así como también permite la creación de una reserva energética que podrá ser utilizada el día del combate favoreciendo la velocidad, la agilidad, la resistencia y en conclusión Gallos Cortadores.DOSIS Y VIA DE ADMINISTRACION: Oral.Ofrecer Gallo de Oro® Cortador, a razón de 80  120 gr. / ave por día,  dividiendo esta cantidad en 2 raciones por día. No debe faltar agua potable, limpia y fresca siempre al alcance de los animales.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1307,251,6,'Alimento balanceado medicado con salinomicina para aves a partir de la 9a semana de edad.Contiene salinomicina 60 g/ton. Para el tratamiento y control de coccidias en aves (pollo de engorday pollitas de reemplazo). En el tratamiento de infecciones causadas por bacteriasGrampositivasy bacterias anaerobias como Clostridium perfringens.DOSIS Y VIA DE ADMINISTRACION: Oral.GALLO DE ORO DESARROLLO se debe suministrar a libre acceso desde la semana 9 de edad y hasta la semana 15 de vida durante este para restringir su consumo de entre 100  150 g por día a partir de la semana 16 de edad y hasta que inicien su periodo de preparación y entrenamiento para el combate.No debe faltar agua potable limpia y fresca siempre al alcance de los animales.ADVERTENCIAS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca nunca dejar el alimento directamente sobre el suelo o en contacto con paredes. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.Suspender su administración a los animales destinados al consumo humano 5 días antes del sacrificio.No utilizar otras drogas anticoccidianas simultaneamente en el alimento (con excepción de traslapenormal debido al cambio de anticoccidiano). No administrar a equinos, pavo, ni gallinas de reemplazomayores a las 14 semanas de edad o ponedoras en producción. No utilizar la tiamulina o troleandomicina en forma simultanea con la Salinomicina. Prohibido el consumo de aves de combatealimentados con este producto.             USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1308,252,6,'Alimento balanceado medicado con salinomicina para satisfacer las necesidades del ave desde el primer día de edad y hasta la 4? Semana de edad, ofreciéndolo a libre acceso. Gallo de Oro inicio contiene cantidades adecuadas de calcio y fósforo para el desarrollo óptimo de los huesos. Contiene Salinomicina 60 g/ton. Para eltratamiento y control de coccidias en aves (pollo de engorda y pollitas de reemplazo) En el tratamiento de infecciones causadas por baccterias Grampositivas y bacterias anaerobias como Clostridium perfringens.A partir de la 5? Semana de edad se debe sustituir este alimento por Gallo de Oro Superbaby para lograr el mejor rendimiento de su gallo.No debe faltar agua potable, limpia y fresca siempre al alcance de los animalesDOSIS Y VIA DE ADMINISTRACION: Oral mezclado con el alimento y a libre acceso.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secossecos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.Suspender su administración a los animales destinados al consumo humano 5 días antes del sacrificio.No utilizar otras drogas anticoccidianas simultaneamente en el alimento (con excepción de traslape normal debidoal cambio anticoccidiano). No administrar a equinos, pavo, ni a gallinas de reemplazo mayores a las 14 semanasde edad o ponedoras en producción. No utilizar la tiamulina o troleandomicina en forma simultanea con la Salinomicina.Prohibido el consumo de aves de combate alimentados con este producto.               USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1309,253,6,'Alimento balanceado medicado con salinomicina iniciador de las aves de combate que cubre perfectamente la demanda nutricional para su crecimiento y adecuado emplume. Gallo de Oro Superbaby debe ofrecerse a partir de la 5ª semana de edad de los pollos y hasta que estos concluyan la 8ª. semana de edad.Antes de este alimento debe proporcionarse  gallo de oro inicio y al iniciar la 9ª semana de edad deberá substituirse por Gallo de Oro DesarrolloContiene salinomicina 60 g/ton. Para el tratamiento y control de coccidas en aves (pollo de engorda y pollitas de reemplazo). En el tratamiento de infecciones causadas por bacterias Grampositivas y bacterias anaerobias como Clostridium perfringens.Con Gallo de Oro Superbaby  más un adecuado programa de Medicina Preventiva(vacunación y desparasitación) y manejo, se lograrán aves sanas bien desarrolladas y expresión de su potencial genético.No debe faltar agua potable, limpia y fresca siempreal alcance de los animales.DOSIS Y VIA DE ADMINISTRACION: Oral y a libre acceso.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.Suspender su administración a los animales destinados al consumo humano 5 días antes del sacrificio.No utilizar otras drogas anticoccidianas simultaneamente en el alimento (con excepción de traslape normal debidoal cambio anticoccidiano). No administrar a equinos, pavo, ni a gallinas de reemplazo mayores a las 14 semanasde edad o ponedoras en producción. No utilizar la tiamulina o troleandomicina en forma simultanea con la Salinomicina.Prohibido el consumo de aves de combate alimentados con este producto.           \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1310,254,6,'GALLO DE ORO REPRODUCTORES es un alimento balanceado que satisface las necesidades nutricionales de las aves progenitoras y reproductoras de las aves de combate , aportando excelentes niveles nutricionales para favorecer mejor expresión del material genético , así como las demandas para una adecuada formación y resistencia del huevo , así como su desarrollo embrionario. DOSIS Y VIA DE ADMINISTRACION: Oral.GALLO DE ORO REPRODUCTORES, se deberá suministrar de 80  100 g de alimento por día, dividiendo esta cantidad en dos raciones al día.No debe faltar agua potable, limpia y fresca siempre al alcance de los animales. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1311,255,6,'Alimento científicamente balanceado con granos, semillas seleccionadas y núcleo proteico de las más alta calidad, para ofrecer a sus ejemplares todos los nutrientes como proteína, energía, vitaminas y un adecuado contenido de minerales que permitirán a sus gallos alcanzar el mayor rendimiento físico durante su preparación lográndose gallos ligeros y vigorosos. DOSIS Y VIA DE ADMINISTRACION: Oral.Ofrezca GALLO DE ORO ENTRENAMIENTO, a razón de 80  120 g por día dividiendo esta cantidad en 2 raciones al día, esta cantidad de alimento deberá ajustarse, en caso de que se incorporen algunos otros ingredientes a su dieta del día, a su apariencia física y al peso de las aves.No debe faltar agua potable  y fresca siempre al alcance de los animales. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                  \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1312,256,6,'Gallo de Oro Fórmula Profesional, es un alimento científicamente balanceado, con granos y semillas seleccionadas de la más alta calidad, que ofrece al ave de combate, proteína, energía, vitaminas y minerales que permiten alcanzar el mayor rendimiento físico durante su preparación, obteniendo gallos vigorosos. DOSIS Y VIA DE ADMINISTRACION: Oral.Ofrezca GALLO DE ORO FORMULA PROFESIONAL, a razón de 80  120 g por día dividiendo esta cantidad en 2 raciones al día , esta cantidad de alimento deberá ajustarse , en caso de que se incorporen algunos otros ingredientes a su dieta del día , a su apariencia física y al peso de las aves.No debe faltar agua potable  y fresca siempre al alcance de los animales. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                  \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1313,257,6,'Alimento balanceado medicado con salinomicina iniciador de las aves de combate que cubre perfectamente la demanda nutricional para su crecimiento y adecuado emplume. Gallo de Oro Superbaby debe ofrecerse a partir de la 5ª semana de edad de los pollos y hasta que estos concluyan la 8ª. semana de edad.Antes de este alimento debe proporcionarse  gallo de oro inicio y al iniciar la 9ª semana de edad deberá substituirse por Gallo de Oro DesarrolloContiene salinomicina 60 g/ton. Para el tratamiento y control de coccidas en aves (pollo de engorda y pollitas de reemplazo). En el tratamiento de infecciones causadas por bacterias Grampositivas y bacterias anaerobias como Clostridium perfringens.Con Gallo de Oro Superbaby  más un adecuado programa de Medicina Preventiva(vacunación y desparasitación) y manejo, se lograrán aves sanas bien desarrolladas y expresión de su potencial genético.No debe faltar agua potable, limpia y fresca siempreal alcance de los animales.DOSIS Y VIA DE ADMINISTRACION: Oral y a libre acceso.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.Suspender su administración a los animales destinados al consumo humano 5 días antes del sacrificio.No utilizar otras drogas anticoccidianas simultaneamente en el alimento (con excepción de traslape normal debidoal cambio anticoccidiano). No administrar a equinos, pavo, ni a gallinas de reemplazo mayores a las 14 semanasde edad o ponedoras en producción. No utilizar la tiamulina o troleandomicina en forma simultanea con la Salinomicina.Prohibido el consumo de aves de combate alimentados con este producto.           \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1314,258,6,'Alimento balanceado medicado con salinomicina iniciador de las aves de combate que cubre perfectamente la demanda nutricional para su crecimiento y adecuado emplume. Gallo de Oro Superbaby debe ofrecerse a partir de la 5ª semana de edad de los pollos y hasta que estos concluyan la 8ª. semana de edad.Antes de este alimento debe proporcionarse  gallo de oro inicio y al iniciar la 9ª semana de edad deberá substituirse por Gallo de Oro DesarrolloContiene salinomicina 60 g/ton. Para el tratamiento y control de coccidas en aves (pollo de engorda y pollitas de reemplazo). En el tratamiento de infecciones causadas por bacterias Grampositivas y bacterias anaerobias como Clostridium perfringens.Con Gallo de Oro Superbaby  más un adecuado programa de Medicina Preventiva(vacunación y desparasitación) y manejo, se lograrán aves sanas bien desarrolladas y expresión de su potencial genético.No debe faltar agua potable, limpia y fresca siempreal alcance de los animales.DOSIS Y VIA DE ADMINISTRACION: Oral y a libre acceso.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.Suspender su administración a los animales destinados al consumo humano 5 días antes del sacrificio.No utilizar otras drogas anticoccidianas simultaneamente en el alimento (con excepción de traslape normal debidoal cambio anticoccidiano). No administrar a equinos, pavo, ni a gallinas de reemplazo mayores a las 14 semanasde edad o ponedoras en producción. No utilizar la tiamulina o troleandomicina en forma simultanea con la Salinomicina.Prohibido el consumo de aves de combate alimentados con este producto.           \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1315,259,6,'Alimento balanceado de mantenimiento para de aves 100% de traspatio después de la 4ta semana deedad.GANA-AVES MULTIUSOS es un alimento diseñado, formulado y elaborado para satisfacer las necesidades de las aves 100%  de traspatio. Después de la cuarta semana de edad.Su presentación en migaja gruesa asegura mayor consumo. Contiene pigmentos naturales. DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, después de la cuarta semana de edad. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1316,260,6,'Alimento balanceado de mantenimiento para de aves 100% de traspatio después de la 4ta semana deedad.GANA-AVES MULTIUSOS es un alimento diseñado, formulado y elaborado para satisfacer las necesidades de las aves 100%  de traspatio. Después de la cuarta semana de edad.Su presentación en migaja gruesa asegura mayor consumo. Contiene pigmentos naturales. DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, después de la cuarta semana de edad. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1317,261,6,'Alimento balanceado para engorda de ganado bovino.GANACARNE MULTIUSOS es un alimento diseñado, formulado y elaborado con ingredientes que proveen los nutrimentos necesarios y de fácil digestión para bovinos en engorda.  Al iniciar el periodo de engorda deberá de haber una fase de adaptación en donde se deberá deincluir paulatinamente el alimento GANACARNE MULTIUSOS y disminuir el forraje de lastre.  Mantener en todo momento agua limpia y fresca para su ganado. DOSIS Y VIA DE ADMINISTRACION: Oral.Ofrecer alimento GANACARNE MULTIUSOS a libre acceso (el consumo es de alrededor de 8 a 10 kilos), más alrededor de 2 a 3 kilos de forrajes de lastre de buena calidad.                       \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1318,262,6,'Alimento balanceado medicado para cerdos de 35 kg de peso y hasta el peso de mercado.  GANACERDOS MULTIUSOS es un alimento peletizado, para cerdos desde 35 kg de peso (*) y hasta que alcancen el peso a mercado. Está elaborado con ingredientes de buena calidad y su formulación provee todos los nutrimentos necesarios, balanceados perfectamente para lograr buenas ganancias de peso. (*) De 20 Kg. a 35 Kg. de peso vivo, utilizar alimento INICIAPORK MEJORADO. DOSIS Y VIA DE ADMINISTRACION: Proporcionar  GANACERDOS MULTIUSOS a libre acceso y evitar la contaminación del alimento. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes, y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Este alimento no deberá de ofrecerse 5 días antes del sacrificio de los animales destinados para consumo humano.                USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1319,263,6,'Alimento balanceado medicado para cerdos de 20 a 35 kg de peso. GANACERDOS No.1 es un alimento para cerdos desde las 8 semanas de edad o 20 kg de peso (*) y hasta los 35 kg. Tiene una presentación en pellet que ayuda al cerdo a consumirlo adecuadamente y tener una mejor adaptación al cambio de alimento de crecimiento, evitando problemas digestivos. Está elaborado con todos los nutrimentos esenciales para un buen inicio del crecimiento. Cuando los cerdos pesen aproximadamente 35 kg, sustituya paulatinamente GANACERDOS No.1 por GANACERDOS No. 2(*) Del nacimiento y hasta las 8 semanas o 20 kg de peso vivo, recomendamos utilizar el programa de preiniciadores maltaCleyton (Super Apilac Ultra 0-1-2-3). DOSIS Y VIA DE ADMINISTRACION: Proporcionar a libre acceso. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Este alimento no deberá de ofrecerse 15 días antes del sacrificio de los animales destinados para consumo humano.               \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1320,264,6,'Alimento balanceado medicado para cerdos de 35 a 75 kg de peso. GANACERDOS No. 2 es un alimento para cerdos desde los 35 (*) y hasta los 75 kg de peso. Tiene una presentación en pellet que ayuda al cerdo a consumirlo adecuadamente y tener una mejor adaptación al cambio de alimento de crecimiento, evitando problemas digestivos. Está elaborado con todos los nutrimentos esenciales para un buen crecimiento y desarrollo.  Tener siempre agua potable y fresca para los cerdos. Cuando los cerdos pesen aproximadamente 75 kg, sustituya paulatinamente GANACERDOS No. 2  por GANACERDOS No. 3(*) De 20 a 35 kg de peso, usar el alimento GANACEROS No. 1  DOSIS Y VIA DE ADMINISTRACION: Proporcionar GANACERDOS No. 2  a libre acceso. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo o en contacto con paredes.Este alimento no deberá de ofrecerse 5 días antes del sacrificio de los animales destinados para consumo humano.             USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1321,265,6,'Alimento balanceado medicado para cerdos de 75 kg a peso de mercado. GANACERDOS No. 3 es un alimento para cerdos desde los 75 kg de peso (*) y hasta el peso a mercado. Tiene una presentación en pellet que ayuda al cerdo a consumirlo adecuadamente y tener una mejor adaptación al cambio de alimento de crecimiento, evitando problemas digestivos. Está elaborado con todos los nutrimentos esenciales para una buena finalizaciónTener siempre agua potable y fresca para los cerdos.(*) De 35 a 75 kg de peso, usar el alimento GANACEROS No. 2  DOSIS Y VIA DE ADMINISTRACION: Proporcionar a libre acceso. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes  y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Este alimento no deberá de ofrecerse 5 días antes del sacrificio de los animales destinados para consumo humano.                 USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1322,266,6,'USO Y ESPECIES EN LAS QUE SE EMPLEA: Alimento balanceado para Conejos de Engorda y Reproductores. Las necesidades de nutrimentos y de cantidad de alimento para los conejos reproductores, varían según la raza, la edad, la etapa fisiológica, el ritmo reproductivo, las condiciones ambientales y el manejo general de la explotacións.  DOSIS Y VIA DE ADMINISTRACION:CONEJOS EN ENGORDA: Alimentación a libre acceso. HEMBRAS VACÍAS: 100 a 120 gramos al día HEMBRAS GESTANTES: 125 a 175 gramos al día durante los primeros 20 días de la gestación; y 175 a 250 gramos al día durante los últimos 10 días de la gestación. HEMBRAS LACTANTES: Alimentación a libre acceso. Al final de la lactancia es probable que la hembra junto con su camada pueda consumir más de 500 gramos al día. MACHOS ACTIVOS: 150 a 200 gramos al día, dependiendo de la actividad sexual y de su condición corporal. MACHOS EN REPOSO: 100 a 125 gramos, dependiendo de su condición corporal. Ofrecer a todos los conejos agua de buena calidad y siempre a disposición. ADVERTENCIAS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a sus bodegas de personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.Este alimento no deberá de ofrecerse 1 día antes del sacrificio de los animales destinados para consumo humano.        \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1323,267,6,'Alimento balanceado para vacas lecheras.GANALECHE 17% ESPECIAL, es un alimento diseñado, formulado y elaborado con ingredientes que proveen los nutrimentos necesarios y de fácil digestión para vacas lecheras en producción.Suministrar forrajes de calidad (que nos aporta fibra necesaria para una buena digestión).  Mantener en todo momento agua limpia y fresca.  DOSIS Y VIA DE ADMINISTRACION: Oral. Dependiendo del nivel de producción, la raza, el peso, el ambiente y manejo, así como de los forrajes disponibles y su calidad, se deberá de ofrecer 1 kilogramo de este alimento por aproximadamente cada 3 litros de leche producida.                         \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1324,268,6,'Alimento balanceado formulado y elaborado con ingredientes que proveen los nutrimentos necesarios para la producción lechera.USO Y ESPECIES EN LAS QUE SE EMPLEA: Bovinos. Para vacas lecheras en producción.DOSIS Y VIA DE ADMINISTRACION: Oral. La cantidad a ofrecer de este alimento depende además de otros factores, de la producción promedio de leche. Usar 1 kg por cada 3 litros de leche producida. Para más información del uso de este alimento, favor de contactar con el servicio técnico de maltaCleyton®. Mantener en todo momento agua limpia y fresca para las vacas.ADVERTENCIAS: De preferencia, ofrezca el alimento diariamente y no permita que consuman alimento del día anterior o alimento en mal estado. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que absorba humedad. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1325,269,6,'Alimento balanceado formulado y elaborado con ingredientes que proveen los nutrimentos necesarios para la producción lechera.USO Y ESPECIES EN LAS QUE SE EMPLEA: Bovinos. Para vacas lecheras en producción.DOSIS Y VIA DE ADMINISTRACION: Oral. La cantidad a ofrecer de este alimento depende además de otros factores, de la producción promedio de leche. Usar 1 kg por cada 3 litros de leche producida. Para más información del uso de este alimento, favor de contactar con el servicio técnico de maltaCleyton®. Mantener en todo momento agua limpia y fresca para las vacas.ADVERTENCIAS: De preferencia, ofrezca el alimento diariamente y no permita que consuman alimento del día anterior o alimento en mal estado. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que absorba humedad. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1326,270,6,'Alimento balanceado para vacas lecheras en producción.GANALECHE ALTAS PRODUCTORAS es un alimento diseñado, formulado y elaborado con ingredientes que proveen los nutrimentos necesarios y de fácil digestión para vacas lecheras en producción. Mantener en todo momento agua limpia y fresca.  DOSIS Y VIA DE ADMINISTRACION: Oral. Dependiendo del nivel de producción, la raza, el peso, el ambiente y manejo, así como de los forrajes disponibles y su calidad, se deberá de ofrecer 1 kilogramo de este alimento por aproximadamente cada 3 litros de leche producida.                           \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1327,271,6,'Alimento balanceado para vacas lecheras.GANALECHE MULTIUSOS, es un alimento diseñado, formulado y elaborado con ingredientes que proveen los nutrimentos necesarios y de fácil digestión para vacas lecheras en producción.  Mantener en todo momento agua limpia y fresca para sus vacas.DOSIS Y VIA DE ADMINISTRACION:Oral. Dependiendo del nivel de producción, la raza, el peso, el ambiente y manejo, así comode los forrajes disponibles, se deberá de ofrecer 1 kilogramo de este alimento por aproximadamentecada 2 a 3 litros de leche producida.                           \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1328,272,6,'Alimento balanceado medicado con Salinomicina adicionado con un promotor del crecimiento de origen 100%natural (B SAFE). Para el control de coccidias en aves (pollo engorda y pollitas reemplazo). En el tratamientode infecciones causadas por bacterias Grampositivas y bacterias anaerobias como Clostridium perfringens.Con la granulometría adecuada para pollitos de engorda Y polla de postura, para los primeros siete días de edad.Mantenga una temperatura constante 32°C la primera semana de vida, suministre agua limpia y alimento a libertad.DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, para los primeros siete días de edad. Pollo de engorda ofrecer de 100 a 200 gramos de 0 a 7 días de edad, pollita de postura ofrecer 100 gramos de 0 a 10 días de edad. ADVERTENCIAS: Retirar este alimento 05 días previos al sacrificio de los animales destinados al consumo humano. No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. No administrar a equinos, pavos, ni a gallinas de reemplazo mayores a 14 semanas de edad o ponedorasen producción.                    \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1329,273,6,'Alimento balanceado, diseñado, formulado y elaborado para satisfacer las necesidades de la gallinade segundo ciclo o al final del primero, adicionado con extractos de sustancias aromáticas de Zingiberaceae(curcumina), extractos vegetales de Asteraceae sepiolita. (PERFEGG®) que funciona como coadyuvante en la función hepática y metablismo de los lípidos en aves de postura.USO Y ESPECIES EN LAS QUE SE EMPLEA:Aves. Para gallinas de postura de segundo ciclo.DOSIS Y VÍA DE ADMINISTRACIÓN: Oral. A libre acceso.ADVERTENCIAS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.De salida al alimento que tenga mas tiempo en sus bodegas para evitar su envejecimiento.No dar este alimento en aves menores de 10 semanas ya que no contiene coccidiostato y el nivel de calcio es muy alto.                    \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1330,274,6,'Alimento balanceado, diseñado, formulado y elaborado para satisfacer las necesidades de la gallinade postura desde su primer huevo hasta las 36 semanas de edad, con extractos de sustancias aromáticas de Zingiberaceae (curcumina), extractos vegetales de Asteraceae sepiolita. (PERFEGG®)que funciona como coadyuvante en la función hepática y metablismo de los lípidos en aves de postura.USO Y ESPECIES EN LAS QUE SE EMPLEA:Aves. Para gallinas de postura desde el primer huevo hasta las 36 semanas de edad.DOSIS Y VÍA DE ADMINISTRACIÓN: Oral. A libre acceso.ADVERTENCIAS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.De salida al alimento que tenga mas tiempo en sus bodegas para evitar su envejecimiento.No dar este alimento en aves menores de 10 semanas ya que no contiene coccidiostato y el nivel de calcio es muy alto.                    \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
