	(1332,276,6,'Alimento balanceado, diseñado, formulado y elaborado para satisfacer las necesidades de la gallinade postura de 61 a 103 semanas de edad o fin del primer ciclo de postura con extractos de sustancias aromáticasde Zingiberaceae (curcumina), extractos vegetales de Asteraceae sepiolita. (PERFEGG®)que funciona como coadyuvante en la función hepática y metablismo de los lípidos en aves de postura.USO Y ESPECIES EN LAS QUE SE EMPLEA:Aves. Para gallinas de postura de 61 a 103 semanas de edad.DOSIS Y VÍA DE ADMINISTRACIÓN: Oral. A libre acceso.ADVERTENCIAS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.De salida al alimento que tenga mas tiempo en sus bodegas para evitar su envejecimiento.No dar este alimento en aves menores de 10 semanas ya que no contiene coccidiostato y el nivel de calcio es muy alto.                    \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1333,277,6,'La cantidad de grano de oro a ofrecer es determinada por el peso del caballo y por ende la racíon diaria siempre será individual, para ellos se diseño la siguiente tabla, según las variantes de los caballos adultos. Peso del Caballo Kg: 400 Kg. GRANO DE ORO / día: 4.5 Kg. Forraje / día: 5.0Peso del Caballo Kg: 450 Kg. GRANO DE ORO / día: 5.0 Kg. Forraje / día: 5.5Peso del Caballo Kg: 500 Kg. GRANO DE ORO / día: 5.5 Kg. Forraje / día: 6.0Peso del Caballo Kg: 550 Kg. GRANO DE ORO / día: 6.0 Kg. Forraje / día: 6.5Peso del Caballo Kg: 600 Kg. GRANO DE ORO / día: 6.5 Kg. Forraje / día: 7.0DOSIS Y VIA DE ADMINISTRACIÓN: Alimento balanceado para caballosLa cantidad arriba señalada, deberá ser dividida en dos raciones, una por la mañana y la otra partepor la tarde. Aemás de GRANO DE ORO deben de suministrarse forrajes de buena calidad(que aporten la fibra necesaria para un buen funcionamiento intestinal y una buena digestión).ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                 \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1334,278,6,'Alimento balanceado y diseñado para ser suministrado a los bagres en el periodo posterior a la etapa de alevinaje hasta que alcancen la etapa juvenil, aproximadamente de los 5 g de peso o de los 5 cm a los15 cm de longitud. La cantidad a suministrar depenerá de la temperatura del agua, oxígeno disueltoproductividad del estanque y su sanidad.ESPECIE(S) DESTINO: Peces Bagre ( Ictalurus punctatus). Bagre de canalDOSIS Y VIA DE ADMINISTRACION: Oral.Con una Talla de 2 a 4 pulgadas ó de 5 a 10 centímetros, con un peso promedio de 5 gramos, administrar 5% del peso de la biomasa, 4 veces/día, a una Temperatura > a 26°C.Con una Talla de 4 a 6 pulgadas ó de 10 a 15 centímetros, con un peso promedio de 25 gramos, administrar 4% del peso de la biomasa, 2 veces/día, a una Temperatura > a 26°C.Con una Talla mayor a 6 a 8 pulgadas ó mayor a 15 centímetros, con un peso promedio de 50 gramos, administrar 3% del peso de la biomasa, 2 veces/día, a una Temperatura > a 26°C. ADVERTENCIAS Protéjalo de la luz solar directa, lluvia y otros agentes externos. Estíbelo sobre tarimas, nunca en contactodirecto con el piso y paredes para evitar que el alimento absorba humedad. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Evite el acceso a sus bodegas a personas extrañasy toda clase de animales. Dé salida al alimento que tenga mas tiemmpo en sus bodegas para evitar su envejecimiento. Queda prohibido el uso en la alimentación de rumiantes.                \r','2017-07-27 13:25:02','2017-07-27 17:25:02');
