	(1338,282,6,'Alimento balanceado diseñado para cubrir los requerimientos nutricionales de las corvinas en la etapade engorda.ESPECIE (S) DESTINO: Peces : Corvina (Argyrosomus regius).DOSIS Y VIA DE ADMINISTRACION: Oral. Para organismos de 80 g. hasta alcanzar el peso de 250 g. ofreciendo un 7% de la biomasa en 5raciones (en presentación de 3.5 mm.). Recomendada para peces de 250 g. hasta 900 g. ofreciendo un 5% de la biomasa en 4 raciones (en presentación de 5.5 mm).ADVERTENCIAS:Protéjalo de la luz solar directa, lluvia y otros agentes externos. Estíbelo sobre tarimas, nunca en contacto directo con el piso y paredes para evitar que el alimento absorba humedad. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
