	(1347,291,6,'Alimento completo formulado para cubrir los requerimientos de las tilapias durante la etapa de engorda. De 70 a 100 gramos de peso.USO Y ESPECIES EN LAS QUE SE EMPLEA: Peces. Tilapias (Oreochromis niloticus). MojarraDOSIS Y VIA DE ADMINISTRACION: OralAdministrar  a tilapias de 70 a 100 g de peso a razón de 4 % al % 5% de biomasa 3 veces al día.ADVERTENCIASProtéjalo de la luz solar directa por el alto contenido de vitaminas y aceite, estíbelo sobre tarimas en un lugar seco para evitar que absorba humedad del suelo, libre de plagas, insectos, roedores y animalesnocivos.                           \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1348,292,6,'Alimento completo formulado para cubrir los requerimientos de las tilapias durante la etapa de finalización. De 100 gramos de peso hasta alcanzar peso y talla de mercado.USO Y ESPECIES EN LAS QUE SE EMPLEA: Peces. Tilapias (Oreochromis niloticus). MojarraAlimento balanceado para ser suministrado en tilapias en el periodo posterior a la engorda, cuando se empiece la finalización hasta que alcancen la talla  de cosecha DOSIS Y VIA DE ADMINISTRACION: OralAdministrar  a tilapias de 100 g de peso en adelante  a razón de 1 % a % 2% de biomasa 2 dosis pordía.Protéjalo de la luz solar directa por el alto contenido de vitaminas y aceite, estíbelo sobre tarimas en un lugar seco para evitar que absorba humedad del suelo, libre de plagas, insectos, roedores y animalesnocivos.                        \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1349,293,6,'Alimento balanceado formulado para cubrir los requerimientos de las tilapias durante la etapa de finalizaciónDe 100 gramos de peso hasta alcanzar peso y talla de mercado.ESPECIE(S) DESTINO: Peces: Tilapias (Oreochromis niloticus).DOSIS Y VIA DE ADMINISTRACIÓN: Oral. Administrar a tilapias de 100 gramos de peso en adelante a razón de 1% a 2% de biomasa 2 dosis por día.ADVERTENCIAS:Protéjalo de la luz solar directa, lluvia y otros agentes externos. Estíbelo sobre tarimas, nunca en contactodirecto con el piso y paredes para evitar que el alimento absorba humedad. No almacene este alimentoen lugares húmedos, mal ventilados o calientes. Evite el acceso a sus bodegas a personas extrañas y todaclase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento. Queda prohibido el uso en la alimentación de rumiantes.                        \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1350,294,6,'ESPECIE(S) DESTINO: Peces: Truchas. Trucha Arcoiris (Oncorhynchus mykiss).Alimento balanceado, formulado para cubrir los requerimientos de las truchas durante la etapa de Finalización. Se utiliza desde que las truchas tienen 100 g de peso o 20 cm de longitud hasta su peso o talla de mercado.Recomendada para obtener truchas con filetes color salmón de 100 g en adelante hasta la tallacomercial (350g), el uso de este alimento es de por lo menos 5 semanas para obtenerlos resultados requeridos.DOSIS Y VIA DE ADMINISTRACION: Oral. Administrar de 1.0% a 1.9% de biomasa por díadependiendo de la temperatura del estanque.ADVERTENCIAS: Protéjalo de la luz solar directa, lluvia y otros agentes externos. Estíbelo sobretarimas, nunca en contacto directo con el piso y paredes para evitar que el alimento absorba humedad. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimentoque tenga más tiempo en sus bodegas para evitar su envejecimiento.Queda prohibido el uso en la alimentación de rumiantes.                    \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1351,295,6,'Alimento completo formulado para cubrir los requerimientos de las truchas durante la etapa de alevín.Se utiliza desde que las truchas tienen 50 g de peso o midan aproximadamente 16 cm de longitudUSO Y ESPECIES EN LAS QUE SE EMPLEA: Peces Trucha (Oncorhynehus mykiss).DOSIS Y VIA DE ADMINISTRACION: Oral. Migaja para los primeros estadios de las truchas, desde los 5g hasta los 15g de peso, o bien cuando alcanzan una talla de 11.5 cm de longitud. Administrar  2% a 5% de la biomasa  al día dependiendo de la temperatura del estanque.Pellet  3/32 desde 15g, hasta 35g o hasta los 15 cm de longitud. Administrar de 2% a 4% de la biomasa día dependiendo de la temperatura del estanque. Pellet 1/8 desde los 35g hasta 50g o con una talla de hasta 16.5 cm de longitud. Administrar de 1.3% a 3.0% de la biomasa día, dependiendo de la temperatura estanque.ADVERTENCIAS:Protégalo de la luz solar directa por el alto contenido de vitaminas y aceite, estíbelo sobre tarimasen un lugar seco para evitar que absorba humedad del suelo y se mantenga libre de plagas, insectosroedores y animales nocivos.                   USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1352,296,6,'ESPECIE(S) DESTINO: Peces: Truchas.(Oncorhynchus mykiss).Alimento balanceado, formulado para cubrir los requerimientos de las truchas durante la etapa de inicio. Se utiliza desde que las truchas tienen 50 g de peso o midan aproximadamente 16 cm de .longitud hasta los 100 g de peso o 20 cm de longitudDOSIS Y VIA DE ADMINISTRACIÓN: OralAdministrar de 1.1% a 2.3% de la biomasa día dependiendo de la temperatura del estanque repartida por lo menos 2 veces al día. En presentación extruido 3/16.Protéjalo de la luz solar directa, lluvia y otros agentes externos. Estíbelo sobre tarimas, nunca en contactodirecto con el piso y paredes para evitar que el alimento absorba humedad. No almacene este alimentoen lugares húmedos, mal ventilados o calientes. Evite el acceso a sus bodegas a personas extrañas y todaclase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento. Queda prohibido el uso en la alimentación de rumiantes.                       \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1353,297,6,'ESPECIE(S) DESTINO: Peces: Truchas.(Oncorhynchus mykiss).Alimento balanceado, formulado para cubrir los requerimientos de las truchas durante la etapa de Finalización. Se utiliza desde que las truchas tienen 100 g de peso o 20 cm de longitud hasta su peso o talla de mercado.DOSIS Y VIA DE ADMINISTRACION: Oral. Administrar de 1.0% a 1.9% de la biomasa por día dependiendode la temperatura del estanque.ADVERTENCIAS: Protéjalo de la luz solar directa, lluvia y otros agentes externos. Estíbelo sobre tarimas, nunca en contactodirecto con el piso y paredes para evitar que el alimento absorba humedad. No almacene este alimentoen lugares húmedos, mal ventilados o calientes. Evite el acceso a sus bodegas a personas extrañas y todaclase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento. Queda prohibido el uso en la alimentación de rumiantes.                       \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1354,298,6,'Alimento formulado y elaborado con proteínas, granos de cereales procesados, minerales, vitaminas y aditivos que proporcionan los nutrimentos esenciales para la finalización de los cerdos que ayuda amejorar el desempeño productivo y a mejorar el rendimiento y la calidad de la canal. Mantener en todo momento agua potable y fresca para los cerdos.USO Y ESPECIES EN LAS QUE SE EMPLEA:Alimento medicado para cerdos indicado para las ultimas 4 semanas de la engorda aproximadamenteen un rango de peso entre 75 y 100 kg.DOSIS Y VIA DE ADMINISTRACION:A libre acceso via oral.ADVERTENCIAS:Tratar de evitar la contaminación del alimento. No almacenar el alimento en lugares húmedos, calientes y malventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animalesDe preferencia, estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Este alimento no requiere periodo de retiro antes del sacrificio de los animales destinados al consumohumano.                               USO VETERINARIO.CONSULTE AL MEDICO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1355,299,6,'Alimento formulado y elaborado con proteínas, granos de cereales procesados, minerales, vitaminas y aditivos que proporcionan los nutrimentos esenciales para el desarrollo de los cerdos.USO Y ESPECIES EN LAS QUE SE EMPLEA: Alimento balanceado medicado para desarrollo de cerdos indicado para un rango de peso vivo de entre 50 y 75 kg. Mantener en todo momento agua potable y fresca para los cerdos.DOSIS Y VIA DE ADMINISTRACIÓN: A libre acceso via oral.ADVERTENCIAS:Tratar de evitar la contaminación del alimento. No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredesSuspender 7 días antes del sacrificio de los animales destinados al consumo humano.                          USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1356,300,6,'Alimento formulado y elaborado con proteínas, granos de cereales procesados, minerales, vitaminas y aditivos que proporcionan los nutrimentos esenciales para el crecimiento de los cerdos. Manteneren todo momento agua potable y fresca para los cerdos.USO Y ESPECIES EN LAS QUE SE EMPLEA: Alimento balanceado medicado para creimiento de cerdos indicado para un rango de peso vivo de entre 30 y 50 kg.DOSIS Y VIA DE ADMINISTRACION:A libre acceso via oral. ADVERTENCIAS:Tratar de evitar la contaminación del alimento. No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredesSuspender 7 días antes del sacrificio de los animales destinados al consumo humano.                     USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
