	(1358,302,6,'Alimento formulado y elaborado con proteínas, granos de cereales procesados, minerales, vitaminas y aditivos que proporcionan los nutrimentos esenciales para la lactancia de las cerdas. Mantener en todo momento agua potable y fresca para las cerdas.USO Y ESPECIES EN LAS QUE SE EMPLEA: Alimento para cerdas en lactanciaDOSIS Y VIA DE ADMINISTRACION: A libre acceso via oral. Ofrecerlo al menos en dos o tres servidas al día.ADVERTENCIAS:Tratar de evitar la contaminación del alimento. No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia, estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                      USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1359,303,6,'INICIA CORDEROS; Alimento balanceado medicado completo, diseñado, formulado y elaborado con ingredientes de excelente calidad, que proveen los nutrimentos necesarios y de fácil digestión y aprovechamiento para corderos desde 1 semana de edad y hasta el destete. Ofrecer alimento INICIA CORDEROS a libre acceso en el periodo señalado; tratar de usar el sistema Creep Feeding, para que este alimento lo consuman solo los corderos y no sus madres. Importante mantener en todo momento agua limpia y fresca para sus borregos.  DOSIS Y VIA DE ADMINISTRACION: A libre acceso desde la primera semana de edad y hasta el destete.ADVERTENCIAS:No almacenar alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores insectos y otros animales. De preferencia estibar sobre tarimas y no dejar elalimento directamente sobre el suelo y/o en contacto con paredes                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
