	(1368,312,6,'INICIO 1 es un alimento balanceado medicado iniciador para cerdos de 43 a 75 días de edad. Tiene una presentación en pellet que ayuda al cerdo a consumirlo adecuadamente en esta etapa y tener una mejor adaptación, evitando problemas digestivos y así aprovechas todos los nutrimentos que su formulación ofrece.INICIO 1, está formulado y elaborado con proteínas de primera calidad, granos de cereales y oleaginosas procesados, que proporcionan los nutrimentos esenciales con alta biodisponibilidad para un rápido y eficiente inicio del crecimiento de los cerdos. Evitar la contaminación del alimento.Mantener en todo momento agua potable y fresca (ni muy caliente, ni muy fría) para los cerdos. DOSIS Y VIA DE ADMINISTRACION: Oral a libre acceso. ADVERTENCIAS: Este alimento no deberá de ofrecerse 28 días antes del sacrificio de los animales destinados para consumo humano.Mantenerlo fuera del alcance de los niños y animales domésticos.No almacenar el alimento cerca de productos tóxicos, ni en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de la luz solar, de roedores, insectos y otros animales.Estibar de preferencia sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.              USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1369,313,6,'Alimento balanceado medicado con monensina para becerras; indicado para prevención de la coccidiosis causada por Eimeria bovis y E. zoemmi, para mejorar la ganancia de peso y la conversión alimenticiaSe debe suministrar junto con forrajes de calidad y apetecibles que aportan la fibra necesaria para una buena digestiónUSO Y ESPECIES EN LAS QUE SE EMPLEA: Bovinos. Para de becerras en destete tempranoDOSIS Y VIA DE ADMINISTRACION: Oral. Se utiliza después del destete, en seguida del alimento iniciador (1º de edad). Usar de 2 kg hasta 4 kg/becerra/día. maltaCletyon®.  Mantener en todo momento agua limpia y fresca para las becerrasADVERTENCIAS: Inútil cualquier programa de alimentación o sanitario si las crías no reciben calostro durante las primeras 8 horas de vida. Mantenga siempre agua limpia y fresca disponible en la crianza. Ofrezca el alimento diariamente y no permita que consuman alimento del día anterior o alimento en mal estado. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que absorba humedad. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento. Suspender el consumo 3 días antes del sacrificio de animales para consumo humano. No se administre a Equinos               \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1370,314,6,'Alimento balanceado medicado con monensina para becerras; indicado para prevención de la coccidiosis causada por Eimeria bovis y E. zoemmi, para mejorar la ganancia de peso y la conversión alimenticia. Se utiliza después del destete, en seguida del alimento iniciador (1ª edad).USO Y ESPECIES EN LAS QUE SE EMPLEA: Bovinos. Para becerras destetadas.DOSIS Y VIA DE ADMINISTRACION: Oral. Se utiliza después del destete, en seguida del alimento iniciador (1º de edad). Usar de 1 kg a 2 kg/becerra/día únicamente con fibra o puede utilizarse mezclado con granos disponibles (maíz, avena, cebada) 60  70% de Jovix Mix y 30-40% de granos. Mantener una fuente sabrosa de fibra a libre disposición de los animales. Para mayor información del uso del alimento, favor de  contactar con el servicio técnico de maltaCletyon®. Mantener en todo momento agua limpia y fresca para las becerras.ADVERTENCIAS: Inútil cualquier programa de alimentación o sanitario si las crías no reciben calostro durante las primeras 8 horas de vida. Mantenga siempre agua limpia y fresca disponible en la crianza. Ofrezca el alimento diariamente y no permita que consuman alimento del día anterior o alimento en mal estado. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que que absorba humedad. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento. Suspender el consumo 3 días antes del sacrificio de animales para consumo humano. No se administre a Equinos.              \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1371,315,6,'Alimento balanceado medicado con monensina para becerras; indicado para prevención de la coccidiosis causada por Eimeria bovis y E. zuemii. Bajo la prescripción y supervisión de un Médico Veterinario.alimenticia. Se utiliza después del destete, luego de alimento iniciador de 1ª edad.USO Y ESPECIES EN LAS QUE SE EMPLEA: Bovinos. Para becerras en iniciación y destetadas.DOSIS Y VIA DE ADMINISTRACION: Oral. Se utiliza desde la primera semana de vida de la becerra, a voluntad. Puede utilizarse después del destete, hasta un máximo de 4 kg/becerra/día. Mantener una fuente sabrosa de fibra a libre disposición de los animales.Para mayor información del uso del alimento, favor de  contactar con el servicio técnico de maltaCletyon®. Mantener en todo momento agua limpia y fresca para las becerras.ADVERTENCIAS: Inútil cualquier programa de alimentación o sanitario si las crías no reciben calostro durante las primeras 8 horas de vida. Mantenga siempre agua limpia y fresca disponible en la crianza. Ofrezca el alimento diariamente y no permita que consuman alimento del día anterior o alimento en mal estado. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que absorba humedad. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento. Suspender el consumo 3 días antes del sacrificio de animales para consumo humano. No se administre a Equinos.                USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1372,316,6,'Alimento balanceado medicado con monensina para becerras; indicado para prevención de la coccidiosis causada por Eimeria bovis y E. zoemmi, para mejorar la ganancia de peso y la conversión alimenticia. Alimento iniciador de 1° edad. Ofrecerlo hasta 1 semana después del destete.USO Y ESPECIES EN LAS QUE SE EMPLEA: Bovinos. Para becerras en destete temprano.DOSIS Y VIA DE ADMINISTRACION: Oral. Se utiliza desde la primera semana de vida de la becerra, a voluntad (desde 0.2 y hasta llegar a 1.5 kg becerra/día), y hasta la 1° semana después del destete. Cuando la situación sanitaria es buena, no distribuir fuente de fibra hasta el destete. Para mayor información de uso de este alimento, favor de  contactar con el servicio técnico de maltaCletyon®. Mantener en todo momento agua limpia y fresca para las becerras.ADVERTENCIAS: Inútil cualquier programa de alimentación o sanitario si las crías no reciben calostro durante las primeras 8 horas de vida. Mantenga siempre agua limpia y fresca disponible en la crianza. Ofrezca el alimento diariamente y no permita que consuman alimento del día anterior o alimento en mal estado. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que absorba humedad. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento. Suspender el consumo 3 días antes del sacrificio de animales para consumo humano. No se administre a Equinos.                \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1373,317,6,'Alimento balanceado medicado para cerdas en lactancia. DOSIS Y VIA DE ADMINISTRACION: La cantidad de alimento requerido por la cerda lactante, depende de su peso, número de lactancia, de las condiciones ambientales y del número de lechones que se estén amamantando.Al momento del parto no ofrecer alimento. Durante el 1er. día ofrecer ½ kg., después y hasta el día 5° aumentar ½ kg por cada día, posteriormente la alimentación será a libre acceso. Para favorecer el consumo, se recomienda dar alimento mínimo 2 veces al día (una en la mañana y la otra en la tarde). Al momento del destete, la cantidad de alimento ofrecido se baja a 2-2.5 kg durante 2 o 3 días para bajarla producción de leche; posteriormente se les ofrece de 3 a 3.5 kg, y hasta la cubrición. Cuando una cerda sale muy flaca de la lactancia, se le puede dar alimento a libre acceso para que recupere más rápido su condición corporal y entre más pronto en calor para ser cubierta. ADVERTENCIAS: Este alimento no deberá de ofrecerse 5 días antes del sacrificio de los animales destinados al consumo humano.                    \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1374,318,6,'Alimento balanceado para ganado lechero.LECHERO CAMPERO es un alimento diseñado, formulado y elaborado con ingredientes que proveen los nutrimentos necesarios y de fácil digestión para vacas lecheras en producción.  Mantener en todo momento agua limpia y fresca para sus vacas. DOSIS Y VIA DE ADMINISTRACION: Oral. Dependiendo del nivel de producción, la raza, el peso, el ambiente y manejo, así como de los forrajes disponibles, se deberá de ofrecer 1 kilogramo de este alimento por aproximadamente cada 2 a 2.5 litros de leche producida.                          \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
