	(1380,324,6,'Alimento medicado con Monensina 20 g/ton para vacas lecherasEs un alimento diseñado, formulado y elaborado con ingredientes de calidad, que proveen los nutrimentos necesarios y de fácil digestión para vacas lecheras en producción.Este alimento es un concentrado, por lo que además deben de suministrarse forrajes de buena calidad (que nos aporta fibra necesaria para una buena digestión). Mantener en todo momento agua limpia y fresca. DOSIS Y VIA DE ADMINISTRACION: via oralLa cantidad a ofrecer de este alimento depende además de otros factores, de la producción promedio de leche. En promedio ofrecer 1 kg. de este alimento por cada 3 litros de leche producida.ADVERTENCIAS: Suspender el consumo 3 días antes del sacrificio de los animales destinados para el consumo humano. No se administre a equinos.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.De salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimientoy pérdida de propiedades nutrimentales                  \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
