	(1385,329,6,'LECHERO 20 CSA, es un alimento  balanceado y completo con semilla de algodón, diseñado, formulado y elaborado con ingredientes de excelente calidad, que proveen los nutrimentos necesarios y de fácil digestión para vacas lecheras en producción. Para formulación especial de ración integral con el uso de este alimento, favor de contactar con el Servicio Técnico de maltaCleyton.Mantener en todo momento agua limpia y fresca para sus vacas.  DOSIS Y VIA DE ADMINISTRACION: Dependiendo del nivel de producción, la raza, el peso, el ambiente y manejo, así como de los forrajes disponibles, se deberá de ofrecer 1 kilogramo de este alimento por aproximadamente cada 2.5 a 3 litros de leche producida.  ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo o en contacto con paredes.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1386,330,6,'LECHERO 20 CSA, es un alimento  balanceado y completo con semilla de algodón, diseñado, formulado y elaborado con ingredientes de excelente calidad, que proveen los nutrimentos necesarios y de fácil digestión para vacas lecheras en producción. Para formulación especial de ración integral con el uso de este alimento, favor de contactar con el Servicio Técnico de maltaCleyton.Mantener en todo momento agua limpia y fresca para sus vacas.  DOSIS Y VIA DE ADMINISTRACION: Dependiendo del nivel de producción, la raza, el peso, el ambiente y manejo, así como de los forrajes disponibles, se deberá de ofrecer 1 kilogramo de este alimento por aproximadamente cada 2.5 a 3 litros de leche producida.  ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitiios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo o en contacto con paredes.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1387,331,6,'Alimento balanceado con semilla de algodón, para vacas lecheras en producción.LECHERO 21% es un producto diseñado para vacas productoras de leche que por sus necesidades de producción necesitan ser alimentadas con proteína suplementaria de alta calidad, que el forraje no puede proporcionarles y al mismo tiempo la energía necesaria para lograr una mayor producción de leche sin sacrificar la condición corporal del ganado y sin afectar parámetros producidos. Por las características de los ingredientes que conforman este alimento dentro de su fracción proteica, tienen la ventaja de estar incluidos justo a las necesidades de fermentación ruminal como son soya, canola, cártamo, salvado de trigo y semilla de algodón; en proporciones que al iniciar su degradación lo hacen de manera controlada, degradándose en diferente tiempo en función de la disponibilidad de las fuentes energéticas permitiendo una mayor eficiencia ruminal aprovechando los nutrientes de los forrajes para lograr una mayor producción de leche. DOSIS Y VIA DE ADMINISTRACION: Guía de alimentación con Lechero 21% de acuerdo a la producción de leche promedio por vaca*** CALIDAD DE PASTURA kg de materia seca: MALA (fibrosa) marca 5% de proteína más 50% FND** PRODUCCIÓN DE LECHE (lts): Más de 20 kg concentrado / forraje: 12-14 / 10-12                                      Entre 10 y 15 kg concentrado/ forraje: 8-10 / 10-12                                                                                        Menos de 10 kg concentrado / forraje: 4-6 / 8-10CALIDAD DE PASTURA kg de materia seca: REGULAR (más o menos fibrosa). Entre 8-10% de proteína. Entre 40-50% FND                                                                                                                                   PRODUCCIÓN DE LECHE (lts): Más de 20 kg concentrado / forraje: 10-12 / 10-14                                      Entre 10 y 15 kg concentrado/ forraje: 6-8 / 12-14                                                                                          Menos de 10 kg concentrado / forraje: 3-5 / 8-10CALIDAD DE PASTURA kg de materia seca: BUENA (más hoja que tallo).Más 15% de proteína. Menos 40% FNDPRODUCCIÓN DE LECHE (lts): Más de 20 kg concentrado / forraje: 8-10 / 12-14                                       Entre 10 y 15 kg concentrado/ forraje: 4-6 / 12-13                                                                                          Menos de 10 kg concentrado / forraje: 1-3 / 8-10*Para producciones superiores a 25 lts consulte a nuestro asesor pecuario.** FND (Fibra Neutro Detergente).*** Cantidades sujetas a tipos de forrajes, condición de animales y ambiente.ADVERTENCIAS: No almacenar  el alimento en lugares húmedos, calientes, y mal ventilados,hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferenciaestibar sobre tarimas y no dejar el alimento directamente sobre el suelo o en contacto con paredes.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
