	(1399,343,6,'Alimento balanceado para ganado productor de leche.El alimento LECHERO SINALOENSE está diseñado, formulado y elaborado con ingredientesque proporcionan los nutrientes necesarios para la alimentación de ganado bovinoproductor de leche. Mantener en todo momento agua limpia y fresca para su ganado.DOSIS Y VIA DE ADMINISTRACION: Oral. Dependiendo del nivel de producción,la raza, el peso, el ambiente y manejo, así como de los forrajes disponibles, se deberá de ofrecer1 kilo de este alimento por aproximadamente cada 2.5 a 3.5 litros promedio de leche producida.                           \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1400,344,6,'Alimento balanceado para engorda de ganado bovino.MALTACARNE MULTIUSOS  es un alimento diseñado, formulado y elaborado con ingredientes que proveen los nutrimentos necesarios y de fácil digestión para bovinos de engorda.Al iniciar el periodo de engorda deberá de habe runa fase de adaptación en donde se deberá de incluir paulatinamente el alimento MALTACARNE MULTIUSOS y disminuir el forraje de lastre de calidad.Mantener en todo momento agua limpia y fresca para su ganado.DOSIS Y VIA DE ADMINISTRACION: Oral. Ofrecer alimento MALTACARNE MULTIUSOS a libre acceso (el consumo es alrededor de 8 a 10 kilos), mas alrededor de 2 a 3 kilos de forrajes de lastre de calidad.                        \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1401,345,6,'Alimento balanceado medicado con Monensina para Crecimiento de bovinosMALTA CARNE CRECIMIENTO es un alimento diseñado, formulado y elaborado con ingredientes de excelente calidad, que proveen los nutrimentos necesarios y de fácil digestión para bovinos en crecimiento de entre 250 y 350 kg. de peso vivo. Mantener en todo momento agua limpia y fresca para su ganado.DOSIS Y VIA DE ADMINISTRACION: Oral,Ofrecer alimento MALTA CARNE CRECIMIENTO a libre acceso (el consumo es de alrededor de 7 a 8 kilos), más alrededor de 1.5 a 2 kilos de forrajes de lastre de buena calidad. Para alguna formulación especial con este alimento, favor de contactar al Servicio Técnico de maltaCleyton®.ADVERTENCIAS: Suspender el alimento 3 días antes del sacrificio de los animales destinados para el consumo humano. No se administre a equinos.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animalesDé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento y pérdida de propiedades nutrimentales.               USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1402,346,6,'Alimento balanceado medicado para engorda de bovinos en corralMALTA CARNE FASE 1 es un alimento diseñado, formulado y elaborado con ingredientes de buenacalidad, que proveen los nutrimentos necesarios y de fácil digestión para bovinos en engorda de entre 350 y 425 kg de peso vivo. Al iniciar el periodo de engorda deberá de haber una fase de adaptación en donde se deberá deincluir paulatinamente el alimento MALTA CARNE FASE 1 y disminuir el forraje de lastre de buenacalidad. Mantener en todo momento agua limpia y fresca para su ganado.DOSIS Y VIA DE ADMINISTRACION: Oral,Ofrecer alimento MALTA CARNE CRECIMIENTO a libre acceso (el consumo es de alrededor de 9 a 11  kilos), más alrededor de 1.5 a 2.5  kilos de forrajes de lastre de buena calidad. ADVERTENCIAS: Retirar éste alimento 3 días previos al sacrificio de los animales destinados al consumo humano.                    USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1403,347,6,'Alimento balanceado medicado para engorda de bovinos en corralMALTACARNE FASE 2 es un alimento diseñado, formulado y elaborado con ingredientes de excelente calidad, que proveen los nutrimentos necesarios y de fácil digestión para bovinos en engorda de entre 425 y 500 kg de peso vivo.Al iniciar el periodo de engorda deberá de haber una fase de adaptación en donde se deberá deincluir paulatinamente el alimento MALTACARNE FASE 2  y disminuir el forraje de lastre de buenacalidad. Para alguna formulación especial con este alimento, favor de contactar al Servicio Técnico de maltaCleyton®.Mantener en todo momento agua limpia y fresca para su ganado.DOSIS Y VIA DE ADMINISTRACION: Oral. Ofrecer alimento MALT-CARNE FASE 2 a libre acceso (el consumo es de alreddor de 11 a 12 kg), mas alrededor de 2 a 2.5 kilos de forraje de lastre de buena calidad.ADVERTENCIAS: Suspender su uso 3 días antes del sacrificio de los animales para el consumo humano. No se administre a equinos.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animalesDé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento y pérdida de propiedades nutrimentales.             USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1404,348,6,'Alimento balanceado para rumiantes.APIMEL está diseñado, formulado y elaborado con ingredientes de buena calidad, ideal para complementar la alimentación de rumiantes, que principalmente se tienen en condiciones de pastoreo de forrajes de mala a regular calidad, así como alimentados con rastrojos, pajas y otros subproductos agrícolas y agroindustriales y/o complementados también con granos disponibles. Mantener en todo momento agua limpia y fresca para sus vacas. DOSIS Y VIA DE ADMINISTRACION: Oral. Dependiendo de la condición particular, este alimento se ofrecerá a razón del 1 al 3% del peso vivo de animal. Para formulación especial de raciones con el uso de este alimento, favor de contactar con el Servicio Técnico de maltaCleyton®.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
