	(1411,355,6,'MEZCLA ENERGÉTICA (B59) está diseñado, formulado y elaborado con ingredientes de buena calidad, ideal para complementar la alimentación de ganado rumiante ya sea lechero o de carne,  que se tienen en condiciones de estiaje y/o pastoreo de forrajes de mala a regular calidad, así como alimentados con rastrojos, pajas y otros subproductos agrícolas y agroindustriales o complementados también con granos disponibles. Por su contenido nutrimental, es también es apto para complementar raciones en estabulación de acuerdo a los ingredientes disponibles con que se cuente. Aquí es importante contar con el suministro adecuado de fuentes de forrajes de buena calidad. Para alguna formulación especial u otras recomendaciones del uso de este alimento, favor de contactar al Servicio Técnico de maltaCleyton®. Mantener en todo momento agua limpia y fresca para su ganado. CONSEJOS PRÁCTICOS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1412,356,6,'Alimento Balanceado medicado con Zilpaterol para Finalización de Ganado BovinoMEZCLA GANADERA CON ZILPATEROL es un alimento en presentación de pellet, diseñado, formulado y elaborado con ingredientes de buena calidad, que proveen los nutrimentos necesarios y de fácil digestión para ganado bovino en finalización; incluye clorhidrato de zilpaterol, el cual es un promotor no esteroidal que mejora el rendimiento de la canal, reduce la cantidad de grasa, y además mejora la ganancia de peso y la conversión alimenticia.Mantener en todo momento agua limpia y fresca para su ganado.DOSIS Y VIA DE ADMINISTRACION: Durante la finalización, últimos 30 días de la engorda del ganado bovino, ofrecer este alimento  a libre acceso; con la indicación de que para ganado de entre 400 y 500 kilos de peso vivo, el consumo deberá ser de mínimo 9 kilos por cabeza por día, para poder alcanzar la dosis mínima necesaria de zilpaterol, y así se pueda expresar el efecto en el ganado.  Se deberá de agregar un mínimo de fibra de buena calidad de aproximadamente 2 kilos por cabeza por día.Para alguna formulación especial con este alimento, favor de contactar al Servicio Técnico de maltaCleyton®.ADVERTENCIA: Este alimento debe de retirarse 3 días antes del sacrificio del ganado que será destinado a consumo humano.                                        USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1413,357,6,'Alimento balanceado para ganado lechero.El alimento MEZCLA GANADERA LECHERO 16% está diseñado, formulado y elaborado con ingredientes de buena calidad, adecuado para complementar la alimentación de ganado bovino lechero, que principalmente se tiene en condiciones de pastoreo de forrajes de mala a regular calidad, así como alimentados con rastrojos, pajas y otros subproductos agrícolas y agroindustriales y/o complementados también con granos disponibles. Mantener en todo momento agua limpia y fresca para su ganado. DOSIS Y VIA DE ADMINISTRACION: Oral.Ofrecer 3 kg de MEZCLA GANADERA LECHERO 16% por aproximadamente cada litro de leche producida.                        \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
