	(1418,362,6,'Complemento balanceado para alimentación de ganado rumiante.MEZCLA GANADERA está diseñado, formulado y elaborado con ingredientes de buena calidad, ideal para complementar la alimentación de ganado mayor (bovinos) y menor (ovinos y caprinos), que principalmente se tienen en condiciones de pastoreo de forrajes de mala a regular calidad, así como alimentados con rastrojos, pajas y otros subproductos agrícolas y agroindustriales o complementados también con granos disponibles. Mantener en todo momento agua limpia y fresca para su ganado. DOSIS Y VIA DE ADMINISTRACION: Oral. Dependiendo de la condición particular, este alimento se ofrecerá a razón del 1 al 3% del peso vivo de animal.                        \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1419,363,6,'Complemento para alimentación de ganado rumiante.MEZCLA REGIA está diseñado, formulado y elaborado con ingredientes de buena calidad, ideal para complementar la alimentación de ganado rumiante, que principalmente se tienen en condiciones de estiaje y/o pastoreo de forrajes de mala a regular calidad, así como alimentados con rastrojos, pajas y otros subproductos agrícolas y agroindustriales o complementados también con granos disponibles. Mantener en todo momento agua limpia y fresca para su ganado. DOSIS Y VIA DE ADMINISTRACION: Oral. Administrar a libre acceso. Para alguna formulación especial o uso de este alimento, favor de contactar al Servicio Técnico de maltaCleyton®.                       \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1420,364,6,'Alimento balanceado de mantenimiento para de aves 100% de traspatio después de la 4ta semana deedad.MULTI AVES es un alimento diseñado, formulado y elaborado para satisfacer las necesidades de las aves 100%  de traspatio. Después de la cuarta semana de edad.Su presentación en migaja gruesa asegura mayor consumo. Contiene pigmentos naturales. DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, después de la cuarta semana de edad. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventiladoshágalo en sitiossecos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes                        \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1421,365,6,'NUTRIDOR CONEJOS es un alimento balanceado, diseñado, formulado y elaborado para cubrir los requerimientos nutrimentales de conejos en engorda y conejos reproductores en sistemas de producción extensivos. Contiene el balance ideal de energía, grasa, fibra digestible e indigestible, proteína, aminoácidos esenciales, minerales, vitaminas y aditivos, siendo un producto completo de buena calidad que proporcionará a sus conejos un óptimo rendimiento productivo y reproductivo.Indicado para el tratamiento de coccidiosisUSO Y ESPECIES EN LAS QUE SE EMPLEALas necesidades de nutrimentos y de cantidad de alimento para los conejos reproductoresy de engorda, varian según la raza, la edad, la etapa fisiológica, el ritmo reproductivo las condiciones ambientales y el manejo general de la explotación DOSIS Y VIA DE ADMINISTRACION: Oral. CONEJOS EN ENGORDA: Alimentación a libre acceso.HEMBRAS VACÍAS: 100 a 150 gramos al día.HEMBRAS GESTANTES: 125 a 175 gramos al día durante los primeros 20 días de la gestación; y 175 a 250 gramos al día durante los últimos 10 días de la gestación.HEMBRAS LACTANTES: Alimentación a libre acceso.Al final de la lactancia es probable que la hembra junto con su camada puedan consumir más de 500 gramos al día.MACHOS ACTIVOS: 150 a 200 gramos al día, dependiendo de la actividad sexual y de su condición corporal.MACHOS EN REPOSO: 100 a 125 gramos, dependiendo de su condición corporal.Ofrecer a todos los conejos agua desinfectada de buena calidad y siempre a disposición.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios sécos y portegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.  Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.De salida al alimento que tenga mas tiempo en sus bodegas para evitar su envejecimientoEste alimento no deberá ofrecerse 1 día antes del sacrificio de los animales destinados al consumo humano.      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1422,366,6,'Alimento Balanceado Medicado con Febendazol, para Cerdos de los 30 kg. de peso y hasta el peso demercado.NUTRIDOR CERDOS, es un alimento balanceado peletizado, para cerdos desde 30 kg. de peso y hasta que alcancen el peso de mercado. Está elaborado con ingredientes de buena calidad y su formulación provee todos los nutrimentos necesarios, para lograr óptimas ganancias de peso. Proporcionar  NUTRIDOR CERDOS (D64) a libre acceso.  Evitar la contaminación del alimento. Mantener en todo momento agua potable y fresca para los cerdos. CONSEJOS PRÁCTICOS: No almacenar el alimento en lugares húmedos, calientes, y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Este alimento no deberá de ofrecerse 5 días antes del sacrificio de los animales destinados para consumo humano.                \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1423,367,6,'Alimento de mantenimiento multietapas  para  de aves 100 % de traspatio. A partir de la tercerasemana de edadAlimento de mantenimiento  para  de aves 100 % de traspatio. NUTRIDOR GALLINAS es un alimento diseñado, formulado y elaborado para satisfacer las necesidades de las aves 100 %  de traspatio, a partir de la tercera semana de edadSu presentación en migaja gruesa  asegura mayor consumo. Contiene pigmentos naturales. ADVERTENCIA: Por su perfil nutricional este producto no debe usarse para la engorda  de pollo ni para la producción de huevo.                         \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1424,368,6,'NUTRIDOR POLLOS es un alimento diseñado, formulado y elaborado como complemento  para satisfacer las necesidades de los  pollos de engorda de traspatio. Su presentación en migaja gruesa  asegura mayor consumo, y menos desperdicio.ADVERTENCIA: Por su perfil nutricional este producto  debe usarse como complemento  para la engorda  de pollo de traspatio.                             \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1425,369,6,'Alimento balanceado medicado con monensina para vacas lecheras de alta producción indicado para la prevención de la coccidiosis causada por Eimeria bovis y E. zoemii, y prevención de problemas de cetosis. Bajo la prescripción y supervisión del Médico Veterinario.Se distribuye para las vacas altas productoras encima de una dieta (forrajes mas alimento) que permite producir 23 litros de leche.USO Y ESPECIES EN LAS QUE SE EMPLEA: Bovinos. Vacas lecheras de alta producción.DOSIS Y VIA DE ADMINISTRACION: Oral. Ofrecer 1 kg de alimento por cada 3.5 litros de leche producida, arriba de 23 litros. Se puede utilizar también revuelto con granos (60% de Nutris Alto más 40% de grano) para reconstruir alimento balanceado de alrededor de 18% de proteína. Esta mezcla se distribuye: Para vacas que producen entre 10 y 18 litros/día, ofrecer ½ kg por cada 1  1/2 litros de leche producida, más forrajes de calidad. Para vacas que producen entre 18 y 22 litros/día, ofrecer ½ kg por cada 1 litro de leche producida, más forrajes de calidad.Para vacas que producen más de 22 litros/día, ofrecer todo el alimento que puedan consumir, más forrajes de calidad. Para mayor información del alimento, favor de contactar con el Servicio Técnico de maltaCleyton®.    Mantener en todo momento agua limpia y fresca para las vacas.ADVERTENCIAS: Mantenga siempre agua limpia y fresca disponible en la crianza. Ofrezca el alimentodiariamente y no permita que consuman alimento del día anterior o alimento en mal estado. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que absorba humedad. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que  tenga más tiempo en sus bodegas para evitar su envejecimiento.  Suspender el consumo 3 días antes del sacrificio de animales para consumo humano. No se administre a Equinos.           USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1426,370,6,'Alimento balanceado medicado con monensina; indicado para la prevención de la coccidiosis causada por Eimeria bovis y E. zoemii; mejora la producción de leche; y en animales con problemas de cetosis. Alimento diseñado, formulado y elaborado con ingredientes que proveen los nutrientes necesarios para vacas lecheras en producción.USO Y ESPECIES EN LAS QUE SE EMPLEA: Bovinos. Vacas lecheras en producción.DOSIS Y VIA DE ADMINISTRACION: Oral. Se utiliza para vacas que producen más de 23 litros/día. Ofrecer entre 6 y 10 kg, dependiendo del nivel de producción y del forraje consumido. Se deben de suministrar forrajes de buena calidad, que nos aporta fibra necesaria para una buena digestión. Para mayor información del uso del alimento, favor de contactar con el Servicio Técnico de maltaCleyton®. Mantener en todo momento agua limpia y fresca para las vacas.ADVERTENCIAS: Mantenga siempre agua limpia y fresca disponible en la crianza. Ofrezca el alimento diariamente y no permita que consuman alimento del día anterior o alimento en mal estado. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que absorba humedad. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento. Suspender el consumo 3 días antes del sacrificio de animales para consumo humano. No se administre a Equinos.                USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1427,371,6,'Alimento balanceado medicado con monensina para vacas lecheras en periodo seco; indicado para la prevención de la coccidiosis causada por Eimeria bovis y E. zoemii, y prevención de problemas de cetosis.USO Y ESPECIES EN LAS QUE SE EMPLEA: Bovinos. Vacas lecheras en periodo seco.DOSIS Y VIA DE ADMINISTRACION: Oral. La cantidad a ofrecer de este alimento depende además de otros factores, de las condiciones corporales y de salud de la vaca. Usar a razón de 2 a 3 kg por vaca al día. Para mayor información del uso del alimento, favor de contactar con el Servicio Técnico de maltaCleyton®.  Mantener en todo momento agua limpia y fresca para las vacas.ADVERTENCIAS: Mantenga siempre agua limpia y fresca disponible en la crianza. Ofrezca el alimentodiariamente y no permita que consuman alimento del día anterior o alimento en mal estado. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que absorba humedad. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento. Suspender el consumo 3 días antes del sacrificio de animales para consumo humano. No se administre a Equinos.                  USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1428,372,6,'Alimento balanceado de desarrollo para la engorda de pavos. Pavo Desarrollo es un alimento completo, diseñado, formulado y elaborado para la engorda de los pavos desde la 6ta semana hasta la 10ma semana de edad; no requiere la adición de ningún grano ni mineral.Proporcione Pavo Desarrollo a los pavitos hasta que cumplan 10 semanas de edad. Cuando lospavitos cumplan 10 semanas, cambie gradualmente el alimento a Pavo Engorda. Para obtener óptimos resultados, se sugiere utilizar el programa completo de alimentación para Pavos, haciendo el cambio de alimento en forma gradual.PRODUCTO: Pavo Inicio. RECOMENDACIÓN: Desde el nacimiento hasta 35 días de edad.PRODUCTO: Pavo Desarrollo. RECOMENDACIÓN: 6 a 10 semanas de edad.PRODUCTO: Pavo Engorda. RECOMENDACIÓN: 11 semanas de edad hasta el mercado DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, desde la 6ª semana hasta la 10ª semana de edad. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.               \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1429,373,6,'Alimento balanceado medicado de finalización para la engorda de pavos.Pavo Engorda es un alimento completo, diseñado, formulado y elaborado para la engorda de los pavos desde las 11 semanas hasta el mercado; no requiere la adición de ningún grano ni mineral.Proporcione Pavo Engorda a los pavitos hasta que alcancen su peso al mercado.  Para obtener óptimos resultados, se sugiere utilizar el programa completo de alimentación para Pavos, haciendo el cambio de alimento en forma gradual.PRODUCTO: Pavo Inicio. RECOMENDACIÓN: Desde el nacimiento hasta 35 días de edad.PRODUCTO: Pavo Desarrollo. RECOMENDACIÓN: 6 a 10 semanas de edad.PRODUCTO: Pavo Engorda. RECOMENDACIÓN: 11 semanas de edad hasta el mercado DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, desde las 11 semanas hasta que alcancen su peso al mercado. ADVERTENCIAS: Suspender el alimento 5 días antes del sacrificio de los animales destinados para el consumo humano. No administrar en aves de postura, productora de huevo para plato destinado para consumo humano.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.              \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1430,374,6,'Alimento balanceado medicado de iniciación para la engorda de pavos.Pavo Inicio es un alimento completo, diseñado, formulado y elaborado para la engorda de los pavos desde el nacimiento hasta los 35 días; no requiere la adición de ningún grano ni mineral.Proporcione Pavo Inicio a los pavitos hasta que cumplan 35 días de edad. Cuando los pavitos cumplan 6 semanas, cambie gradualmente el alimento a Pavo Desarrollo. Para obtener óptimos resultados, se sugiere utilizar el programa completo de alimentación paraPavos, haciendo el cambio de alimento en forma gradual.PRODUCTO: Pavo Inicio. RECOMENDACIÓN: Desde el nacimiento hasta 35 días de edad.PRODUCTO: Pavo Desarrollo. RECOMENDACIÓN: 6 a 10 semanas de edad.PRODUCTO: Pavo Engorda. RECOMENDACIÓN: 11 semanas de edad hasta el mercado DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, desde el nacimiento hasta los 35 días.  ADVERTENCIAS: Retirar 15 días previos al sacrificio de los animales destinados al consumo humano.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1431,375,6,'Alimento balanceado medicado de iniciación para la engorda de pavos.PAVO PREMIUM 1 es un alimento completo, diseñado, formulado y elaborado para la engorda de los pavos desde el nacimiento hasta los 28 días; no requiere la adición de ningún grano ni mineral.Proporcione PAVO PREMIUM 1 a los pavitos hasta que cumplan 28 días de edad. Cuando los pavitos cumplan 5 semanas, cambie gradualmente el alimento a PAVO PREMIUM 2. Para obtener óptimos resultados, se sugiere utilizar el programa completo de alimentación paraPavos, haciendo el cambio de alimento en forma gradual. PRODUCTO: Pavo Premium 1. RECOMENDACIÓN: Desde el nacimiento hasta 28 días de edad.PRODUCTO: Pavo Premium 2. RECOMENDACIÓN: 5 a 8 semanas de edad.PRODUCTO: Pavo Premium 3. RECOMENDACIÓN: 9 a 12 semanas de edad.PRODUCTO: Pavo Premium 4. RECOMENDACIÓN: 13 a 16 semanas de edad.PRODUCTO: Pavo Premium 5. RECOMENDACIÓN: 17 semanas hasta la salida al mercado. DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, desde el nacimiento hasta los 28 días de edad. ADVERTENCIAS: Suspender el alimento 5 días antes del sacrificio de los animales destinados para el consumo humano. No administrar en aves de postura, productora de huevo para plato destinado para consumo humano. No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.           \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1432,376,6,'Alimento balanceado medicado para la engorda de pavos de la semana 5 a la semana 8 de edad.Pavo Premium 2 es un alimento completo, diseñado, formulado y elaborado para la engorda de los pavos a partir de la semana 5 a la semana 8 de edad; no requiere la adición de ningún grano ni mineral.Proporcione Pavo premium 2 a los pavitos hasta que cumplan 8 semanas de edad. Cuando los pavitos cumplan 9 semanas, cambie gradualmente el alimento a Pavo Premium 3. Para obtener óptimos resultados, se sugiere utilizar el programa completo de alimentación para Pavos, haciendo el cambio de alimento en forma gradual.PRODUCTO: Pavo Premium 1. RECOMENDACIÓN: Desde el nacimiento hasta 28 días de edad.PRODUCTO: Pavo Premium 2. RECOMENDACIÓN: 5 a 8 semanas de edad.PRODUCTO: Pavo Premium 3. RECOMENDACIÓN: 9 a 12 semanas de edad.PRODUCTO: Pavo Premium 4. RECOMENDACIÓN: 13 a 16 semanas de edad.PRODUCTO: Pavo Premium 5. RECOMENDACIÓN: 17 semanas hasta la salida al mercado. DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, a partir de la semana 5 a la semana 8 de edad. ADVERTENCIAS: Suspender el alimento 5 días antes del sacrificio de los animales destinados para el consumo humano. No administrar en aves de postura, productora de huevo para plato destinado para consumo humano.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.          \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1433,377,6,'Alimento balanceado medicado para la engorda de pavos de la semana 9 a la semana 12 de edad.Pavo Premium  3 es un alimento completo, diseñado, formulado y elaborado para la engorda de los pavos a partir de la semana 9 a la semana 12 de edad; no requiere la adición de ningún grano ni mineral.Proporcione Pavo Premium 3 a los pavitos hasta que cumplan 12 semanas de edad. Cuando los pavitos cumplan 13 semanas, cambie gradualmente el alimento a Pavo Premium 4.Para obtener óptimos resultados, se sugiere utilizar el programa completo de alimentación para Pavos, haciendo el cambio de alimento en forma gradual. PRODUCTO: Pavo Premium 1. RECOMENDACIÓN: Desde el nacimiento hasta 28 días de edad.PRODUCTO: Pavo Premium 2. RECOMENDACIÓN: 5 a 8 semanas de edad.PRODUCTO: Pavo Premium 3. RECOMENDACIÓN: 9 a 12 semanas de edad.PRODUCTO: Pavo Premium 4. RECOMENDACIÓN: 13 a 16 semanas de edad.PRODUCTO: Pavo Premium 5. RECOMENDACIÓN: 17 semanas hasta la salida al mercado. DOSIS Y VIA DE ADMINISTRACION: a libre acceso, desde la semana 9 a la semana 12 de edad. ADVERTENCIAS: Suspender el alimento 5 días antes del sacrificio de los animales destinados para el consumo humano. No administrar en aves de postura, productora de huevo para plato destinado para consumo humano. No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.            \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1434,378,6,'PELL ROL ALFALFA , son pellets que contienen alfalfa de la mejor calidad , la cual ha sido deshidratada   molida  y finalmente pelletizada , para poder administrarse como complemento de la dieta de forraje del caballo , sobre todo cuando el heno no es de buena calidad o bien cuando se busca mejorar su nivel proteico . La alfalfa tiene un alto contenido de vitaminas , minerales,y lisina , siendo rica en calcio y vitamina A, D y E. , se recomienda usar Pell rol Alfalfa para subir los niveles de proteínas en la dieta del caballo encaballo en desarrollo o de yeguas en periodo de crianza ( lactación ) , de igual modo se sugiere establecer una vigilancia permanente ya que los excesos de proteína deben controlarse y estos pueden  manifiestarse  como crecimientos  acelerados en animales jóvenes y una alta producción de leche en la yegua. Pell rol Alfalfa  es un alimento ideal para caballos, pues está elaborado con Alfalfa seleccionada por su alta calidad y  por su alto contenido de carotenoides naturales que tienen diferentes funciones, tales como ser precursores de vitamina A necesaria para la óptima  visión.Los carotenoides también previenen de radicales libres que provocan cáncer ,  así como también contiene  altos niveles  minerales que el organismo del animal requiere para mantenerse en las excelentes condiciones. Por su presentación en pellets concentra lo más nutritivo de la Alfalfa,  permite un mayor control de su consumo, y reduce la aparición de polvo. DOSIS Y VIA DE ADMINISTRACION: OralPell rol Alfalfa puede ser utilizada como complemento del forraje en la alimentación de los caballos,pudiendo reemplazar una parte de este, indicandose hasta el  0,5% del peso vivo del animal por dia.Ejemplo: Un caballo de 500Kgs. puede comer hasta 2.50 Kg. de pellet de Alfalfa por día.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.        \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1435,379,6,'Alimento de alta energía creado especialmente para caballos que desempeñan actividades con esfuerzo físico intenso, tales como las carreras, salto, polo y charrería, ya que les aporta un mayor nivel energético para un óptimo rendimiento atlético. Es también recomendable su utilización en animales gestantes ó en lactación, debido a las fuertes demandas de energía que dichas etapas establecen. DOSIS Y VIA DE ADMINISTRACION: Oral.Para el mejor desempeño de su caballo, a continuación se detallan las cantidades de PELL ROL CUARTO DE MILLA a ofrecerse en su dieta diaria, para un caballo de entre 400  500 kg. de peso , y  la cantidad indicada deberá dividirse en al menos dos raciones diarias.No debe faltar agua potable, limpia y fresca siempre al alcance de los animales.Tipo de Actividad: Caballos con trabajo ligero    Kg. de Cuarto de Milla: 4.5 - 5.5Tipo de Actividad: Caballos con trabajo moderado    Kg. de Cuarto de Milla: 5.3 - 6.5Tipo de Actividad: Caballos con trabajo intenso    Kg. de Cuarto de Milla: 7.3 - 8.6Tipo de Actividad: Yeguas gestantes    Kg. de Cuarto de Milla: 4.0 - 5.0Tipo de Actividad: Yeguas lactantes primeros 3 meses    Kg. de Cuarto de Milla: 6.0 - 7.4Tipo de Actividad: Yeguas lactantes de 3 - 6 meses    Kg. de Cuarto de Milla: 5.2 - 6.3Tipo de Actividad: Sementales    Kg. de Cuarto de Milla: 4.5 - 5.0Tipo de Actividad: Caballos en descanso    Kg. de Cuarto de Milla: 3.5 - 4.3 ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.        \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1436,380,6,'Es un alimento ideal con cereal seleccionado a base de avena que alcanza una concentración de energía ideal para caballos, junto con las propiedades de proteína y calidad de almidones de alta y rápida disponibilidad.La avena es el cereal que cuenta con almidones de mayor digestibilidad y un valor biológico de la proteína superior, así mismo su alta gustocidad lo hace un cereal único para caballos, y por ende con mayor palatabilidad; es rico en fibra y proteína.Proceso de Pell-Rol Avena Plus.La avena recibe un estricto control de calidad en donde se determina su adecuado peso específico y bajo nivel de semillas contaminantes, además de otros parámetros de calidad como nivel mínimo de proteína y porcentaje de semillas dañadas. Una vez aceptados por control de calidad, reciben un proceso de cribado eliminación de semillas y material extraño, contaminantes, previos al proceso de rolado.Posteriormente la avena recibe un proceso de pre cocido y rolado a vapor con temperaturas de poco más de 90°C con lo cual se logra que los almidones se gelatinicen y de esta forma puedan ser fácilmente desdoblados por las enzimas digestivas del caballo. Con  este proceso de pre cocido y rolado Pell-Rol Avena Plus se transforma en un alimento de alta digestibilidad ya que con el proceso logran incrementos de un 10% de aprovechamiento.DOSIS Y VIA DE ADMINISTRACION: Oral.Pell-Rol Sprinter Avena puede ser utilizado como alimento base de la siguiente forma.Recomendaciones para caballos con peso vivo promedio de 500Kg.Yeguas Gestantes: Actividad Moderada 4Kg. Actividad Intensa 6Kg.Caballos de Paseo: Actividad Moderada 5Kg. Actividad Intensa 7Kg.Potros Añales: Actividad Moderada 4Kg. Actividad Intensa 4Kg.Caballos con trabajo ligero a moderado: Actividad Moderada 5.5Kg. Actividad Intensa 7Kg. Para caballos con actividad intensa se recomienda la alimentación en pocas cantidades el mayor número de veces hasta cubrir los Kg. De su dieta.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágaloen sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1437,381,6,'Alimento para caballos elaborado con los más selectos ingredientes y  enriquecidos con vitaminas y minerales para que el animal se mantenga en óptimas condiciones, la presentación de PELL ROL CLÁSICO (comprimidos / pellets y grano rolado mezclados) ofrece ventajas como mayor digestibilidad y palatabilidad, ya que los granos son sometidos a un cocimiento antes de ser rolados, lo cual aumenta su valor nutritivo.USO Y ESPECIES EN LAS QUE SE EMPLEA:Suministre PEL - ROL CLÁSICO desde los 12 meses de edad poco a poco, además de la alfalfa o pastos que consumen en la pradera.Caballos de Charrería, Caballos de Carrera,  Polo, Salto, etc., se recomienda dar la ración repartida durante el día.DOSIS Y VIA DE ADMINISTRACIÓN:OralCaballos de Charrería: reparta  PELL  ROL CLÁSICO en las 2 raciones del día: por la mañana de 1.5 kg a 2 kg y doce horas después por la tarde de 1 a 1.5 kg.Caballos de Carrera, Polo, Salto etc. Se recomienda dar la ración repartida durante el día.1° Ración de 1.5 a 2.0 kg de PELL  ROL CLÁSICO cuatro horas antes del entrenamiento o después de este siempre y cuando el animal se encuentre en reposo o sin fatiga.2°Ración al medio día suministre de ½ kilo a 1.0 kilo de PELL ROL CLÁSICO.3° Ración al final de la tarde dar una porción de 1.0 a 1.5 kg dependiendo del trabajo y talla del animal.Hembras en Gestación: Durante los primeros 8 meses suministre de 2 a 3 kilos diarios  repartidos en 2 raciones (mañana y tarde).Hembras Lactantes: Aumentar la ración diaria a 4 ó 6 kg. de PELL - ROL CLÁSICO junto con el forraje , es preferible ofrecer agua en todo momento para facilitar la digestión. Para desarrollar mejores caballos suministre antes del destete y desde los 15 días de edad  ROYAL HORSE B-300. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágaloen sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nuncadejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a susbodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempoen sus bodegas para evitar su envejecimiento.      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1438,382,6,'Alimento para caballos elaborado con los más selectos ingredientes y  enriquecidos con vitaminas y minerales para que el animal se mantenga en óptimas condiciones, la presentación de PELL ROL CLÁSICO (comprimidos / pellets y grano rolado mezclados) ofrece ventajas como mayor digestibilidad y palatabilidad, ya que los granos son sometidos a un cocimiento antes de ser rolados, lo cual aumenta su valor nutritivo.USO Y ESPECIES EN LAS QUE SE EMPLEA:Suministre PEL - ROL CLÁSICO desde los 12 meses de edad poco a poco, además de la alfalfa o pastos que consumen en la pradera.Caballos de Charrería, Caballos de Carrera,  Polo, Salto, etc., se recomienda dar la ración repartida durante el día.DOSIS Y VIA DE ADMINISTRACIÓN:OralCaballos de Charrería: reparta  PELL  ROL CLÁSICO en las 2 raciones del día: por la mañana de 1.5 kg a 2 kg y doce horas después por la tarde de 1 a 1.5 kg.Caballos de Carrera, Polo, Salto etc. Se recomienda dar la ración repartida durante el día.1° Ración de 1.5 a 2.0 kg de PELL  ROL CLÁSICO cuatro horas antes del entrenamiento o después de este siempre y cuando el animal se encuentre en reposo o sin fatiga.2°Ración al medio día suministre de ½ kilo a 1.0 kilo de PELL ROL CLÁSICO.3° Ración al final de la tarde dar una porción de 1.0 a 1.5 kg dependiendo del trabajo y talla del animal.Hembras en Gestación: Durante los primeros 8 meses suministre de 2 a 3 kilos diarios  repartidos en 2 raciones (mañana y tarde).Hembras Lactantes: Aumentar la ración diaria a 4 ó 6 kg. de PELL - ROL CLÁSICO junto con el forraje , es preferible ofrecer agua en todo momento para facilitar la digestión. Para desarrollar mejores caballos suministre antes del destete y desde los 15 días de edad  ROYAL HORSE B-300. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágaloen sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nuncadejar el alimento directamente sobre el suelo y/o en contacto con paredes. Evite el acceso a susbodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempoen sus bodegas para evitar su envejecimiento.      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1439,383,6,'Alimento balanceado de alta energía para caballos de alto rendimiento.PELL-ROL SPRINTER es un alimento de alta energía creado especialmente para caballos que desempeñan actividades con esfuerzo físico intenso, tales como las carreras, salto, polo y charrería, ya que les aporta unmayor nivel energético para un óptimo rendimiento atlético. Es también recomendable su utilización en animales gestantes ó en lactación, debido a las fuertes demandas de energía que dichas etapas establecen.PELL-ROL SPRINTER está elaborado a base de avena,cebada y maíz precocidos y rolados, lo que permite aumentar su digestibilidad en cerca de un 10%, que aunado a su alto valor energético originado por la proporciónde cereales que posee, asi como por la adición de melaza, aceites y pastas de oleaginosas, PELL-ROLL SPRINTERes el alimento ideal para caballos deportivos de recría.DOSIS Y VIA DE ADMINISTRACION: Oral.RECOMENDACIONES DE USOTipo de actividad./Kg de PELL-ROL SPRINTERCaballos con trabajo ligero de 4.5a5.5 kgCaballos con trabajo moderado de 5.3 a 6.5 kg.Caballos con trabajo intenso de 7.3 a 8.6 kgYeguas gestantes de 4 a 5 kg.Yeguas lactantes primeros 3 meses de 6 a 7.4 kg.Yeguas lactantes  de 3-6 meses de 5.2 a 6.3 kg.Sementales de 4.5 a 5 kgCaballos en descanso de 3.5 a 4.3 kgLa cantidad de alimento arriba mencionada es para caballos entre 400-500 kg de peso corporal, por lo que deberá ajustarse según el peso de cada caballo, asi como por la cantidad de trabajo que desempeño.Dividir su raciòn diria en 2,3  o màs comidas al día, asegurese de la continua disponibilidad de agua y forraje(heno alfalfa o avena).Alimente siempre por kg de alimento y nunca por volumen del mismo.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.    \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1440,384,6,'Alimento balanceado para caballos e hipódromo y carril.PELL-ROL TURBO es un alimento balanceado para caballos de carreras en hipódromo y carril, potros que inicien su programa de entrenamiento, caballos de salto, polo y rejoneo. Por su contenido de proteína de primera calidad, mantiene la condición corporal (potencia muscular).La adición de aceite vegetal provee al producto energía de rápida disponibilidad, muy necesaria en carreras de alta velocidad y/o resistencia (carreras parejeras, caballos de polo, salto y en largas distancias de pura sangre).Por su contenido de CALF MANNA®, aporta los minerales orgánicos que se fijan eficientemente en los sitios requeridos (articulaciones, vainas tendinosas, cascos, cartílagos articulares).Permite un menor volumen de grano en el aparato digestivo gracias a la digestibilidad de sus ingredientes. En potros al inicio del entrenamiento permite que estos continúen desarrollándose adecuadamente sin disminuir la intensidad de su trabajo. DOSIS Y VIA DE ADMINISTRACION: Oral. Recomendaciones de uso:Peso del caballo (kg): 400 PELL-ROL TURBO (kg /día): 4.0  5.0* Forraje (kg / día): 4.0  5.0Peso del caballo (kg): 450 PELL-ROL TURBO (kg /día): 5.0  5.5 Forraje (kg / día): 5.5  6.0Peso del caballo (kg): 500 PELL-ROL TURBO (kg /día): 5.5  6.0 Forraje (kg / día): 6.0  6.5* La cantidad de PELL-ROL TURBO arriba indicada, deberá proporcionarse dividida en un mínimo de 2 raciones diarias. Recuerde que el caballo debe ser alimentado de manera individual: que responde a su propio temperamento, hábitos y horarios de actividad; y que debe tenerse en cuenta que el forraje debe integrar al menos el 50% de su ración. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágaloen sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1441,385,6,'Alimento balanceado para caballos de Alto Desempeño, elaborado con los más selectos ingredientes, enriquecido con vitaminas y minerales para que el equino se mantenga en óptimas condiciones.Su presentación (comprimidos pequeños y granos rolados mezclados) y un nuevo pellet de pulpa de remolacha, ofrece cualidades , como mayor aprovechamiento y aumento de la palatabilidad , ya que los granos son sometidos a un cocimiento antes de ser rolados , lo cual aumenta su valor nutritivo. DOSIS Y VIA DE ADMINISTRACION: Oral.Suministre Pell rol Vital desde los 12 meses de edad, además del forraje . Caballos de Charrería: Reparta Pell rol Vital en 2 dosis; por la mañana de 1.5 a 2 kg. Y doce horas después, por la tarde de 1.0 a 1.5 kg.Caballos de Carreras, Polo , Salto , etc. Se recomienda dar la ración diaria repartida en 3 dosis:1ª. Dosis de 1.5 a 2 kg cuatro horas ántes o después del entrenamiento, siempre y cuando el caballo se encuentre en reposo o sin fatiga.2ª. Dosis al medio día suministre ½ a 1.0 kg.3ª. Dosis al final de la tarde dar una porción de 1.0 a 1.5 kg. Dependiendo del trabajo y talla del equino.Hembras en gestación: durante los primeros 8 meses suministre de 2.0 a 3.0 kg. diarios, repartidos en 2 dosis ( mañana y tarde ).Hembras lactantes: aumentar la ración diaria a 4.0 a 6.0 kg de Pell rol Vital.  Se recomienda de 15 a 25 litros de agua tibia al día para evitar cólicos. Es conveniente dar primero el forraje, después el agua y por último Pell rol Vital. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.        \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1442,386,6,'Como coadyuvant en la función hepática y metabolismo de los lípidos en aves de postura.DOSIS: Aves de postura 100g/Ton de laimento balanceadoADVERTENCIAS: Evítese el contacto directo con piel y ojos utilizando guantes, lentes mascarillas, botas y ropa de protección. Almacenarse en un lugar protegico, freco,seco y ventilado.                              USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1443,387,6,'Alimento balanceado medicado para pollitos de engorda durante los primeros 21 días de edad.POLLITO ESPECIAL alimento completo para pollos de engorda a partir de 1 a 21 días de edad, que satisface las necesidades nutricionales de las aves en explotaciones de tipo familiar. Aporta los requerimientos de aminoácidos y energía necesarios para que el pollito crezca sano hasta la etapa de engorda.Mantenga una temperatura constante 33 °C la primera semana de vida, suministre agua limpia y alimento a libertad. Programa de alimentación: Para óptimo resultado se sugiere utilizar el programa completo de alimentación para pollo de engorda, haciendo el cambio de alimento en forma gradual.PRODUCTO: Pollito Especial. RECOMENDACIÓN: 1 a 21 días de edad.PRODUCTO: Pollo Especial. RECOMENDACIÓN: 22 días de vida hasta salida al mercado. DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, durante los primeros 21 días de edad. ADVERTENCIAS: Suspender el alimento 3 días antes del sacrificio de los animales destinados para el consumo humano. No se administre a equinos.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.               \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
