	(1467,411,6,'Alimento balanceado medicado para pollos de engorda desde el día 36 de edad hasta el mercadoPOLLO FINALIZADOR es un alimento completo, tiene 19% de proteína, la cantidad de energía y los factores naturales de pigmentación que requieren los pollos para su finalización. En programas con alimentación restringida y ciclo de engorda mayor a 49 días, se proporciona del día 36 de edad hasta su salida al mercado. En zonas con ciclos menores a 42 días proporcionar a partir de los 29 días hasta el  mercado.  DOSIS Y VÍA DE ADMINISTRACIÓN: A libre acceso vía oral, desde el día 36 de edad hasta su salida al mercado.ADVERTENCIAS: Suspender el alimento 3 dias antes del sacrificio de los animales destinados para el consumo humano. No se administre a equinos. No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores insectos y otros animales. De preferencia estbar sobre tarimas y no dejar el alimento directamente sobre el suelo o en contacto con las paredes.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
