	(1479,423,6,'Alimento balanceado medicado para pollos de engorda para los dos últimos días antes del sacrificio.POLLO ORO DEPÓSITO 10 % es un alimento diseñado, formulado y elaborado para satisfacer las necesidades de los pollos de engorda que llegan a los depósitos y permanecen dos días en este lugar. Su presentación en migaja gruesa asegura mayor consumo, logrando nivelar la merma de  peso durante el viaje al depósito. DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, para los 2 últimos días antes del sacrificio. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.No requiere tiempo de retiro. No debe de usarse en patos, gansos y palomas. No agregar o mezclar con otras drogas u otro antibiótico. No usarse en rumiantes.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
