	(1481,425,6,'Alimento balanceado medicado para pollos de engorda para los cinco últimos días antes deldel sacrificio.Pollo Rendidor  está especialmente balanceado para alimentar al pollo de engorda 5 días antes del sacrificio, ya que su perfil nutricional permite ganar peso durante su estancia en el expendio. Su presentación en Pellet  asegura mayor consumo y mejor conversión alimenticiaDOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, durante los 5 días previos al sacrificio.ADVERTENCIAS: No suministrar este producto por un espacio mayor a 5 días, debido a que se pueden  presentar problemas de coccidiosis y baja de pigmentación.                           \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1482,426,6,'Alimento balanceado medicado para pollitas de postura de 7 a 12 semanas de edad.POLLORINA No. 1  PLUS Alimento balanceado medicado para pollitas de postura de 7 a 12 semanas de edad. Es un alimento completo científicamente balanceado para satisfacer todos los requerimientos nutritivos de las pollas en crecimiento. Mantenga una temperatura constante 20 °C, suministre agua limpia y alimento a libertad. DOSIS Y VIA DE ADMINISTRACION: a libertad vía oral, desde 7 hasta 12 semanas de edad. ADVERTENCIAS: Suspender el alimento 3 días antes del sacrificio de los animales destinados para el consumo humano. No se administre a equinos. No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1483,427,6,'Alimento balanceado medicado para pollitas de postura de 7 a 12 semanas de edad.POLLORINA No. 1  PLUS Alimento balanceado medicado para pollitas de postura de 7 a 12 semanas de edad. Es un alimento completo científicamente balanceado para satisfacer todos los requerimientos nutritivos de las pollas en crecimiento. Mantenga una temperatura constante 20 °C, suministre agua limpia y alimento a libertad. DOSIS Y VIA DE ADMINISTRACION: a libertad vía oral, desde 7 hasta 12 semanas de edad. ADVERTENCIAS: Suspender el tratamiento 5 días antes del sacrificio de los animales destinados para el consumo humano. No administrar en aves de postura, productora de huevo para plato destinado para consumo humano.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1484,428,6,'Alimento balanceado medicado para pollitas de postura de 7 a 12 semanas de edad.POLLORINA No. 1  PLUS Alimento balanceado medicado para pollitas de postura de 7 a 12 semanas de edad. Es un alimento completo científicamente balanceado para satisfacer todos los requerimientos nutritivos de las pollas en crecimiento. Mantenga una temperatura constante 20 °C, suministre agua limpia y alimento a libertad. DOSIS Y VIA DE ADMINISTRACION: a libertad vía oral, desde 7 hasta 12 semanas de edad. ADVERTENCIAS: Suspender el tratamiento 4 días antes del sacrificio de los animales destinados para el consumo humano. No debe utilizarse como tratamiento curativo. No debe ser administrado a aves de postura.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1485,429,6,'Alimento balanceado medicado para pollitas de postura de 13 semanas de edad a primer huevo. Es un alimento completo científicamente balanceado para satisfacer todos los requerimientos nutritivos de las pollas en desarrollo.Su presentación en migaja asegura mayor consumo, logrando mejores pesos, logrando mejores uniformidades en la  parvada.Minimiza los riesgos de presencia de factores antinutricionales o tóxicos durante esta etapa.Mantenga una temperatura constante 20 °C,  suministre agua limpia y alimento a libertad. DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, de 13 semanas de edad a primer huevo. ADVERTENCIAS: No requiere tiempo de retiro.No debe de usarse en patos, gansos y palomas.No agregar o mezclar con otras drogas u otro antibiótico.No usarse en rumiantes.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                  \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1486,430,6,'Alimento balanceado medicado para pollos de engorda de los 22 días de edad al mercado.POLLOS ENGORDA es un alimento completo para pollos en engorda, que contiene nutrientes para satisfacer las necesidades del pollo  de engorda en explotaciones de tipo familiar. Este alimento está diseñado para pollos desde los 22 días de edad al mercado, aportando los requerimientos  de aminoácidos y energía necesarios para que el pollo crezca sano hasta la etapa de engorda y finalización.  DOSIS Y VÍA DE ADMINISTRACIÓN: A libre acceso vía oral, desde el día 22 de edad hasta su salida al mercado.ADVERTENCIAS: Suspender el alimento 3 dias antes del sacrificio de los animales destinados para el consumo humano. No se administre a equinos. No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
