	(1502,446,6,'PREINICIO 1 es un alimento balanceado preiniciador para lechones de 7 a 42 días de edad. Tiene una presentación en pellet que ayuda al lechón a consumirlo adecuadamente en esta etapa y tener una mejor adaptación, evitando problemas digestivos y así aprovechas todos los nutrimentos que su formulación ofrece.PREINICIO 1, está formulado y elaborado con proteínas de primera calidad, granos de cereales y oleaginosas procesados, que proporcionan los nutrimentos esenciales con alta biodisponibilidad para un rápido y eficiente inicio del crecimiento de los lechones. Evitar la contaminación del alimento.Mantener en todo momento agua potable y fresca (ni muy caliente, ni muy fría) para los lechones. DOSIS Y VIA DE ADMINISTRACION: Oral a libre acceso, aplicando la regla de poco y frecuentemente. ADVERTENCIAS: No almacenar el alimento cerca de productos tóxicos, ni en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar de preferencia sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                 \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1503,447,6,'Alimento balanceado medicado para pollitos de engorda para los primeros siete días de edad. Minimiza los riesgos de presencia de factores antinutricionales o tóxicos durante esta etapa.Mantenga una temperatura constante 32 °C la primera semana de vida,  suministre agua limpia y alimento a libertad. DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral,para los primeros siete días de edad ADVERTENCIAS: Suspender el alimento 3 días antes del sacrificio de los animales destinados para el consumo humano.No se administre a equinos.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
