	(1511,455,6,'Alimento balanceado medicado para cerdos reproductores  (gestación,  lactancia y sementales). DOSIS Y VIA DE ADMINISTRACION: Hembras gestantes primerizas: Ofrecer de 2 a 2.5 kg/día de acuerdo a la condición corporal.Hembras gestantes adultas: Ofrecer de 2 a 3.5 kg/día de acuerdo a la condición corporal de la cerda, número de parto y tercio de gestación. Una sobrealimentación provocará menor consumo de alimento en la lactancia y disminución en la producción de leche. Hembras lactantes: La cantidad de alimento depende del peso, de las condiciones ambientales y del número de lechones que esté amamantando. Al momento del parto no ofrecer alimento, durante el primer día ofrecer aproximadamente 1/2 kg;  después y hasta el día 5 incrementar 1/2 kg más al día, posteriormente la alimentación será a libre acceso. Para favorecer el consumo se recomienda alimentar mínimo 2 veces al día (una en la mañana y otra en la tarde). Al momento del destete, la cantidad de alimento ofrecido se reduce a 2-2.5 kg durante dos o tres días, posteriormente se les ofrece de 3 a 3.5 kg y hasta la cubrición. Cuando una hembra sale muy delgada de la lactancia, se le puede ofrecer alimento a libre acceso con la finalidad de que recupere más rápido sus reservas y pueda entrar más pronto en celo.Sementales: Ofrecer de 2 a 3 kg al día, de acuerdo a la condición corporal y a la actividad reproductiva. La alimentación es restringida para evitar engrasamiento y baja en sus aptitudes para la reproducción. ADVERTENCIAS: No almacenar en lugares húmedos, calientes, y mal ventilados, hágalo en sitios secos y protegido de roedores, insectos y otros animales.De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Este alimento no deberá de ofrecerse 5 días antes del sacrificio de los animales destinados para consumo humano.         USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1512,456,6,'Alimento balanceado medicado para cerdos reproductores  (gestación,  lactancia y sementales) DOSIS Y VIA DE ADMINISTRACION: Hembras gestantes primerizas: Ofrecer de 2 a 2.5 kg/día de acuerdo a la condición corporal.Hembras gestantes adultas: Ofrecer de 2 a 3.5 kg/día de acuerdo a la condición corporal de la cerda, número de parto y tercio de gestación. Una sobrealimentación provocará menor consumo de alimento en la lactancia y disminución en la producción de leche. Hembras lactantes: La cantidad de alimento depende del peso, de las condiciones ambientales y del número de lechones que esté amamantando. Al momento del parto no ofrecer alimento, durante el primer día ofrecer aproximadamente 1/2 kg;  después y hasta el día 5 incrementar 1/2 kg más al día, posteriormente la alimentación será a libre acceso. Para favorecer el consumo se recomienda alimentar mínimo 2 veces al día (una en la mañana y otra en la tarde). Al momento del destete, la cantidad de alimento ofrecido se reduce a 2-2.5 kg durante dos o tres días, posteriormente se les ofrece de 3 a 3.5 kg y hasta la cubrición. Cuando una hembra sale muy delgada de la lactancia, se le puede ofrecer alimento a libre acceso con la finalidad de que recupere más rápido sus reservas y pueda entrar más pronto en celo.Sementales: Ofrecer de 2 a 3 kg al día, de acuerdo a la condición corporal y a la actividad reproductiva. La alimentación es restringida para evitar engrasamiento y baja en sus aptitudes para la reproducción. ADVERTENCIAS: No almacenar en lugares húmedos, calientes, y mal ventilados, hágalo en sitios secos y protegido de roedores, insectos y otros animales.De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Este alimento no deberá de ofrecerse 5 días antes del sacrificio de los animales destinados para consumo humano.         USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1513,457,6,'Alimento balanceado medicado para cerdos reproductores  (gestación,  lactancia y sementales). DOSIS Y VIA DE ADMINISTRACION: Hembras gestantes primerizas: Ofrecer de 2 a 2.5 kg/día de acuerdo a la condición corporal.Hembras gestantes adultas: Ofrecer de 2 a 3.5 kg/día de acuerdo a la condición corporal de la cerda, número de parto y tercio de gestación. Una sobrealimentación provocará menor consumo de alimento en la lactancia y disminución en la producción de leche. Hembras lactantes: La cantidad de alimento depende del peso, de las condiciones ambientales y del número de lechones que esté amamantando. Al momento del parto no ofrecer alimento, durante el primer día ofrecer aproximadamente 1/2 kg;  después y hasta el día 5 incrementar 1/2 kg más al día, posteriormente la alimentación será a libre acceso. Para favorecer el consumo se recomienda alimentar mínimo 2 veces al día (una en la mañana y otra en la tarde). Al momento del destete, la cantidad de alimento ofrecido se reduce a 2-2.5 kg durante dos o tres días, posteriormente se les ofrece de 3 a 3.5 kg y hasta la cubrición. Cuando una hembra sale muy delgada de la lactancia, se le puede ofrecer alimento a libre acceso con la finalidad de que recupere más rápido sus reservas y pueda entrar más pronto en celo.Sementales: Ofrecer de 2 a 3 kg al día, de acuerdo a la condición corporal y a la actividad reproductiva. La alimentación es restringida para evitar engrasamiento y baja en sus aptitudes para la reproducción. ADVERTENCIAS: No almacenar en lugares húmedos, calientes, y mal ventilados, hágalo en sitios secos y protegido de roedores, insectos y otros animales.De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Este alimento no deberá de ofrecerse 5 días antes del sacrificio de los animales destinados para consumo humano.         USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1514,458,6,'Alimento para aves de combate diseñado, formulado y elaborado con ingredientes de muy buena calidad,es ideal para complementar la alimentación de las aves o para balancear dietas compuestas a basede leguminosas, y elevar el nivel energético de la ración.Es ideal para incrementar el nivel de energía de las dietas para las diferentes etapas de las aves.USO Y ESPECIES EN LAS QUE SE EMPLEA: Suminisre ROOSTER MIX como corrector de nivelde energía de las dietas, como una fuente de carbohidratos, para las diferentes etapas de actividadde las aves de combate.DOSIS Y VIA DE ADMINISTRACIÓN: Oral. ROOSTER MIX, debe utilizarse siempre en combinación coningredientes que aportan proteína, minerales y vitaminas, o cuando las fuentes de carbohidratos son bajas.Mezclas de Leguminosas: Incorporar ROOSTER MIX en un rango de 10-20% de la mezcla total.Mezcla de Leguminosas con Cereales: Incorporar Rooster Mix en un rango de 5-9% de la mezcla total.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejarel alimento directamente sobre el suelo y/o en contaacto con paredes. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                    USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1515,459,6,'Alimento en presentación de hojuelas que complementado con forraje nutre a  yeguas de crianza, yeguas lactantes, potros y sementales. DOSIS Y VIA DE ADMINISTRACION: Oral. Tipo de ración para una yegua de cría con peso de 500 kgGestante  (8 a 11 meses), B 150: 4 a 5 kg (9 a 11 litros) y forraje: 3 kgLactantes (Primeros 3 meses después del nacimiento del potro), B 150: 8 a 9 kg (17.7 a 20 litros) y forraje: 5 a 7 kgTipo de ración para un potro Tipo Silla FrancesaAntes del destete: Primer mes, B 150: 0.5 kg (1.1 litros) además de 0.5 kg adicionales por cada mes de edad.Después del destete:- 6 a 7 meses, B 150: 3 a 4 kg (6.5 a 9 litros) y forraje: 3 kg8 a 12 meses, B 150: 3.5 a 4.5 kg (7.7 a 10 litros) y forraje: 4 kgTipo de ración para un semental que pesa 500 kgTemporada de Reproducción: B 150 4 a 5 kg (9 a 11 litros) y forraje: 5 kgPeriodo de Descanso: B 150 2 a 3 kg (4.5 a 6.5 litros) y forraje: 5 kg ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.           \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1516,460,6,'Alimento en presentación de hojuelas, a complementarse con forraje ,formulado para el esfuerzo corto pero intenso en caballos y ponis que participan en competencias. DOSIS Y VIA DE ADMINISTRACION: Oral. Tipo de ración para un caballo que pesa entre 450 y 500 kg ,que desarrolla Esfuerzo constante e  intenso en competencia.H 250: 4.5 a 5.5 kg (9.8 a 12 litros) y Forraje: 7 a 8 kg. Ponis que pesan 250 kilogramos: Divida por la paja de trigo. Ración para caballos con camas artificiales. H 250: 4.5 a 5.5 kg (9.8 a 12 litros) y Forraje: 7 a 8 kg. Ponis que pesan 250 kilogramos: Divida por la mitad las cantidades mostradas. Ración sin heno: fomente el consumo de forraje. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.               \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1517,461,6,'Alimento en presentación de hojuelas, a complementarse con forraje, formulado para sostener el esfuerzo intenso, de caballos y ponis que participan en competencias (resistencia, prueba completa, caballos trotones, carreras.) DOSIS Y VIA DE ADMINISTRACION: Oral. Tipo de ración para un caballo que pesa entre 450 y 500 kg que desarrolla un tipo de trabajo competencia de esfuerzo prolongado sostenido: H-350: 4 a 6 kg (8.9 a 13.3 litros) Forraje: 5 kg (provee fibra digestible), con cama de paja de trigo.Ración para caballos con camas artificiales. H-350: 4 a 6 kg (8.9 a 13.3 litros) Forraje: 7 a 8 kg.Ponis que pesan 250 kilogramos: Divida por la mitad las cantidades mostradas. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                 \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1518,462,6,'Alimento en presentación de pellets extruidos , a complementarse con forraje, formulado para mantener un Alto Desempeño Atlético de caballos que realizan actividades desde aquellas de velocidad hasta las que demandan de resistencia ( potencia del trabajo y mayor duración del mismo ) en competencias de nivel profesional ( carreras de caballos , polo , adiestramiento , salto de obstáculos , endurance ) , ofreciendo una alta concentración de nutrientes / kg. Y evitando la frecuente pérdida de peso del equino. DOSIS Y VIA DE ADMINISTRACION: Oral. Tipo de ración para un caballo que pesa entre 450 y 500 kg que desarrolla un tipo de trabajo competencia de esfuerzo intenso y continuo: H-380: 3.5 a 4.0 kg (6.9 a 7.9 litros) Forraje:4 -  5 kg (provee fibra digestible), con cama de paja de trigo.Ración para caballos con camas artificiales. H-380: 3.5 a 4.0 kg (6.9 a 7.9 litros) Forraje: 7 a 8 kg.Ponis que pesan 250 kilogramos: Divida por la mitad las cantidades mostradas. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.              \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1519,463,6,'Suplemento proteico en presentación de pellets , a complementarse con forraje, formulado para incrementar  el nivel protéico de la dieta de caballos  que se encuentran en una etapa de formación de tejido muscular ,o con esfuerzo  físico intenso ( carreras , endurance , polo , equitación ) , o para enriquecer la alimentación de yeguas lactantes o gestantes , o bién para caballos en los que se busca mantener o mejorar su condición corporal. DOSIS Y VIA DE ADMINISTRACION: Oral. Tipo de ración para un caballo que pesa entre 450 y 500 kg que desarrolla un tipo de trabajo  competencia de esfuerzo prolongado sostenidoH 400: 0.7 a 0.9 kg (1.04 a 1.34 litros) Flakes o Avena : 4.0  5.0 kg (8.7 a 10.9 litros) , Forraje: 5 kg (provee fibra digestible)para caballos con cama de paja de trigo.Ración para caballos con camas artificiales.H 400: 0.7 a 0.9 kg (1.04 a 1.34 litros),Flakes o Avena : 4.0  5.0 kg (8.7 a 10.9 litros)Forraje: 7 a 8 kg.Ponis que pesan 250 kilogramos: Divida por la mitad las cantidades mostradas. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.             \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1520,464,6,'Suplemento  energético para caballos en presentación de pellets con forma de «nugguet«  que se integra a la dieta convencional y a complementarse con forraje, formulado para incrementar la densidad energética de las raciones de caballos que se encuentran en competencia o entrenamiento intenso, para cubrir su alta demanda calórica (calorías) de este tipo de actividad. DOSIS Y VIA DE ADMINISTRACION: Oral. Tipo de ración para un caballo que pesa entre 450 y 500 kg que desarrolla un tipo de trabajo  competencia de esfuerzo prolongado sostenido.H-480: 1.2 a 1.4 kg (2.5 a 2.9 litros), Flakes o Avena: 4.0  5.0 kg (8.7 a 10.9 litros), Forraje: 5 kg (provee fibra digestible) para caballos con cama de paja de trigo.Ración para caballos con camas artificiales.H-480: 1.2 a 1.4 kg (2.5 a 2.9 litros) , Flakes o Avena : 4.0  5.0 kg (8.7 a 10.9 litros), Forraje: 7 a 8 kg.Ponis que pesan 250 kilogramos: Divida por la mitad las cantidades mostradas.Ración sin heno: fomente el consumo de forraje. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.             \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1521,465,6,'Complemento para alimentación de animales.SOSTÉN MULTIUSOS está diseñado, formulado y elaborado con ingredientes de buena calidad, ideal para complementar la alimentación de cualquier tipo de animal.Para RUMIANTES, que principalmente se tienen en condiciones de estiaje y/o pastoreo de forrajes de mala a regular calidad, así como alimentados con rastrojos, pajas y otros subproductos agrícolas y agroindustriales o complementados también con granos disponibles.En AVES para dos o tres días antes de mercado.Para CERDOS antes de ir a rastro o después de los 110 kg de peso.Por ser un complemento libre de antibióticos, desparasitantes y otros productos químicos, es ideal para animales destinados a rastro. Además puede servir como base para otras mezclas.Mantener en todo momento agua limpia y fresca para su ganado. DOSIS Y VIA DE ADMINISTRACION: Dependiendo de la condición en particular, ofrecer del 1 al 3 % del peso vivo de los animales.Para alguna formulación especial o uso de este alimento, favor de contactar al Servicio Técnico de maltaCleyton®. ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.            \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1522,466,6,'Para cerditos del día 3 a 35 de edad. Es un alimento preiniciador en presentación de minipellet queayuda al cerdito a consumirlo adecuadamente en la etapa de cambio de alimento líquido a sólido ytener una mejor adaptación a este cambio evitando problemas digestivos.Esta formulado y elaborado con proteinas seleccionadas, granos de cereales procesados, fuentes de vitaminas y minerales, que proporcionan los nutrientes esenciales para el crecimiento de los cerditosProporcionar consumo a voluntad en pequeñas cantidades varias veces al día para estimular elconsumo de alimento , evitando la contaminación y desperdicio del alimento .Cuando los cerditoscumplan 35 días de edad sustituya paulatinamente este alimento por SUPER APILAC ULTRA 2.USO Y ESPECIES EN LAS QUE SE EMPLEA: Alimento balanceado y medicado para cerdos de 3 a 35 días de edadDOSIS Y VIA DE ADMINISTRACIÓN : A libre acceso oralADVERTENCIAS: Tratar de evitar la contaminación de alimento. No almacenar el alimento en lugares húmedos, calientes y mal tentilados, hágalo en sitios secos y protegidos de roedores, insectos y otrosanimales. De preferencia, estivar sobre tarimas y no dejar el alimento directamente sobre el suelo.y/o en contacto con paredes. No usar para alimentar animales rumiantesNo usar en cerdos con mas de 40 kg de peso vivo.Prohibido para todos los porcinos adultos y ademas para todas las edades de las demas especies de desarrollo en la primera estapa de desarrollo de los porcinos, queda prohibido el consumo de sus productos de estos animales, posteriormente en la etapa final del desarrollo podran ser paraconsumo humano.             USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
