	(1531,475,6,'Alimento balanceado medicado para pollitas de postura de 0 a 6 semanas de edadEs un alimento de alta digestibilidad que provee los nutrientes necesarios para las pollitas de postura en las primeras 6 semanas de vida  Mantenga una temperatura constante 32 °C  la primera semana de vida, suministre agua limpia y alimento a libertad.DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, de 0 a 6 semanas de edad. ADVERTENCIAS: Retirar 15 días previos al sacrificio de los animales destinados al consumo humanoNo almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                       \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1532,476,6,'Alimento balanceado medicado para pollitas de postura de 0 a 6 semanas de edadEs un alimento de alta digestibilidad que provee los nutrientes necesarios para las pollitas de postura en las primeras 6 semanas de vida  Mantenga una temperatura constante 32 °C  la primera semana de vida, suministre agua limpia y alimento a libertad.DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, de 0 a 6 semanas de edad. ADVERTENCIAS: No requiere tiempo de retiro.No debe de usarse en patos, gansos y palomas.No agregar o mezclar con otras drogas u otro antibiótico.No usarse en rumiantes.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.           \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1533,477,6,'Alimento balanceado medicado para pollitas de postura de 0 a 6 semanas de edadEs un alimento de alta digestibilidad que provee los nutrientes necesarios para las pollitas de postura en las primeras 6 semanas de vida  Mantenga una temperatura constante 32 °C  la primera semana de vida, suministre agua limpia y alimento a libertad.DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, de 0 a 6 semanas de edad. ADVERTENCIAS: Retirar 15 días previos al sacrificio de los animales destinados al consumo humanoNo almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                      \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1534,478,6,'Alimento balanceado medicado para pollitas de postura de 0 a 6 semanas de edadEs un alimento de alta digestibilidad que provee los nutrientes necesarios para las pollitas de postura en las primeras 6 semanas de vida  Mantenga una temperatura constante 32 °C  la primera semana de vida, suministre agua limpia y alimento a libertad.DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, de 0 a 6 semanas de edad. ADVERTENCIAS: No requiere tiempo de retiro.No debe de usarse en patos, gansos y palomas.No agregar o mezclar con otras drogas u otro antibiótico.No usarse en rumiantes.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1535,479,6,'SUPER BABI PLUS CD (A84) Alimento para Pollitas de postura de 0 a 6 semanas de edadEs un alimento diseñado, formulado, y elaborado con ingredientes de exelente calidad, y alta digestibilidad, que proveen los nutrimientos necesarios y de fácil digestión para las pollitas de posturaen las primeras 6 semanas de vida.Su presentación en micronizado asegura mayor consumo, logrando mejores pesos, dando un óptimoarranque de la pollita, mejora el proceso de maduración del aparato digestivo, logrando mejores uniformidades en la parvada.Minimiza los riesgos de presencia de factores antinutricionales o tóxicos durante esta etapa. Mantenga una temperatura constante 32 °C  la primera semana de vida,  suministre agua limpia y alimento a libertad.                         \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1536,480,6,'Alimento balanceado para ganado lechero.El suplemento energético está diseñado para usarse como fuente de energía con forrajes de mediana a alta calidad en su contenido de proteína. Si los forrajes no contienen la suficiente proteína tendrá que agregarse ésta a la dieta para sostener un nivel óptimo de producción sobre todo al inicio y pico de la lactancia. Ofrecer siempre a los animales agua y sal mineralizada. DOSIS Y VIA DE ADMINISTRACION: Se recomienda mezclar bien el SUPLEMENTO ENERGÉTICO con el forraje, no dar más de 4 kg de suplemento por servida a los animales, en caso de ofrecer más, considerar el uso de amortiguadores del pH ruminal para evitar trastornos. Ofrecer siempre a los animales agua y sal mineralizada. ADVERTENCIAS: No almacene este alimento en lugares húmedos, mal ventilados o calientes, almacénelo en sitios secos y al abrigo de la luz solar directa, libre de roedores, insectos y otros animales nocivos.Estíbelo sobre tarimas o polines pero nunca directamente sobre el suelo, así se facilitará el aseo y evitará que el alimento absorba la humedad.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1537,481,6,'Alimento balanceado para ganado lechero.El suplemento energético está diseñado para usarse como fuente de energía con forrajes de mediana a alta calidad en su contenido de proteína. Si los forrajes no contienen la suficiente proteína tendrá que agregarse ésta a la dieta para sostener un nivel óptimo de producción sobre todo al inicio y pico de la lactancia. Ofrecer siempre a los animales agua y sal mineralizada. DOSIS Y VIA DE ADMINISTRACION: Se recomienda mezclar bien el SUPLEMENTO ENERGÉTICO con el forraje, no dar más de 4 kg de suplemento por servida a los animales, en caso de ofrecer más, considerar el uso de amortiguadores del pH ruminal para evitar trastornos. Ofrecer siempre a los animales agua y sal mineralizada. ADVERTENCIAS: No almacene este alimento en lugares húmedos, mal ventilados o calientes, almacénelo en sitios secos y al abrigo de la luz solar directa, libre de roedores, insectos y otros animales nocivos.Estíbelo sobre tarimas o polines pero nunca directamente sobre el suelo, así se facilitará el aseo y evitará que el alimento absorba la humedad.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.                \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1538,482,6,'TEXI-ENGORDA es un alimento diseñado, formulado y elaborado con ingredientes de calidad que proveen los nutrimentos necesarios y de fácil digestion para bovinos de engorda.Ofrecer alimento TEXI-ENGORDA (B43) a libre acceso (el consumo es de alrededor de 8 a 10 kilos), más alrededor de 2 a 3 kilos de forrajes de lastre de buena calidad.Al iniciar el periodo de engorda deberá de haber una fase de adaptación en donde se deberá de incluir paulatinamente el alimento TEXI-ENGORDA (B43) y disminuir el forraje de lastre de buena calidad. Para alguna formulación especial con este alimento, favor de contactar al Servicio Técnico de maltaCleyton®.Mantener en todo momento agua limpia y fresca para su ganado. CONSEJOS PRÁCTICOS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos yprotegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimentodirectamente sobre el suelo y/o en contacto con paredes.                    USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1539,483,6,'Alimento balanceado medicado para la última fase de preparación del toro para su lidia.Toro de Lidia está formulado para que el toro sea capaz de realizar un esfuerzo muscular máximo durante los 15  20 minutos que dura la lidia. En términos generales, los toros para la fiesta brava no están diseñados para realizar esfuerzos musculares intensos y prolongados como lo exige la lidia, sin embargo gracias a la selección genética, se han creado animales con determinados factores psíquicos, tales como la bravura y la acometividad, por lo que los toros mejor dotados genética y físicamente (aquí es donde interviene la alimentación) dan pelea manifestando su bravura y poder hasta el final.Toro de Lidia está formulado con niveles apropiados de proteína para el toro atleta, contiene ingredientes que le proporcionan niveles óptimos de proteína de sobrepaso, su bajo contenido de almidón evita el engrasamiento, los niveles elevados de vitamina E, biotina, tiamina, minerales como el zinc, en forma de quelato, ingredientes que favorecen el buen estado de cuernos, pezuñas, pelo e hígado, este último debe mantenerse en un estado óptimo de salud para que durante la lidia, el toro pueda obtener energía suficiente.Toro de Lidia está formulado con niveles elevados de fibra digestible para mantener el buen estado del rumen y evitar la acidosis que provoca lesiones en pezuñas, afectando el desempeño del toro. Contiene picolinato de cromo, mineral que disminuye el engrasamiento y favorece la acción de la insulina, hormona involucrada en la obtención de energía. Evitar el excesivo manejo de los animales durante el encajonamiento, transporte, desencajone y pesaje, reconocimiento, etc. para disminuir la movilización del glucógeno que es la fuente de energía almacenada en músculo e hígado que puede ser utilizada por el toro de inmediato. Durante toda la crianza ofrecer al ganado sales minerales con calcio y fósforo, durante la época de estiaje ofrecer al pie de cría de acuerdo a la severidad de la misma 1 a 2 kg animal/día del alimento Toro de Lidia.La fase de preparación para la plaza puede durar de 3 a 6 meses dependiendo del desarrollo óseo y peso del animal. Esta etapa no debe tener una duración menor a 3 meses.DOSIS Y VIA DE ADMINISTRACIÓN: Oral. De 4 a 8 kg por cabeza por día dependiendo del peso inicial, así como la calidad del forraje el cual debe estar siempre presente.ADVERTENCIAS: Retirar el alimento 3 dias previos al sacrificio de los animales destinados al consumo humano.     USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1540,484,6,'Alimento balanceado medicado para vacas lecheras.APILECHE 17% ULTRA, es un alimento diseñado, formulado y elaborado con ingredientes de excelente calidad, que proveen los nutrimentos necesarios y de fácil digestión para vacas lecheras en producción.Este alimento es un concentrado, por lo que además deben de suministrarse forrajes de buena calidad (que nos aporta fibra necesaria para una buena digestión).Mantener en todo momento agua limpia y fresca.  DOSIS Y VIA DE ADMINISTRACION: Oral. La cantidad a ofrecer de este alimento depende además de otros factores, de la producción promedio de leche. Se recomienda ofrecer 1 kg de estealimento por cada 3 litros de leche producida.Para formulación especial de ración integral con el uso de este alimento, favor de contactar con el Servicio Técnico de maltaCleyton. ADVERTENCIAS: Suspender el consumo 3 días antes del sacrificio de los animales destinados para consumo humano.No se administre a equinos.No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento ypérdida de propiedades nutrimentales.           USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1541,485,6,'Alimento balanceado medicado para vacas lecheras.APILECHE 17% ESPECIAL, es un alimento diseñado, formulado y elaborado con ingredientes de excelente calidad, que proveen los nutrimentos necesarios y de fácil digestión para vacas lecheras en producción.Este alimento es un concentrado, por lo que además deben de suministrarse forrajes de buena calidad (que nos aporta fibra necesaria para una buena digestión).Mantener en todo momento agua limpia y fresca.  DOSIS Y VIA DE ADMINISTRACION: Oral. La cantidad a ofrecer de este alimento depende además de otros factores, de la producción promedio de leche. Para vacas que producen menos de 9 litros /día, ofrecer 1/2kg por cada 2 litros de leche producida, más forrajes de buena calidad.Para vacas que producen entre de 9 y 18litros /día, ofrecer 1/2kg por cada 1 1/2  litros de leche producida más forrajes de buena calidad.Para vacas que producen entre de 18 y 22 litros /día, ofrecer 1/2kg por cada 1  litro de leche producida más forrajes de buena calidad.Para vacas que producen más de 22 litros /día, ofrecer todo el alimento que pueda consumir, másforrajes de buena calidad.Para formulación especial de ración integral con el uso de este alimento, favor de contactar con el Servicio Técnico de maltaCleyton.ADVERTENCIAS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.           \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1542,486,6,'Alimento medicado con Monensina 20g/Ton para vacas lecherasEs un alimento diseñado, formulado y elaborado con ingredientes de calidad, que proveen los nutrimentos necesarios y de fácil digestión para vacas lecheras en producción. Es un alimento es un concentrado, por lo que además deben de suministrarse forrajes de buena calidad (que nos aporta fibra necesaria para una buena digestión). Mantener en todo momento agua limpia y fresca para sus vacas.DOSIS Y VIA DE ADMINISTRACION: via oral.La cantidad a ofrecer de este alimento depende además de otros factores, de la producción de leche. En promedio ofrecer 1 kg. de este alimento por cada 3 litros de leche producida.ADVERTENCIAS: Suspender el consumo 3 dias antes del sacrificio de los animales destinados alconsumo humano.No administre a equinosNo almacenar alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Dé salida al alimento que tenga mas tiempo en sus bodegas para evitar su envejecimiento y pérdidade propiedades nutrimentales.                \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1543,487,6,'Alimento Balanceado para vacas SecasEste producto es un alimento científicamente balanceado que satisface las necesidades de las hembras jóvenes en gestación y vacas adultas secas.VACAS SECAS desarrolla animales normales vigorosos en buen estado de carnes, sin grasa superflua preparándolos adecuadamente para sus funciones de reproducción y producción lechera futura. A las vacas jóvenes como a las adultas secas en gestación, les proporciona los nutrientes necesarios para ella y el becerro en formación, conservándolas en las mejores condiciones para su parto sano.Mantener en todo momento agua limpia y fresca para su ganadoDOSIS Y VIA DE ADMINISTRACION: Oral Ofrecer VACAS SECAS a razón de 1 a 3 % del pesovivo de acuerdo a la etapa del animal.A los 4 o 5 días del parto, sustituya gradualmente VACAS SECAS por el alimento para vacas productoras según las necesidades de los animales y de acuerdo a los forrajes que suministren.ADVERTENCIASNo almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimasy no dejar el alimento directamente sobre el suelo o en contacto con paredes.                 \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1544,488,6,'Para cerditos del día 21 al 32 de edad. Es un alimento preiniciador medicado para el tratamiento deinfecciones causadas por microorganismos sensibles al florfenicol y tartrato de tilosina en presentaciónde minipellet que ayuda al cerdito a consumirlo adecuadamente en la etapa de transición y teneruna mejor adaptación a este cambio evitando problemas digestivos. Está formulado y elaborado con proteínas, granos de cereales procesados, fuentes de vitaminas y minerales, que proporcionan los nutrimentos esenciales para la transición al destete de los cerditos. Proporcionar consumo a voluntad en pequeñas cantidades varias veces al día para estimular el consumo de alimento, evitando la contaminación y el desperdicio del alimento. Retirar el alimento contaminado. Mantener en todo momentoagua potable y fresca para los cerditos. Cuando los cerditos cumplan 32 días de edad, sustituyapaulatinamente este alimento por YOUPIG! 2.USO Y ESPECIES EN LAS QUE SE EMPLEA: Alimento balanceado preiniciador medicado para cerdosde 21 a 32 días de edad.DOSIS Y VIA DE ADMINISTRACIÓN : A libre acceso oralADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo ensitios secos y protegidos de roedores, insectos y otros animales. De preferencia, estibar sobre tarimasy no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. No usar para alimentar animales rumiantes.Tiempo de retiro: No utilizar este producto 13 días antes del sacrificio de los animales destinados para elconsumo humano               USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1545,489,6,'Para cerditos del día 21 al 32 de edad. Es un alimento preiniciador medicado para el tratamiento deinfecciones causadas por microorganismos sensibles al clorhidrato de clortetraciclina y fumarato hidrogenado de tiamulina para cerdos, durante 21 días; en presentación de minipellet que ayuda al cerdito a consumirlo adecuadamente en la etapa de transición y tener una mejor adaptación a este cambio evitando problemas digestivos. Está formulado y elaborado con proteínas, granos de cereales procesados, fuentes de vitaminas y minerales, que proporcionan los nutrimentos esenciales para la transición al destete de los cerditos. Proporcionar consumo a voluntad en pequeñas cantidades varias veces al día para estimular el consumo de alimento, evitando la contaminación y el desperdicio de alimento. Retirar el alimento contaminado. Mantener en todo momento agua potable y fresca para los cerditos. Cuando los cerditos cumplan 32 días de edad, sustituya paulatinamente este alimento porYOUPIG!2.USO Y ESPECIES EN QUE SE LE EMPLEA: Alimento balanceado preiniciador medicado para cerdos de 21 a 32 días de edadDOSIS Y VIA DE ADMINISTRACION: A libre acceso via oral.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia, estibar sobre tarimasy no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. No usar para alimentar animales rumiantes.Tiempo de retiro: No se debe administrar 7 días antes del sacrificio de los animales destinados paraconsumo humano.              USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1546,490,6,'Para cerditos del día 21 al 32 de edad. Es un alimento preiniciador en presentación de minipellet que ayuda al cerdito a consumirlo adecuadamente en la etapa de transición y teneruna mejor adaptación a este cambio evitando problemas digestivos.Está formulado y elaborado con proteinas, granos de cereales procesados, fuentes de vitaminas y minerales, que proporcionan los nutrimentos esenciales para la transición al destete.Proporcionar consumo a voluntad en pequeñas cantidades varias veces al dia para estimular el consumo de alimento, evitando la contaminación y el desperdicio del alimento.Retirar el alimento contaminado, Mantener en todo momento agua potable y fresca para los cerditos.Cuando los lechones cumplan 32 días de edad, sustituya paulatinamente este alimento por YOUPIG!2USO Y ESPECIES EN QUE SE LE EMPLEA: Alimento balanceado preiniciador medicado para cerdos de 21 a 32 días de edadDOSIS Y VIA DE ADMINISTRACION: A libre acceso oral.ADVERTENCIAS: No almacenar el aliemto en lugares húmedos, calientes y mal ventilados, hágaloen sitios secos y protegidos de roedores, insectos y otros animales. De preferencia, estibarsobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. No usar paraalimentar animales rumiantes.Tiempo de retiro: No se use en cerdos de más de 40 kg. Prohibido utilizar en animales de abasto en la última esta de desarrollo. Se restringe la administración de este producto exclusivamente por vía oral en la primeraetapa de desarrollo hasta los 35 kg de peso, por lo tanto la carne de estos animales no se podrá destinarpara consumo humano. Posteriormente hasta la etapa de finalización se podrá consumir la carne de estosanimales. Prohibido el uso de este producto en porcinos adultos.              USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02');
