VALUES
	(1547,491,6,'Para cerditos del día 21 al 32 de edad. Es un alimento preiniciador medicado para el tratamiento deinfecciones causadas por microorganismos sensibles a la amoxicilina, durante 7 días: enpresentación de minipellet que ayuda al cerdito a consumirlo adecuadamente en la etapa de transición y tener una mejor adaptación a este cambio evitando problemas digestivos.Está formulado y elaborado con proteinas, granos de cereales procesados, fuentes de vitaminas y minerales, que proporcionan los nutrimentos esenciales para la transición al destete de los cerditos.Proporcionar consumo a voluntad en pequeñas cantidades varias veces al dia para estimular el consumo de alimento, evitando la contaminación y el desperdicio del alimento.Retirar el alimento contaminado. Mantener en todo momento agua potabley fresca para los cerditos. Cuando los cerditos cumplan 32 días de edad, sustituya paulatinamente estealimento por YOUPIG! 2USO Y ESPECIES EN QUE SE LE EMPLEA: Alimento balanceado preiniciador medicado para cerdos de 21 a 32 días de edadDOSIS Y VIA DE ADMINISTRACION: A libre acceso oral. En pequeñas cantidades varias veces al día.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo ensitios secos y protegidos de roedores, insectos y otros animales. De preferencia, estibar sobre tarimasy no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. No usar para alimentar animales rumiantes.Tiempo de retiro: No se debe administrar 14 días antes del sacrificio de los animales destinados al consumo humano              USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1548,492,6,'Para cerditos del día 21 al 32 de edad. Es un alimento preiniciador medicado para el tratamiento deinfecciones causadas por microorganismos sensibles a la tilosina y sulfametazina, bajo la prescripcióny supervisión del Médico Veterinario, en presentación de minipellet que ayuda al cerdito a consumirloadecuadamente en la etapa de transición y tener una mejor adaptación a este cambio evitando problemasdigestivos. Está formulado y elaborado con proteínas, granos de cereales procesados, fuentes de vitaminas y minerales, que proporcionan los nutrimentos esenciales para la transición al destete de loscerditos. Proporcionar consumo a voluntad en pequeñas cantidades varias veces al dia para estimular el consumo de alimento, evitando la contaminación y el desperdicio del alimento.Retirar el alimento contaminado. Mantener en todo momento agua potabley fresca para los cerditos. Cuando los cerditos cumplan 32 días de edad, sustituya paulatinamente estealimento por YOUPIG! 2USO Y ESPECIES EN QUE SE LE EMPLEA: Alimento balanceado preiniciador medicado para cerdos de 21 a 32 días de edadDOSIS Y VIA DE ADMINISTRACION: A libre acceso oral. En pequeñas cantidades varias veces al día.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo ensitios secos y protegidos de roedores, insectos y otros animales. De preferencia, estibar sobre tarimasy no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. No usar para alimentar animales rumiantes.Tiempo de retiro: No se debe administrar 5 días antes del sacrificio de los animales destinados al consumo humano              USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1549,493,6,'Indicado para cerditos del día 32 al 42 de edad. Es un alimento preiniciador en presentación de minipellet que ayuda al cerdito a consumirlo adecuadamente y tener una mejor adaptación evitando problemas digestivos. Está formulado y elaborado con proteínas, granos de cereales procesados, fuentes de vitaminas y minerales que proporcionan los nutrimentos esenciales  para el crecimiento de los cerditos.Proporcionar consumo a voluntad en pequeñas cantidades varias veces al dia para estimular el consumo de alimento, evitando la contaminación y el desperdicio del alimento.Retirar el alimento contaminado, Mantener en todo momento agua potable y fresca para los cerditos.Cuando los cerditos cumplan 42 días, sustituya paulatinamente este alimento por YOUPIG! 3USO Y ESPECIES EN QUE SE LE EMPLEA: Alimento balanceado preiniciador medicado para cerdos de 32  42 días de edad.DOSIS Y VIA DE ADMINISTRACIÓN: A libre acceso oral.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo ensitios secos y protegidos de roedores, insectos y otros animales. De preferencia, estibar sobre tarimasy no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. No usar para alimentar animales rumiantes.Tiempo de retiro: Los alimentos que contienen pulmotil deberan ser retirados de los cerdos destinadospara el consumo humano 7 días antes del sacrificio.               USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1550,494,6,'Indicado para cerditos del día 32 al 42 de edad. Es un alimento preiniciador en presentación de minipellet que ayuda al cerdito a consumirlo adecuadamente y tener una mejor adaptación evitando problemas digestivos. Está formulado y elaborado con proteínas, granos de cereales procesados, fuentes de vitaminas y minerales que proporcionan los nutrimentos esenciales  para el crecimiento de los cerditos.Proporcionar consumo a boluntad en pequeñas cantidades varias veces al dia para estimular el consumo de alimento, evitando la contaminación y el desperdicio del alimento.Retirar el alimento contaminado, Mantener en todo momento agua potable y fresca para los cerditos.Cuando los cerditos cumplan 42 días, sustituya paulatinamente este alimento por YOUPIG! 3USO Y ESPECIES EN QUE SE LE EMPLEA: Alimento balanceado preiniciador medicado para cerdos de 32  42 días de edad.DOSIS Y VIA DE ADMINISTRACIÓN: A libre acceso oral.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo ensitios secos y protegidos de roedores, insectos y otros animales. De preferencia, estibar sobre tarimasy no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. No usar para alimentar animales rumiantes.Tiempo de retiro: No se debe administrar 7 días antes del sacrificio de los animales destinados al consumo humano               USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
