	(1562,506,6,'Alimento formulado y elaborado con proteínas, granos de cereales procesados, minerales, vitaminas y aditivos que proporcionan los nutrimentos esenciales para el inicio de cerdos. Mantener en todo momento agua potable y fresca para los cerdos.USO Y ESPECIES EN LAS QUE SE EMPLEA:Alimento balanceado medicado con Carbadox para iniciación de cerdos de 50 a 70 días de edad.Prohibido para todos los porcinos adultos y además para todas las edades de las demás especies animales destinadas para el consumo humano.Restringido el uso oral únicamente en la primera etapa de desarrollo de los Porcinos, queda prohibido el consumo de sus productos de estos animales. Posteriormente en la etapa final de desarrollo podrán ser para consumo humano.DOSIS Y VIA DE ADMINISTRACIÓNA libre acceso via oral.ADVERTENCIAS:Tratar de evitar la contaminación del alimento. No almacenar el alimento en lugares húmedos,calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia, estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o encontacto con paredes.Este alimento no deberá de usarse en animales de más de 40 kg de peso vivo. Prohibido para todoslos porcinos adultosy además para todas las edades de las demás especies animales destinadas para consumo humano. Restringido el uso oral únicamente en la primera etapa de desarrollo de los porcinos queda prohibido el consumo de sus productos de estos animales, posteriormente en la etapafinal del desarrollo podrán ser para consumo humano.            USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
