	(1564,508,6,'Para lechones antes del destete (21 de edad). Es un alimento pre-iniciador en presentación deminipellet que ayuda al lechón a consumirlo adecuadamente en la etapa de cambio de alimento líquido a sólido y tener una mejor adaptación a este cambio evitando problemas digestivos.Está formulado y elaborado con proteinas, granos de cereales procesados, fuentes de vitaminas y minerales, que proporcionan los nutrimentos esenciales para la transición al destete.Proporcionar consumo a voluntad en pequeñas cantidades varias veces al día para estimular el consumo de alimento, evitando la contaminación y el desperdicio del alimento.Retirar el alimento contaminado, Mantener en todo momento agua potable y fresca para los cerditos.Cuando los lechones cumplan 21 días de edad, sustituya paulatinamente este alimento por YOUPIG!1USO Y ESPECIES EN QUE SE LE EMPLEA: Alimento balanceado preiniciador medicado para lechonesantes del destete (21 días de edad)DOSIS Y VIA DE ADMINISTRACION: A libre acceso oral.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo ensitios secos y protegidos de roedores, insectos y otros animales. De preferencia, estibar sobre tarimasy no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. No usar para alimentar animales rumiantes.Tiempo de retiro: No use en cerdos de mas de 40 kg. Prohibido el uso para todos los porcinos adultos.solo podrá ser usado en las primeras etapas de desarrollo de los porcinos, quedando prohibido el consumo de sus productos a estos animales. Posteriormente en la etapa final del desarrollo podrán serpara el conumo humano.              USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
