	(1566,510,6,'Para lechones antes del destete (21 de edad). Es un alimento pre-iniciador en presentación deminipellet que ayuda al lechón a consumirlo adecuadamente en la etapa de cambio de alimento líquido a sólido y tener una mejor adaptación a este cambio evitando problemas digestivos.Está formulado y elaborado con proteinas, granos de cereales procesados, fuentes de vitaminas y minerales, que proporcionan los nutrimentos esenciales para la transición al destete.Proporcionar consumo a voluntad en pequeñas cantidades varias veces al día para estimular el consumo de alimento, evitando la contaminación y el desperdicio del alimento.Retirar el alimento contaminado, Mantener en todo momento agua potable y fresca para los cerditos.Cuando los lechones cumplan 21 días de edad, sustituya paulatinamente este alimento por YOUPIG!1USO Y ESPECIES EN QUE SE LE EMPLEA: Alimento balanceado preiniciador medicado para lechonesantes del destete (21 días de edad)DOSIS Y VIA DE ADMINISTRACION: A libre acceso oral.ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo ensitios secos y protegidos de roedores, insectos y otros animales. De preferencia, estibar sobre tarimasy no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. No usar para alimentar animales rumiantes.Tiempo de retiro: No use en cerdos de mas de 40 kg. Prohibido el uso para todos los porcinos adultos.solo podrá ser usado en las primeras etapas de desarrollo de los porcinos, quedando prohibido el consumo de sus productos a estos animales. Posteriormente en la etapa final del desarrollo podrán serpara el conumo humano.              USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1567,511,6,'Sustituto de leche para alimentar becerras y becerros en etapa de lactancia a partir de la 3er. Semanade vida .Los animales en su etapa de lactancia recibirán MALTA 24-10 ya sea en destete precoz en alojamiento individual o amamantando con la vaca en pastoreo. La primera semana de vida delanimal debe permanecer con su madre asegurando el consumo de calostro, durante la segunda semana de vida consumirá leche natural de la vaca y a partir de la tercera semana de vida se iniciará el cambio gradual por MALTA 24-10.*Modo de preparación para 1 litro de sustituto de leche reconstituido: Agregar 125 a 150 gramosde MALTA 24-10 y 875 a 850 mililitros de agua respectivamente. Disolver en agua a temperaturaentre 37 y 40 grados centígrados.DOSIS Y VIA DE ADMINISTRACIÓN: Administrar por vía oral 4 litros/cabeza/día de sustituto de lechereconstituido; dividido en 2 tomas al día de 2 litros cada toma. Inicie con un litro y aumentarun litro cada tres días hasta llegar a cuatro litros diarios (divididos en dos tomas) hasta los 90 días de vida. Respetar un mínimo de cinco horas entre cada toma, administre agua potable y concentradoiniciador todo el tiempo durante la lactancia.ADVERTENCIAS: De preferencia los animales deben estar alojados en jaulas individuales. No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredesDe salida al alimento que tenga mas tiempo en sus bodegas para evitar su envejecimiento y pérdida de propiedades nutrimentales.              \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1568,512,6,'Sustituto de leche para alimentar becerras y becerros en etapa de lactancia a partir de la 3er. Semanade vida .Los animales en su etapa de lactancia recibirán LACTOCRÍA PLUS ya sea en destete precoz en alojamiento individual o amamantando con la vaca en pastoreo. La primera semana de vida delanimal debe permanecer con su madre asegurando el consumo de calostro, durante la segunda semana de vida consumirá leche natural de la vaca y a partir de la tercera semana de vida se iniciará el cambio gradual por LACTOCRÍA PLUS.*Modo de preparación para 1 litro de sustituto de leche reconstituido: Agregar 125 a 150 gramosde LACTOCRÍA PLUS y 875 a 850 mililitros de agua respectivamente. Disolver en agua a temperaturaentre 37 y 40 grados centígrados.DOSIS Y VIA DE ADMINISTRACIÓN: Administrar por vía oral 4 litros/cabeza/día de sustituto de lechereconstituido; dividido en 2 tomas al día de 2 litros cada toma. Inicie con un litro y aumentarun litro cada tres días hasta llegar a cuatro litros diarios (divididos en dos tomas) hasta los 90 días de vida. Respetar un mínimo de cinco horas entre cada toma, administre agua potable y concentradoiniciador todo el tiempo durante la lactancia.ADVERTENCIAS: De preferencia los animales deben estar alojados en jaulas individuales. No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredesDe salida al alimento que tenga mas tiempo en sus bodegas para evitar su envejecimiento y pérdida de propiedades nutrimentales.              \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1569,513,6,'ESPECIE(S) DESTINO: Camarón (Litopenaeus vannamei).Alimento balanceado medicado diseñado para camarón en el periodo posterior al pre-criadero,  en la fase de iniciación. Una vez sembrados en los estanques de engorda, por un periodo aproximado de la 13° a la 18° semana o desde que las post-larvas hayan alcanzado entre 16 g hasta que adquieran la talla de cosecha de aproximadamente 22 g de peso.DOSIS Y VIA DE ADMINISTRACION: Oral. RECOMENDACIONES PARA SU USO:Tabla de alimentación (kg/Ha/día) De 1 a 2 semanas con 1-3g de peso, biomasa de 10-12% Dar 6 kg si hay 5 larvas/m e 2,dar 12 kg si hay 10larvas /m e 2, dar 18 kg si hay 15 larvas/m e 2, dar 36 kg si hay 30 larvas/m e 2, dar 72 kg si hay 60 larvas/m e 2, dar 144 kg si hay 120 larvas/m e 2.De 2 a 3 semanas con 3-5g de peso, biomasa de 8-10% Dar 15 kg si hay 5 larvas/m e 2,dar 30 kg si hay 10larvas /m e 2, dar 45 kg si hay 15 larvas/m e 2, dar 90 kg si hay 30 larvas/m e 2, dar 180 kg si hay 60 larvas/m e 2, dar 360 kg si hay 120 larvas/m e 2.De 3-5 semanas con 5-7 g, Biomasa de 6-8%. Dar 20 kg si hay 5 larvas/me2, dar 40 kg si hay 10laravas/me2, dar 60 kg si hay 15 larvas/me2, dar 120 kg si hay 30 larvas/me2, dar 240 kg si hay 60larvas/me2, dar 480 kg  si hay 120 larvas/me2Estos datos no toman en cuenta la mortandad, ni los parámetros fisicoquímicos del estanque, por lo que sólo deben usarse como guía.ADVERTENCIAS: Almacene este alimento al resguardo de la luz solar directa,lluvia y otros agentesexternos. Estíbelo sobre tarimas, nunca en contacto directo con el piso y paredes para evitar que elalimento absorba humedad. No almacene este alimento en lugares húmedos, mal ventilados o calientes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimentoque tenga más tiempo en sus bodegas para evitar su envejecimiento.Este alimento no deberá de ofrecerse 20 días antes del sacrificio de los animalesdestinados para el consumo humano.       IMPORTADO POR ALIMPORT LA HABANA CUBA \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1570,514,6,'ESPECIE(S) DESTINO: Camarón (Litopenaeus vannamei).Alimento balanceado medicado diseñado para ser suministrado a los camarones en el periodo  posterior al pre-criadero, en la fase de iniciación. Una vez sembrados en los estanques deengorda, por un periodo aproximado de la 13° a la 18° semana o desde que las post-larvas hayanalcanzado entre 16 g hasta que adquieran la talla de cosecha de aproximadamente 22 g de peso.DOSIS Y VIA DE ADMINISTRACION: Oral. RECOMENDACIONES PARA SU USO:Tabla de alimentación (kg/Ha/día) De 1 a 2 semanas con 1-3g de peso, biomasa de 10-12% Dar 6 kg si hay 5 larvas/m e 2,dar 12 kg si hay 10larvas /m e 2, dar 18 kg si hay 15 larvas/m e 2, dar 36 kg si hay 30 larvas/m e 2, dar 72 kg si hay 60 larvas/m e 2, dar 144 kg si hay 120 larvas/m e 2.De 2 a 3 semanas con 3-5g de peso, biomasa de 8-10% Dar 15 kg si hay 5 larvas/m e 2,dar 30 kg si hay 10larvas /m e 2, dar 45 kg si hay 15 larvas/m e 2, dar 90 kg si hay 30 larvas/m e 2, dar 180 kg si hay 60 larvas/m e 2, dar 360 kg si hay 120 larvas/m e 2.De 3-5 semanas con 5-7 g, Biomasa de 6-8%. Dar 20 kg si hay 5 larvas/me2, dar 40 kg si hay 10laravas/me2, dar 60 kg si hay 15 larvas/me2, dar 120 kg si hay 30 larvas/me2, dar 240 kg si hay 60larvas/me2, dar 480 kg  si hay 120 larvas/me2Estos datos no toman en cuenta la mortandad, ni los parámetros fisicoquímicos del estanque, por lo que sólo deben usarse como guía.ADVERTENCIAS: Almacene este alimento al resguardo de la luz solar directa,lluvia y otros agentesexternos. Estíbelo sobre tarimas, nunca en contacto directo con el piso y paredes para evitar que elalimento absorba humedad. No almacene este alimento en lugares húmedos, mal ventilados o calientes.Evite el acceso a sus bodegas a personas extrañas y toda clase de animales. Dé salida al alimentoque tenga más tiempo en sus bodegas para evitar su envejecimiento.Este alimento no deberá de ofrecerse 20 días antes del sacrificio de los animalesdestinados para el consumo humano.       IMPORTADO POR ALIMPORT LA HABANA CUBA \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1571,515,6,'Para mezclar con granos molidos (sorgo, maíz, trigo  o combinación de estos) y obtener un alimento completo para la etapa de finalización (últimos 28 días de engorda).Recomendaciones generales de uso para elaborar 1 tonelada de alimento terminado:Etapa productiva                             GROWPIG! CONCENTRADO FINALIZADOR              GRANOS MOLIDOSFINALIZACIÓN (últimos 28 días de la engorda)           300kg (30%)                                  700kg (70%)*Hacer la mezcla lo mas homogenea posible y en las cantidades sugeridas.Si tiene algún grano o subproducto en particular , o si requiere formulación especial, puede solicitar al servicio técnico de maltaCleyton la formulación de su alimento, así como las recomendacionesde manejo alimenticio.Tener siempre agua potable y fresca para los cerdos.DOSIS Y VÍA DE ADMINITRACIÓN: Proporcionar el alimento terminado a libre acceso. Oral.ADVERTENCIAS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitos secos y protegiosde roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimentodirectamente sobre el suelo o en contacto con paredes.Este alimento no requiere periodo de retiro antes del sacrificio de los animales destinados al consumohumano.                 CONSULTE AL MEDICO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1572,516,6,'Para mezclar con granos molidos (sorgo, maíz, trigo  o combinación de estos) y obtener un alimento completo para las etapas señaladas. Recomendaciones generales de uso para elaborar 1 tonelada de alimento terminado:Etapa productiva                         GROWPIG! CONCENTRADO CREC-LACT-GEST           GRANOS MOLIDOSCRECIMIENTO (30-50kg)                                          320kg(32%)                                   680kg (68%)DESARROLLO (50-75 kg)                                          280kg(28%)                                   720kg (72%)Etapa productiva                         GROWPIG! CONCENTRADO CREC-LACT-GEST           GRANOS MOLIDOSGESTACION Y SEMENTALES (1)                               200kg(20%)                                   800kg (80%)LACTANCIA (2)                                                         320kg(32%)                                   680kg (68%)(1) Para mejor resultado y si se tiene disponible, agregar de 50 a 100 kg/ton. de salvado de trigo, quitaresta cantidad de grano molido.(2) Para mejor resultado y si se tiene disponible, agregar de 10 a 20 kg/ton. de sebo o aceite vegetal.quitar esta cantidad de grano molido.*Hacer la mezcla lo mas homogenea posible y en las cantidades sugeridas.Si tiene algún grano o subproducto en particular , o si requiere formulación especial, puede solicitar al servicio técnico de maltaCleyton la formulación de su alimento, así como las recomendacionesde manejo alimenticio.Tener siempre agua potable y fresca para los cerdos.DOSIS Y VÍA DE ADMINITRACIÓN: Proporcionar el alimento terminado a libre acceso. Oral.ADVERTENCIAS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitos secos y protegiosde roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimentodirectamente sobre el suelo o en contacto con paredes.            \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1573,517,6,'Para mezclar con granos molidos (sorgo, maíz, trigo  o combinación de estos) y obtener un alimento completo para la etapa de iniciación.Recomendaciones generales de uso para elaborar 1 tonelada de alimento terminado:Etapa productiva                         GROWPIG! CONCENTRADO INICIADOR                       GRANOS MOLIDOSINICIACIÓN (50a 70 díias de edad)                            320kg(32%)                                   680kg (68%)*Hacer la mezcla lo mas homogenea posible y en las cantidades sugeridas.Si tiene algún grano o subproducto en particular , o si requiere formulación especial, puede solicitar al servicio técnico de maltaCleyton la formulación de su alimento, así como las recomendacionesde manejo alimenticio.Tener siempre agua potable y fresca para los cerdos.Administrarse de 7 a 14 días para su uso terapeutico.DOSIS Y VIA DE ADMINISTRACIÓN: Proporcionar el alimento terminado a libre acceso. OralADVERTENCIAS:No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitos secos y protegidosde roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimentodirectamente sobre el suelo o en contacto con paredes.Prohibido utilizar en animales de abasto en la última etapa de desarrollo. Se restringe la administración de este producto exclusivamente por vía oral e la primera etapa de desarrollo. No se use en cerdos de mas de 40kg, por tanto la carne de estos animales no se podrá destinar a consumo humanoProhibido el uso de este producto en porcinos adultos.                   \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1574,518,6,'Alimento balanceado medicado con florfenicol, tilosina y ambroxol; formulado y elaborado con proteínasgranos de cereales procesados , minerales, vitaminas y aditivos que proporcionan los nutrimentosesenciales para el crecimiento de los cerdos (42 a 77 días de edad).Indicado su uso de 10 a 15 días para la prevención y tratamiento del complejo respiratorio porcinoy otras infecciones respiratorias, digestivas, septicémicas y de la piel, colibacilosis e ileitis proliferativa.Mantener en todo momento agua potable y fresca para los cerdos.DOSIS Y VIA DE ADMINISTRACIÓN: A libre acceso, vía oral. Bajo prescripción y supervisión del médico veterinario.ADVERTENCIAS: Evitar la contaminación del alimento. No almacenar el alimento en lugares húmedos,calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Tiempo de retiro: No utilizar este producto 13 días antes del sacrificio de los animales destinados a consumo humano.                                \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1575,519,6,'Alimento balanceado medicado con tilosina y sulfametazina; formulado y elaborado con proteínasgranos de cereales procesados , minerales, vitaminas y aditivos que proporcionan los nutrimentosesenciales para el crecimiento de los cerdos (42 a 77 días de edad).Indicado para reducir la incidencia y severidad de rinitis por Bordetella bronchiseptica; para la prevenciónde disentería porcina enteritis bacteriana porcina (salmonelosis) o entritis necrótica causada por Salmonella Choleraesuis; control de neumonía porcina causada por Pasteurella multocida y/o ActinomycesPyogenes.DOSIS Y VIA DE ADMINISTRACIÓN: A libre acceso, vía oral. Bajo prescripción y supervisión delmedico veterinario.ADVERTENCIAS: Evitar la contaminación del alimento. No almacenar el alimento en lugares húmedos,calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Tiempo de retiro: No utilizar este producto 5 días antes del sacrificio de los animales destinados a consumo humano.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1576,520,6,'Alimento balanceado medicado con tilmicosina; formulado y elaborado con proteínas,granos de cereales procesados , minerales, vitaminas y aditivos que proporcionan los nutrimentosesenciales para el crecimiento de los cerdos (42 a 77 días de edad).Indicado para el tratamiento de neumonía causada por Actinobacillus pleuropneumoniae, Mycoplasmahyopneumoniae, Pasteurella multocida y otros microorganismos sensibles a tilmicosina; en enfermedadde Glasser; y para reducir los signos clinicos y mortalidad asociada al Síndrome Respiratorio y ReproductivoPorcino (PRSS). Mantener en todo momento agua potable y fresca para los cerdos.DOSIS Y VIA DE ADMINISTRACIÓN: A libre acceso, vía oral. Bajo prescripción y supervisión delmedico veterinario.ADVERTENCIAS: Evitar la contaminación del alimento. No almacenar el alimento en lugares húmedos,calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Tiempo de retiro: Este alimento deberá de ser retirado de los cerdos destinados para el consumo humano 7 días antes del sacrificio.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1577,521,6,'Alimento formulado y elaborado con proteínas, granos de cereales procesados, minerales, vitaminasy aditivos que proporcionan los nutrimentos esenciales para el crecimiento de los cerdos. Mantener en todo momento agua potable y fresca para los cerdos.USO Y ESPECIES EN LAS QUE SE EMPLEA: Alimento balanceado medicado para crecimiento de cerdosindicado para un rango de peso vivo de entre 30 a 35 kg.DOSIS Y VIA DE ADMINISTRACIÓN: A libre acceso, via oral.   ADVERTENCIAS: Evitar la contaminación del alimento. No almacenar el alimento en lugares húmedos,calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Suspender 7 días antes del sacrificio de los animales destinados al consumo humano.                        \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1578,522,6,'Alimento balanceado medicado con amoxicilina; formulado y elaborado con proteinas,granos de cereales procesados , minerales, vitaminas y aditivos que proporcionan los nutrimentosesenciales para el crecimiento de los cerdos (42 a 77 días de edad).Indicado su uso 7 días para el tratamiento de infecciones baceterianas tales como estreptococosis, pleuroneumonía contagiosa, poliserositis infecciosa, nefritis, cistitis e infecciones del tracto reproductivo.Mantener en todo momento agua potable y fresca para los cerdos. DOSIS Y VIA DE ADMINISTRACIÓN: A libre accedo, vía oral. Bajo prescripción y supervisión delmédico veterinario. ADVERTENCIAS: Evitar la contaminación del alimento. No almacenar el alimento en lugares húmedos,calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Tiempo de retiro: 14 días. No destinar para consumo humano la carne de los animales tratados hasta transcurridos 14 días después de la última admnistración.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1579,523,6,'Alimento balanceado medicado con clortetraciclina y tiamulina; formulado y elaborado con proteinagranos de cereales procesados , minerales, vitaminas y aditivos que proporcionan los nutrimentosesenciales para el crecimiento de los cerdos (42 a 77 días de edad).Indicado su uso 7 días para el tratamiento de problemas respiratorios (neumonía enzoótica,pleuroneumonía, rinitis atrófica, enfermedad Glasser, estreptococosis), problemas digestivos (disenteríaileitis, diarrea post-destete, enteritis no específica, enteriti necrótica), problemas reproductivos (leptospirosis)Mantener en todo momento agua potable y fresca para los cerdos.DOSIS Y VIA DE ADMINISTRACIÓN: A libre acceso, vía oral. Bajo prescripción y supervisión delmedico veterinario.ADVERTENCIAS: Evitar la contaminación del alimento. No almacenar el alimento en lugares húmedos,calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Tiempo de retiro: No se debe administrar 7 días antes del sacrificio de los animales destinadosa consumo humano.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1580,524,6,'Alimento balanceado medicado con oxitetraciclina; formulado y elaborado con proteínas,granos de cereales procesados , minerales, vitaminas y aditivos que proporcionan los nutrimentosesenciales para el crecimiento de los cerdos (42 a 77 días de edad).Indicado su uso de 8 a 10 días para el tratamiento de neumonía enzoótica, leptospirosis y enfermedadescausadas por microorganismos sensibles a la oxitetraciclina. Mantener en todo momento agua potable y fresca para los cerdos.DOSIS Y VIA DE ADMINISTRACIÓN: A libre acceso, vía oral. Bajo prescripción y supervisión delmedico veterinario.ADVERTENCIAS: Evitar la contaminación del alimento. No almacenar el alimento en lugares húmedos,calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes. Tiempo de retiro: No destinar para consumo humano la carne de los animales tratados hastatranscurridos 5 días después de la ultima administración.                     \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1581,525,6,'Alimento balanceado medicado con clortetraciclina y tiamulina para iniciación de cerdos (15 a 42días de edad.) Presentación en pellet que ayuda a consumirlo adecuadamente. Formulado y elaboradocon proteinas, granos de cereales preocesados, minerales, vitaminas y aditivos que proporcionanlos nutrientes necesarios para esta etapa.Indicado su uso 7 días para el tratamiento de problemas respiratorios (neumonía enzoótica,pleuroneumonía, rinitis atrófica, enfermedad de Glasser, estreptococosis), problemas digestivosdisentería, ileitis, diarrea post-destete, enteritis no especifica, enteritis necrótica), problemas reproductivos (leptospirosis).Mantener en todo momento agua potable y fresca para los cerdos.DOSIS Y VIA DE ADMINISTRACIÓN: Proporcionar a libre acceso. Oral. Bajo prescripción y supervisióndel médico veterinario.ADVERTENCIAS: Evitar la contaminación del alimento. No almacenar el alimento en lugares húmedoscalientes, y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animalesDe preferencia, estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Tiempo de retiro: No se debe de admnistrar 7 días antes del saccrificio de los animales destinadosa consumo humano.                  \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1582,526,6,'Alimento balanceado medicado con oxitetraciclina para iniciación de cerdos (15 a 42 días de edad)Presentación en pellet que ayuda a consumirlo adecuadamente. Formulado y elaboradocon proteinas, granos de cereales preocesados, minerales, vitaminas y aditivos que proporcionanlos nutrientes necesarios para esta etapa.Indicado su uso de 8 a 10 días para el tratamiento de neumonía enzoótica, leptospirosis y enfermedadescausadas por microorganismos sensibles a la oxitetraciclina. Mantener en todo momento agua potable y fresca para los cerdos.  DOSIS Y VIA DE ADMINISTRACIÓN: Proporcionar a libre acceso. Oral. Bajo prescripción y supervisióndel médico veterinario.ADVERTENCIAS: Evitar la contaminación del alimento. No almacenar el alimento en lugares húmedoscalientes, y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animalesDe preferencia, estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Tiempo de retiro: No destinar para consumo humano la carne de los animales tratados hasta transcurridos 5 días después de la última administración.                  \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1583,527,6,'Alimento balanceado medicado con amoxicicilina para iniciación de cerdos (15 a 42 días de edad).Presentación en pellet que ayuda a consumirlo adecuadamente. Formulado y elaboradocon proteinas, granos de cereales preocesados, minerales, vitaminas y aditivos que proporcionanlos nutrientes necesarios para esta etapa.Indicado su uso 7 días para el tratamiento de infecciones bacterianas tales como estreptococosis,pleuroneumonía contagiosa, poliserositis infecciosa, nefritis, cistitis e infecciones del tracto reproductivo.Mantener en todo momento agua potable y fresca para los cerdos.  DOSIS Y VIA DE ADMINISTRACIÓN: Proporcionar a libre acceso. Oral. Bajo prescripción y supervisióndel médico veterinario.ADVERTENCIAS: Evitar la contaminación del alimento. No almacenar el alimento en lugares húmedoscalientes, y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animalesDe preferencia, estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en contacto con paredes.Tiempo de retiro: 14 días. No destinar para consumo humano la carne de los animales tratados hasta transcurridos 14 días después de la última administración.                  \r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
	(1584,528,6,'Alimento formulado y elaborado con proteínas, granos de cereales procesados, minerales, vitaminas y aditivos que proporcionan los nutrimentos esenciales para el inicio de cerdos. Mantener en todo momento agua potable y fresca para los cerdos.USO Y ESPECIES EN LAS QUE SE EMPLEA:Alimento balanceado medicado con Carbadox para iniciación de cerdos de 50 a 70 días de edad.Prohibido para todos los porcinos adultos y además para todas las edades de las demás especies animales destinadas para el consumo humano.Restringido el uso oral únicamente en la primera etapa de desarrollo de los Porcinos, queda prohibido el consumo de sus productos de estos animales. Posteriormente en la etapa final de desarrollo podrán ser para consumo humano.DOSIS Y VIA DE ADMINISTRACIÓNA libre acceso via oral.ADVERTENCIAS:Tratar de evitar la contaminación del alimento. No almacenar el alimento en lugares húmedos,calientes y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia, estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o encontacto con paredes.Este alimento no deberá de usarse en animales de más de 40 kg de peso vivo. Prohibido para todoslos porcinos adultosy además para todas las edades de las demás especies animales destinadas para consumo humano. Restringido el uso oral únicamente en la primera etapa de desarrollo de los porcinos queda prohibido el consumo de sus productos de estos animales, posteriormente en la etapafinal del desarrollo podrán ser para consumo humano.            USO VETERINARIO.\r','2017-07-27 13:25:02','2017-07-27 17:25:02'),
