	(6767,546,2,'Ma?z o sorgo o trigo, harina de trigo, pastas y subproductos de\r\noleaginosas, subproductos de cereales, harina de pescado, carbonato\r\nde calcio, levaduras deshidratadas (Saccharomyces cerevisiae boulardii\r\n4x10e9 UFC/kg), ortofosfato de calcio, sal com?n (cloruro de sodio),\r\nvitaminas: A, D, E, K, B-1, B-2,B-6, B-12, niacina, ?cido pantot?nico,?cido f?lico, biotina, colina, minerales org?nicos (iodo, hierro, cobre,\r\nmagnesio, manganeso, zinc, cobalto), salinomicina 60g/ton, color\r\namarillo #5, enzimas deshidratadas (fitasa: 500 FTU/kg, xilanasa: 1200\r\nU/kg, ? glucanasa: 200 U/kg, celulasa: 200 U/kg, manasa: 1800 U/kg),\r\ncarotenoides naturales.\r\n\r\n','2017-08-03 20:39:15','2017-08-03 20:39:15'),
	(6768,546,4,'10','2017-08-03 20:39:15','2017-08-03 20:39:15'),
	(6769,546,6,'Alimento balanceado medicado  con salinomicina para pollos de engorda de los 22 días de edad al\r\nmercado.\r\nPollo Oro contiene 18% de proteína y pigmentos naturales necesarios para finalizar el pollo de engorda \r\nen explotaciones de traspatio.\r\nEste alimento está diseñado para pollos desde los 22 días de edad al mercado, aportando los \r\nrequerimientos de aminoácidos y energía necesarios para que el pollo crezca sano hasta la etapa de \r\nengorda y finalización.\r\nDOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, desde los 22 días de edad al mercado.\r\nADVERTENCIAS: Suspender el tratamiento 4 días antes del sacrificio de los animales destinados para el \r\nconsumo humano. No debe utilizarse como tratamiento curativo. No debe ser administrado a aves de postura\r\nNo almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y \r\nprotegidos de roedores, insectos y otros animales.\r\nEstibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con \r\nparedes.\r\n','2017-08-03 20:39:15','2017-08-03 20:39:15'),
