	(6779,547,1,'A-0544-620','2017-08-03 21:08:34','2017-08-03 21:08:34'),
	(6780,547,2,'Ma?z o sorgo o trigo, harina de trigo, pastas y subproductos de oleaginosas, \r\nsubproductos de cereales, harina de pescado, carbonato de calcio, \r\nsubproductos de cereales, harina de pescado, carbonato de calcio, 	levaduras deshidratadas (Saccharomyces cerevisiae boulardii 4x10e9 	 UFC/kg), ortofosfato de calcio, sal com?n (cloruro de sodio), vitaminas:	A, D, E, K, B-1, B-2,B-6, B-12, niacina, ?cido pantot?nico, ?cido f?lico, biotina, 	colina, minerales org?nicos (iodo, hierro, cobre, magnesio, manganeso, 	zinc, cobalto), monensina 100 g/ton, color amarillo #5, enzimas 	deshidratadas (fitasa: 500 FTU/kg, xilanasa: 1200 U/kg, ? glucanasa: 200 U/kg, 	celulasa: 200 U/kg, manasa: 1800 U/kg), carotenoides naturales. \r\n','2017-08-03 21:08:34','2017-08-03 21:08:34'),
	(6781,547,4,'10','2017-08-03 21:08:34','2017-08-03 21:08:34'),
	(6782,547,6,'Alimento balanceado medicado para pollitos de engorda durante los primeros 21 días de edad.	POLLITO ESPECIAL alimento completo para pollos de engorda a partir de 1 a 21 días de edad, que 	satisface las necesidades nutricionales de las aves en explotaciones de tipo familiar. Aporta los 	requerimientos de aminoácidos y energía necesarios para que el pollito crezca sano hasta la etapa de 	engorda.	Mantenga una temperatura constante 33 °C la primera semana de vida, suministre agua limpia y 	alimento a libertad.	 	Programa de alimentación: Para óptimo resultado se sugiere utilizar el programa completo de 	alimentación para pollo de engorda, haciendo el cambio de alimento en forma gradual.	PRODUCTO: Pollito Especial. RECOMENDACIÓN: 1 a 21 días de edad.	PRODUCTO: Pollo Especial. RECOMENDACIÓN: 22 días de vida hasta salida al mercado.	 	DOSIS Y VIA DE ADMINISTRACION: a libre acceso vía oral, durante los primeros 21 días de edad.	 	ADVERTENCIAS: Suspender el alimento 3 días antes del sacrificio de los animales destinados para el 	consumo humano. No se administre a equinos.	No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y 	protegidos de roedores, insectos y otros animales. Estibar sobre tarimas y nunca dejar el alimento 	directamente sobre el suelo y/o en contacto con paredes.\r\n','2017-08-03 21:08:34','2017-08-03 21:08:34'),
