VALUES
	('8728X',' ',' ','O28','INICIO 1',' ',' ','Alimento iniciador medicado con febendazol para cerdos','Autorización SAGARPA','A-0544-642',' ','18%','2.9%','12.0%','3.5%','10.0%','53.6%','V0001','Granos de cereales procesados (maíz o trigo), pasta de soya tratada, gluten ','de maíz, subproductos de cereales, harina de pescado, aceite vegetal, ','melaza de caña, carbonato de calcio, fosfato de calcio, cloruro de sodio, ','óxido o sulfato de manganeso, sulfato de cobre, óxido de zinc, sulfato de ','cobalto, carbonato o sulfato ferroso, yoduro de potasio o EDDI, óxido de ','cromo, vitaminas A, D, E y K estabilizadas, vitaminas del complejo B, ','vitamina C, cloruro de colina, aminoácidos (lisina o metionina o treonina o ','triptófano), acidificante orgánico (ácido butírico), secuestrante de ','micotoxinas, antioxidante, fungicida, saborizante lácteo frutal sintético, ','levaduras deshidratadas Saccharomyces cerevisiae boulardii (6x10^9 ','UFC/kg), enzimas deshidratadas (fitasa: 500 FTU/kg, o mezcla de xilanasa: ','1200 U/kg, ? glucanasa: 200 U/kg, celulasa: 200 U/kg, manasa: 1800 U/kg), ','febendazol (6 g/ton) como desparasitante.','NO CONTIENE HARINA DE HUESO, CARNE O SANGRE DE RUMIANTES.','     ','INICIO 1 es un alimento balanceado medicado iniciador para cerdos de 43 a 75 días de edad. ','Tiene una presentación en pellet que ayuda al cerdo a consumirlo adecuadamente en esta etapa y ','tener una mejor adaptación, evitando problemas digestivos y así aprovechas todos los nutrimentos ','que su formulación ofrece.','INICIO 1, está formulado y elaborado con proteínas de primera calidad, granos de cereales y ','oleaginosas procesados, que proporcionan los nutrimentos esenciales con alta biodisponibilidad para ','un rápido y eficiente inicio del crecimiento de los cerdos.',' ','Evitar la contaminación del alimento.','Mantener en todo momento agua potable y fresca (ni muy caliente, ni muy fría) para los cerdos.',' ','DOSIS Y VIA DE ADMINISTRACION: Oral a libre acceso.',' ','ADVERTENCIAS: Este alimento no deberá de ofrecerse 28 días antes del sacrificio de los animales ','destinados para consumo humano.','Mantenerlo fuera del alcance de los niños y animales domésticos.','No almacenar el alimento cerca de productos tóxicos, ni en lugares húmedos, calientes y mal ','ventilados, hágalo en sitios secos y protegidos de la luz solar, de roedores, insectos y otros animales.','Estibar de preferencia sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en ','contacto con paredes.',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ','USO VETERINARIO.','CONSULTE AL MEDICO VETERINARIO.','SU VENTA REQUIERE RECETA MÉDICA.','Fecha de caducidad: 3 meses después de la fecha de producción ','8728X','8728XO28INICIO 1  '),
