 150 a 200 gramos al día, dependiendo de la actividad sexual y de su condición ','corporal.','MACHOS EN REPOSO: 100 a 125 gramos, dependiendo de su condición corporal.','Ofrecer a todos los conejos agua desinfectada de buena calidad y siempre a disposición.','ADVERTENCIAS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, ','hágalo en sitios sécos y portegidos de roedores, insectos y otros animales. Estibar sobre tarimas y ','nunca dejar el alimento directamente sobre el suelo y/o en contacto con paredes.  ','Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.','De salida al alimento que tenga mas tiempo en sus bodegas para evitar su envejecimiento','Este alimento no deberá ofrecerse 1 día antes del sacrificio de los animales ','destinados al consumo humano.',' ',' ',' ',' ',' ',' ','CONSULTE AL MEDICO VETERINARIO.','SU VENTA REQUIERE RECETA MÉDICA.','Fecha de caducidad: 3 meses después de la fecha de producción ','6692S','4802H02API-CAMARONALTA DENSIDAD35% DE PROTEINA'),
