	('6319X',' ',' ','D19','REPRODUPORK','MEJORADO',' ','Alimento balanceado medicado con febendazol para cerdos.','Autorización SAGARPA','A-0544-479',' ','14.5%','2.5%','12.0%','8.0%','10.0%','53.0%','V0001','Granos y subproductos de cereales, pastas y subproductos de oleaginosas, ','aceite vegetal, melaza de caña, carbonato de calcio, ortofosfato de calcio, ','cloruro de sodio, óxido o sulfato de manganeso, sulfato de cobre, óxido o ','sulfato de zinc, sulfato de cobalto, carbonato o sulfato ferroso, yoduro de ','potasio o EDDI, óxido de cromo, vitaminas A, D, E y K estabilizadas, ','vitaminas del complejo B, cloruro de colina, aminoácidos (lisina o metionina ','o treonina o triptófano), enzimas deshidratadas (fitasas 500 FTU/kg., o ','xilanasa 1200 U/kg.,?, glucanasa 200 U/kg., celulasa 200 U/kg, manasa 1800 ','U/kg.), saborizante frutal o aromatizante frutal sintéticos, desparasitante ','(6 g/ton de febendazol).',' ',' ',' ',' ',' ','Alimento balanceado medicado para cerdos reproductores  (gestación,  lactancia y sementales).',' ','DOSIS Y VIA DE ADMINISTRACION: ','Hembras gestantes primerizas: Ofrecer de 2 a 2.5 kg/día de acuerdo a la condición corporal.','Hembras gestantes adultas: Ofrecer de 2 a 3.5 kg/día de acuerdo a la condición corporal de la cerda, ','número de parto y tercio de gestación. Una sobrealimentación provocará menor consumo de alimento ','en la lactancia y disminución en la producción de leche. Hembras lactantes: La cantidad de alimento ','depende del peso, de las condiciones ambientales y del número de lechones que esté amamantando. ','Al momento del parto no ofrecer alimento, durante el primer día ofrecer aproximadamente 1/2 kg;  ','después y hasta el día 5 incrementar 1/2 kg más al día, posteriormente la alimentación será a libre ','acceso. Para favorecer el consumo se recomienda alimentar mínimo 2 veces al día (una en la mañana y ','otra en la tarde). Al momento del destete, la cantidad de alimento ofrecido se reduce a 2-2.5 kg ','durante dos