	('4512V',' ',' ','B12','TORO DE LIDIA',' ',' ','Alimento balanceado medicado con monensina para la última fase de preparación','del toro para su lidia','Autorización SAGARPA','A-0544-549','16%','3.0%','12.0%','10.0%','10.0%','49.0%','V0001','Granos de cereales rolados al vapor, pastas y subproductos de oleaginosas, ','subproductos de cereales, melaza de caña, semilla de algodón, harina de ','pescado, grasa de sobrepaso de origen vegetal, carbonato de calcio, ','ortofosfato de calcio, sal común (cloruro de sodio), buffer (bicarbonato de ','sodio u óxido de magnesio), nitrógeno no protéico (máximo 0.5%), ','vitaminas estabilizadas (A, D, E), y complejo B, minerales traza (iodo, ','hierro, cobre, magnesio, manganeso, zinc, cobalto, picolinato de cromo), ','levaduras deshidratadas Saccharomyces cerevisiae','(1 billón UFC/Kg)  monensina sódica (20 g/Ton.).',' ',' ',' ',' ',' ',' ','Alimento balanceado medicado para la última fase de preparación del toro para su lidia.','\"Toro de Lidia está formulado para que el toro sea capaz de realizar un esfuerzo muscular máximo ','durante los 15  20 minutos que dura la lidia. En términos generales, los toros para la fiesta brava no ','están diseñados para realizar esfuerzos musculares intensos y prolongados como lo exige la lidia, sin ','embargo gracias a la selección genética, se han creado animales con determinados factores psíquicos, ','tales como la bravura y la acometividad, por lo que los toros mejor dotados genética y físicamente ','(aquí es donde interviene la alimentación) dan pelea manifestando su bravura y poder hasta el final.','Toro de Lidia está formulado con niveles apropiados de proteína para el toro atleta, contiene ','ingredientes que le proporcionan niveles óptimos de proteína de sobrepaso, su bajo contenido de ','almidón evita el engrasamiento, los niveles elevados de vitamina E, biotina, tiamina, minerales como ','el zinc, en forma de quelato, ingredientes que favorecen el buen estado de cuernos, pezuñas, pelo e ','hígado, este último debe mantenerse en un estado óptimo de salud para que durante la lidia, el toro ','pueda obtener energía suficiente.','Toro de Lidia está formulado con niveles elevados de fibra digestible para mantener el buen estado ','del rumen y evitar la acidosis que provoca lesiones en pezuñas, afectando el desempeño del toro. ','Contiene picolinato de cromo, mineral que disminuye el engrasamiento y favorece la acción de la ','insulina, hormona involucrada en la obtención de energía. ','Evitar el excesivo manejo de los animales durante el encajonamiento, transporte, ','desencajone y pesaje, reconocimiento, etc. para disminuir la movilización del glucógeno que es la ','fuente de energía almacenada en músculo e hígado que puede ser utilizada por el toro de inmediato. ','Durante toda la crianza ofrecer al ganado sales minerales con calcio y fósforo, durante la época de ','estiaje ofrecer al pie de cría de acuerdo a la severidad de la misma 1 a 2 kg animal/día del alimento ','Toro de Lidia.','La fase de preparación para la plaza puede durar de 3 a 6 meses dependiendo del desarrollo óseo y ','peso del animal. Esta etapa no debe tener una duración menor a 3 meses.','DOSIS Y VIA DE ADMINISTRACIÓN: Oral. De 4 a 8 kg por cabeza por día dependiendo del ','peso inicial, así como la calidad del forraje el cual debe estar siempre presente.','ADVERTENCIAS: Retirar el alimento 3 dias previos al sacrificio de los animales destinados al ','consumo humano.',' ',' ',' ',' ',' ','USO VETERINARIO.','CONSULTE AL MEDICO VETERINARIO ','SU VENTA REQUIERE RECETA MÉDICA.','Fecha de caducidad: 3 meses después de la fecha de producción ','4512V','4512VB12TORO DE LIDIA  '),
