	('4479V',' ',' ','B79','DAIRY ROL',' ',' ','Alimento balanceado medicado con monensina para vacas altas productoras','Autorización SAGARPA','A-0544-541',' ','18%','4.0%','12.0%','7.0%','8.0%','51.0%','V0001','Maíz o sorgo o cebada rolados con vapor, pastas de oleaginosas, gluten de ','maíz, harina de pescado, subproductos de cereales, semilla de algodón, ','grasa de sobrepaso de origen vegetal, melaza de caña, nitrógeno no ','proteico (máximo 0.5 %), buffer (bicarbonato de sodio y óxido de ','magnesio), carbonato de calcio, ortofosfato de calcio, cloruro de sodio, ','yodo, sulfato ferroso, sulfato de cobre, sulfato de magnesio, sulfato de ','manganeso, sulfato de zinc, carbonato de cobalto, y vitaminas A, D y E ','estabilizadas, levaduras deshidratadas Saccharomyces cerevisiae (1 billón ','UFC/kg), monensina sódica (20 g/ton).',' ',' ',' ',' ',' ',' ','Alimento balanceado medicado con monensina para vacas altas productoras.','DAIRY ROL es un alimento diseñado para vacas altas productoras con potencial genético. Está ','elaborado con ingredientes que aportan proteína de sobrepaso 100% de origen vegetal, (no contiene ','harina de carne o sangre), con lo que se eliminan los riesgos que conlleva usar proteínas de origen ','animal mal procesados.','El DAIRY ROL ofrece una excelente fuente de lisina y metionina. Cubre los requerimientos de energía ','de las vacas altas productoras mediante el uso de grasa de sobrepaso, cuyo origen es 100% vegetal.','Los minerales usados en la elaboración del DAIRY ROL son quelatados, por ejemplo el selenio, el cual ','mejora los parámetros reproductivos y la metionina de zinc que disminuye la incidencia de mastitis y ','problemas de patas.','A DAIRY ROL se le adiciona cultivo de levaduras, buffers y modificadores de la fermentación, lo cual ','favorece la producción controlada de ácido propiónico reduciendo el peligro de acidosis por el alto ','consumo de concentrado.','Mantener en todo momento agua limpia y fresca. ',' ','DOSIS Y VIA DE ADMINISTRACION: Oral. Como guía para su uso se debe considerar la calidad del ','forraje; cuando se esté suministrando forraje de excelente calidad, ofrecer 1 kg de DAIRY ROL por cada ','3 lts. de leche producida, si el forraje es de mediana calidad se ofrecerá 1 kg de DAIRY ROL por cada 2.5 ','lts. de leche producida. La cantidad total de DAIRY ROL se repartirá uniformemente en el número total ','de comidas servidas en el día, intercalando forraje en cada servida de concentrado.','Para formulación especial de ración integral con el uso de este alimento, favor de contactar con el ','Servicio Técnico de maltaCleyton.',' ','ADVERTENCIAS: Suspender el consumo 3 días antes del sacrificio de los animales destinados para ','consumo humano.','No se administre a equinos.','No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en sitios secos y ','protegidos de roedores, insectos y otros animales.','Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con ','paredes.','Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento y','pérdida de propiedades nutrimentales.',' ',' ','USO VETERINARIO.','CONSULTE AL MEDICO VETERINARIO.','SU VENTA REQUIERE RECETA MÉDICA.','Fecha de caducidad: 3 meses después de la fecha de producción ','4479V','4479VB79DAIRY ROL  ');
