	('4350T',' ',' ','D50','CARNERINA','FINALIZADOR ENGORDA','CERDOS H.L.','Alimento balanceado medicado con ractopamina para finalización de cerdos.','Autorización SAGARPA','A-0544-778','','16.0%','3.0%','12.0%','4.0%','7.0%','58.0%','V0001','Granos y subproductos de cereales, pastas y subproductos de oleaginosas,','aceite vegetal, melaza de caña, carbonato de calcio, ortofosfato de calcio, ','cloruro de sodio, óxido o sulfato de manganeso, sulfato de cobre, óxido o ','sulfato de zinc, sulfato de cobalto, carbonato o sulfato ferroso, yoduro de ','potasio o EDDI, selenio orgánico, cromo orgánico, vitaminas A, D, E y K','estabilizadas, vitaminas del complejo B, aminoácidos (lisina, metionina, ','treonina, triptófano), aluminosilicatos y arcillas como secuestrante de ','micotoxinas (3 kg/ton), ácido propiónico y ácido acético como fungicida, ','enzimas deshidratadas (fitasa 500 FTU/kg, xilanasa 1200 U/kg, ? glucanasa: ','200 U/kg, celulasa 200 U/kg, manasa 1800 U/kg ), saborizante o','aromatizante frutal sintético, ractopamina (10 g/ton).','   ','    ','    ','   ','Alimento balanceado medicado con ractopamina para finalización de cerdos (últimos 28 días de la engorda),','en presentación de pellet que ayuda a consumirlo adecuadamente. Formulado y elaborado con proteínas, ','granos de cereales procesados, minerales, vitaminas y aditivos que proporcionan los nutrientes ','necesarios para la  finalización de los cerdos , ayudando a mejorar los parámetros productivos, el ','rendimiento y calidad de la canal.','Mantener en todo momento agua potable y fresca para los cerdos.','DOSIS Y VIA DE ADMINISTRACION: Proporcionar a libre acceso. Oral. ','ADVERTENCIAS: Tratar de evitar la contaminación del alimento. No almacenar el alimento en lugares','húmedos, calientes, y mal ventilados, hágalo en sitios secos y protegidos de roedores, insectos y otros','animales. De preferencia, estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en ','contacto con paredes.','Este alimento no requiere periodo de retiro antes del sacrificio de los animales destinados al consumo humano.','   ','   ','   ','   ','  ','  ','   ','   ','   ','  ','   ','   ','   ','   ','   ','   ','    ','     ','     ','     ','    ','USO VETERINARIO.','CONSULTE AL MEDICO VETERINARIO.','SU VENTA REQUIERE RECETA MÉDICA CUANTIFICADA','Y PARA USO EXCLUSIVO DEL MEDICO VETERINARIO','Fecha de caducidad: 3 meses después de la fecha de producción ','4350T','4350TD50CARNERINAFINALIZADOR ENGORDACERDOS H.L.'),
	('4319X',' ',' ','D19','REPRODUPORK','MEJORADO',' ','Alimento balanceado medicado con febendazol para cerdos.','Autorización SAGARPA','A-0544-479',' ','14.5%','2.5%','12.0%','8.0%','10.0%','53.0%','V0001','Granos y subproductos de cereales, pastas y subproductos de oleaginosas, ','aceite vegetal, melaza de caña, carbonato de calcio, ortofosfato de calcio, ','cloruro de sodio, óxido o sulfato de manganeso, sulfato de cobre, óxido o ','sulfato de zinc, sulfato de cobalto, carbonato o sulfato ferroso, yoduro de ','potasio o EDDI, óxido de cromo, vitaminas A, D, E y K estabilizadas, ','vitaminas del complejo B, cloruro de colina, aminoácidos (lisina o metionina ','o treonina o triptófano), enzimas deshidratadas (fitasas 500 FTU/kg., o ','xilanasa 1200 U/kg.,?, glucanasa 200 U/kg., celulasa 200 U/kg, manasa 1800 ','U/kg.), saborizante frutal o aromatizante frutal sintéticos, desparasitante ','(6 g/ton de febendazol).',' ',' ',' ',' ',' ','Alimento balanceado medicado para cerdos reproductores  (gestación,  lactancia y sementales).',' ','DOSIS Y VIA DE ADMINISTRACION: ','Hembras gestantes primerizas: Ofrecer de 2 a 2.5 kg/día de acuerdo a la condición corporal.','Hembras gestantes adultas: Ofrecer de 2 a 3.5 kg/día de acuerdo a la condición corporal de la cerda, ','número de parto y tercio de gestación. Una sobrealimentación provocará menor consumo de alimento ','en la lactancia y disminución en la producción de leche. Hembras lactantes: La cantidad de alimento ','depende del peso, de las condiciones ambientales y del número de lechones que esté amamantando. ','Al momento del parto no ofrecer alimento, durante el primer día ofrecer aproximadamente 1/2 kg;  ','después y hasta el día 5 incrementar 1/2 kg más al día, posteriormente la alimentación será a libre ','acceso. Para favorecer el consumo se recomienda alimentar mínimo 2 veces al día (una en la mañana y ','otra en la tarde). Al momento del destete, la cantidad de alimento ofrecido se reduce a 2-2.5 kg ','durante dos o tres días, posteriormente se les ofrece de 3 a 3.5 kg y hasta la cubrición. Cuando una ','hembra sale muy delgada de la lactancia, se le puede ofrecer alimento a libre acceso con la finalidad ','de que recupere más rápido sus reservas y pueda entrar más pronto en celo.','Sementales: Ofrecer de 2 a 3 kg al día, de acuerdo a la condición corporal y a la actividad reproductiva. ','La alimentación es restringida para evitar engrasamiento y baja en sus aptitudes para la reproducción.',' ','ADVERTENCIAS: ','No almacenar en lugares húmedos, calientes, y mal ventilados, hágalo en sitios secos y protegido de ','roedores, insectos y otros animales.','De preferencia estibar sobre tarimas y no dejar el alimento directamente sobre el suelo y/o en ','contacto con paredes.','Este alimento no deberá de ofrecerse 5 días antes del sacrificio de los animales destinados para ','consumo humano.',' ',' ',' ',' ',' ',' ',' ',' ',' ','USO VETERINARIO.','CONSULTE AL MEDICO VETERINARIO.','SU VENTA REQUIERE RECETA MÉDICA.','Fecha de caducidad: 3 meses después de la fecha de producción ','4319X','4319XD19REPRODUPORKMEJORADO '),
