	('2489V','','','I89','JOVIS MIX',' ',' ','Alimento balanceado medicado con monensina para becerras destetadas','Autorización SAGARPA','A-0544-764',' ','28.0%','2.0%','12.0%','14.0%','9.0%','35.0%','V0001','Pasta de soya, pasta de canola, pasta de cártamo, gluten de maíz, salvado ','de trigo, cascarilla de soya, subproductos de cereales y oleaginosas, ','granos de cereales (maíz, sorgo), melaza de caña, aceite vegetal, ','carbonato de calcio, fosfato de calcio, cloruro de sodio, azufre, manganeso, ','fierro, cobre, zinc, iodo, selenio, cobalto, vitaminas A, D y E, saborizante ','frutal artificial, ácido propiónico y acético como fungicida, monensina ','sódica (40 g/ton).',' ',' ',' ',' ',' ',' ',' ',' ','Alimento balanceado medicado con monensina para becerras; indicado para prevención de la ','coccidiosis causada por Eimeria bovis y E. zoemmi, para mejorar la ganancia de peso y la conversión ','alimenticia. Se utiliza después del destete, en seguida del alimento iniciador (1ª edad).','USO Y ESPECIES EN LAS QUE SE EMPLEA: Bovinos. Para becerras destetadas.','DOSIS Y VIA DE ADMINISTRACION: Oral. Se utiliza después del destete, en seguida del alimento ','iniciador (1º de edad). ','Usar de 1 kg a 2 kg/becerra/día únicamente con fibra o puede utilizarse mezclado con granos ','disponibles (maíz, avena, cebada) 60  70% de Jovix Mix y 30-40% de granos. Mantener una fuente ','sabrosa de fibra a libre disposición de los animales. ','Para mayor información del uso del alimento, favor de  contactar con el servicio técnico de ','maltaCletyon®. Mantener en todo momento agua limpia y fresca para las becerras.','ADVERTENCIAS: Inútil cualquier programa de alimentación o sanitario si las crías no reciben calostro ','durante las primeras 8 horas de vida. Mantenga siempre agua limpia y fresca disponible en la crianza. ','Ofrezca el alimento diariamente y no permita que consuman alimento del día anterior o alimento en ','mal estado. No almacene este alimento en lugares húmedos, mal ventilados o calientes. Colóquelo ','en sitios secos y al abrigo de la luz solar directa, de roedores, insectos y otros animales nocivos al ','alimento. Estíbelo sobre tarimas o polines y  nunca directamente sobre el suelo para evitar que ','que absorba humedad. Evite el acceso a sus bodegas a personas extrañas y toda clase de animales.','Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento. ','Suspender el consumo 3 días antes del sacrificio de animales para consumo humano. No se ','administre a Equinos.',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ','  ',' ','','SU VENTA REQUIERE RECETA MÉDICA.','CONSULTE AL MEDICO VETERINARIO.','Fecha de caducidad: 3 meses después de la fecha de producción ','2489V','2489VI89JOVIS MIX  ');
