	('6438',' ',' ','B38','LECHERO 21%',' ',' ','Alimento balanceado  para vacas lecheras ','Autorización SAGARPA','A-0544-488',' ','21%','2.0%','12.0%','10.0%','10.0%','45.0%','V0001','Granos de cereales rolados (maíz o sorgo), subproductos de cereales ','(salvado de trigo, salvado de maíz, pulido de arroz, cascarillas), pastas de ','oleaginosas (soya, canola, cártamo), subproductos de oleaginosas, melaza ','de caña, semilla de algodón, nitrógeno no proteico (máximo 1.5%), ','carbonato de calcio, ortofosfato de calcio, sal común (cloruro de sodio).',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ','Alimento balanceado con semilla de algodón, para vacas lecheras en producción.','LECHERO 21% es un producto diseñado para vacas productoras de leche que por sus necesidades de ','producción necesitan ser alimentadas con proteína suplementaria de alta calidad, que el forraje no ','puede proporcionarles y al mismo tiempo la energía necesaria para lograr una mayor producción de ','leche sin sacrificar la condición corporal del ganado y sin afectar parámetros producidos. Por las ','características de los ingredientes que conforman este alimento dentro de su fracción proteica, tienen ','la ventaja de estar incluidos justo a las necesidades de fermentación ruminal como son soya, canola, ','cártamo, salvado de trigo y semilla de algodón; en proporciones que al iniciar su degradación lo hacen ','de manera controlada, degradándose en diferente tiempo en función de la disponibilidad de las ','fuentes energéticas permitiendo una mayor eficiencia ruminal aprovechando los nutrientes de los ','forrajes para lograr una mayor producción de leche.',' ','DOSIS Y VIA DE ADMINISTRACION: Guía de alimentación con Lechero 21% de acuerdo a la producción ','de leche promedio por vaca*** ','CALIDAD DE PASTURA kg de materia seca: MALA (fibrosa) marca 5% de proteína más 50% FND** ','PRODUCCIÓN DE LECHE (lts): Más de 20 kg concentrado / forraje: 12-14 / 10-12                                      ','Entre 10 y 15 kg concentrado/ forraje: 8-10 / 10-12                                                                                        ','Menos de 10 kg concentrado / forraje: 4-6 / 8-10','CALIDAD DE PASTURA kg de materia seca: REGULAR (más o menos fibrosa). Entre 8-10% de proteína. ','Entre 40-50% FND                                                                                                                                   ','PRODUCCIÓN DE LECHE (lts): Más de 20 kg concentrado / forraje: 10-12 / 10-14                                      ','Entre 10 y 15 kg concentrado/ forraje: 6-8 / 12-14                                                                                          ','Menos de 10 kg concentrado / forraje: 3-5 / 8-10','CALIDAD DE PASTURA kg de materia seca: BUENA (más hoja que tallo).','Más 15% de proteína. Menos 40% FND','PRODUCCIÓN DE LECHE (lts): Más de 20 kg concentrado / forraje: 8-10 / 12-14                                       ','Entre 10 y 15 kg concentrado/ forraje: 4-6 / 12-13                                                                                          ','Menos de 10 kg concentrado / forraje: 1-3 / 8-10','*Para producciones superiores a 25 lts consulte a nuestro asesor pecuario.','** FND (Fibra Neutro Detergente).','*** Cantidades sujetas a tipos de forrajes, condición de animales y ambiente.','ADVERTENCIAS: No almacenar  el alimento en lugares húmedos, calientes, y mal ventilados,','hágalo en sitios secos y protegidos de roedores, insectos y otros animales. De preferencia','estibar sobre tarimas y no dejar el alimento directamente sobre el ','suelo o en contacto con paredes.',' ','CONSULTE AL MEDICO VETERINARIO.','Fecha de caducidad: 3 meses después de la fecha de producción ','6438','6438B38LECHERO 21%  '),
