	('6407',' ',' ','B07','ABABE PLUS',' ',' ','Alimento para becerros y terneras','Autorización SAGARPA','A-0544-139',' ','20%','2.0%','12.0%','8.0%','8.0%','50.0%','V0001','Maíz o sorgo, subproductos lácteos de origen bovino, pastas de oleaginosas,','harina de pescado, aceite vegetal, gluten de maíz 60%, subproductos de ','cereales, vitaminas liposolubles A, D, E y K, vitaminas hidrosolubles, tiamina, ','piridoxina, ácido pantoténico, ribloflavina, cianocobalamina, ácido fólico, ','inositol, carbonato de calcio, cloruro de sodio, fosfato de calcio, yoduro de ','potasio, sulfato ferroso, sulfato de magnesio, sulfato de manganeso, sulfato ','de cobre, óxido de zinc, cobre, zinc y selenio quelatados.',' ',' ',' ',' ',' ',' ',' ',' ','ABABE PLUS es el primer alimento seco para becerros y terneras, empiece a suministrarlo desde los 5 ','días de edad en pequeñas cantidades de 10 a 12 g adicionales al día, aparte de su ración diaria de leche ','más agua.',' ','Los primeros días, coloque en la boca del animal unos cuantos comprimidos frescos (no sobrantes del ','pesebre) hasta que se acostumbre a comerlo. El objeto de esta reducida cantidad de ABABE PLUS es el ','promover consumo de alimento sólido a temprana edad para estimular la actividad del Rumen. ',' ','Una vez que se ha acostumbrado a comerlo, ponga al alcance de la ternera en comedero limpio ABABE ','PLUS para que lo consuma por sí sola. A las 4 ó 5 semanas de edad, su consumo deberá haber ','aumentado hasta 500g diarios aproximadamente y a la 6ª ó 7ª semana en unos 800g al día.','De la 7ª semana en adelante su consumo debe ser gradualmente mayor, hasta que el animal a los 4 ','meses de edad esté comiendo de 2 a 2 ½ kg al día.',' ','Recuerde que desde la 8ª semana de edad, debe proporcionar forrajes secos de leguminosas (alfalfa o ','trébol) de buena calidad y forrajes húmedos hasta los 6 meses. No debe faltar agua potable, limpia y ','fresca siempre al alcance de los animales.',' ','ADVERTENCIAS: No almacene este alimento en lugares húmedos, mal ventilados o calientes, ','almacénelo en sitios secos y al abrigo de la luz solar directa, libre de roedores, insectos y otros ','animales nocivos.','Estíbelo sobre tarimas o polines pero nunca directamente sobre el suelo y se evitará que el alimento ','absorba humedad del suelo.','Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ','USO VETERINARIO.','CONSULTE AL MEDICO VETERINARIO.','Fecha de caducidad: 3 meses después de la fecha de producción ','6407','6407B07ABABE PLUS  ');
