	('6404',' ',' ','B04','VACAS SECAS',' ',' ','USO VETERINARIO','Autorización SAGARPA','A-0544-516',' ','14%','2.5%','12.0%','11.0%','8.0%','52.5%','V0001','Granos de cereales (maíz o sorgo o trigo), subproductos de cereales ','(salvado de trigo, salvado de maíz, pulido de arroz), pastas de oleaginosas ','(soya, canola, cártamo), subproductos de oleaginosas, melaza de caña, ','carbonato de calcio, ortofosfato de calcio, sal común (cloruro de sodio), ','nitrógeno no protéico (máximo 1.0%), vitaminas estabilizadas (A, D, E), ','minerales traza (iodo, hierro, cobre, magnesio, manganeso, zinc, cobalto).',' ',' ',' ',' ',' ',' ',' ',' ',' ','Alimento Balanceado para vacas Secas','Este producto es un alimento científicamente balanceado que satisface las necesidades de las hembras ','jóvenes en gestación y vacas adultas secas.','VACAS SECAS desarrolla animales normales vigorosos en buen estado de carnes, sin grasa superflua ','preparándolos adecuadamente para sus funciones de reproducción y producción lechera futura.',' ','A las vacas jóvenes como a las adultas secas en gestación, les proporciona los nutrientes necesarios ','para ella y el becerro en formación, conservándolas en las mejores condiciones para su parto sano.','Mantener en todo momento agua limpia y fresca para su ganado','DOSIS Y VIA DE ADMINISTRACION: Oral Ofrecer VACAS SECAS a razón de 1 a 3 % del peso','vivo de acuerdo a la etapa del animal.','A los 4 o 5 días del parto, sustituya gradualmente VACAS SECAS por el alimento ','para vacas productoras según las necesidades de los animales y de acuerdo a los forrajes ','que suministren.','ADVERTENCIAS','No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hágalo en ','sitios secos y protegidos de roedores, insectos y otros animales. De preferencia estibar sobre tarimas','y no dejar el alimento directamente sobre el suelo o en contacto con paredes.',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ','CONSULTE AL MEDICO VETERINARIO','Fecha de caducidad: 3 meses después de la fecha de producción ','6404','6404B04VACAS SECAS  '),
