	('5629',' ',' ','C29','CABALLO ','GANADOR 12 %',' ','Alimento para caballo','Autorización SAGARPA','A-0544-807',' ','12%','3.0%','12.0%','9.5%','8.0%','55.5%','V0001','Maíz o sorgo, avena, cebada, aceite vegetal, melaza, pastas y subproductos ','de oleaginosas, gluten de maíz, harina de alfalfa deshidratada, salvado, ','acemite, pulido de arroz, vitaminas A y D, E y K, tiamina, riboflavina, ','Biotina, ácido fólico, niacina, ácido pantoténico, vitamina B 12, carbonato de ','calcio, cloruro de sodio, fosfato de calcio, yodo, sulfato ferroso, sulfato de ','cobre, sulfato de magnesio, sulfato de manganeso y óxido de zinc, cromo y ','selenio orgánico. Pellet salvado de trigo, salvado de maíz pulido de arroz, maíz','melaza de caña, cascarilla de avena, levaduras deshidratadas ','(Saccharomyces cerevisiae boulardii 4x10^9 UFC/kg)',' ',' ',' ',' ',' ',' ','CABALLO GANADOR 12 % es un alimento ideal para caballos, pues además de estar elaborado con ','selectos granos; contiene todas las vitaminas y minerales que el organismo del animal requiere ','para mantenerse en las mejores condiciones.Su presentación facilita su consumo y ofrece ventajas como su mejor','aprovechamiento pues al suministrar los granos molidos sin su cubierta se dirigen mejor que los granos enteros y','no irrita la mucosa de la nariz de los caballos como lo hacen las harinas.Caballo Ganador 12% es un alimento','balanceado para caballos de Alto Desempeño, elaborado con los más selectos ingredientes, enriquecido con','vitaminas y minerales para que el equino se mantenga en óptimas condiciones. Su procesamiento ofrece cualidades','como mayor digestibilidad y aumeento de la palatabilidad, ya que los granos son sometidos a un cocimiento ','antes de ser rolados o peletizados, lo cual aumenta su valor nutritivo. DOSIS Y VIA DE ADMINITRACION.Oral','CABALLO GANADOR 12% , debe comenzar a suministrarse en forma paulatina desde los doce meses de ','edad, además de la alfalfa o pastos que consumen en la pradera. CABALLOS DE CHARRERIA: Suministre ','la ración de CABALLO GANADOR 12%  repartida en tres porciones durante el día: de 1.5 a 2.0 kg por la ','mañana, 0.5 a 1.0 kg al medio día y de 1.0  a 1.5 kg por la tarde, complementar su dieta con heno de ','buena calidad. CABALLOS DE CARRERA, POLO , ADIESTRAMIENTO , se recomienda dar el concentrado ','repartido en tres raciones durante el día de la siguiente forma; Dar de 1.5 a 2.0 kg de CABALLO ','GANADOR 12 % con el primer pienso , cuatro horas antes del entrenamiento o después de efectuar ','este, siempre y cuando el animal se encuentre en reposo o sin síntomas de fatiga. La segunda porción ','de CABALLO GANADOR 12 % debe darse al medio día con el pienso, en una cantidad no mayor a ½ kg a ','1.0 kg. La tercera porción de CABALLO GANADOR 12 % se debe dar con el pienso al final de la tarde en ','una cantidad 1.0 a 1.5 kg dependiendo del trabajo realizado. HEMBRAS EN GESTACIÓN: Durante los 8 ','primeros meses suministre de 2 a 3 Kg de CABALLO GANADOR 12% diarios, divididos en tres','porciones durante el día, dependiendo de las condiciones de la yegua y calidad de forrajes.','HEMBRAS DURANTE LA LACTANCIA: Aumente la ración de CABALLO GANADOR 12% hasta 4 ó 6 Kg.','diarios. El suministro del agua en relación al alimento, se recomienda dar de 12 a 15 litros al día pero','que no esté muy fría para evitar cólicos. Es conveniente dar primero el forraje, después el agua y','por último CABALLO GANADOR 12%. En caso de dar el CABALLO GANADOR 12% junto con el forraje','es preferible dar el agua para facilitar la digestión. Para desarrollar mejores caballos suministre','antes del destete y desde los 15 días de edad Royal Horse B300,  el primer alimento seco que','deben comer los potrillos comenzando con unos cuantos comprimidos y aumentando','gradualmente hasta llegar a 2 o 2.5 Kg. de Royal Horse B-300 al 5° ó 6° mes de edad para sustituir ','Royal Horse B  300 paulatinamente poco antes de los 12 meses de edad por CABALLO GANADOR 12%','ADVERTENCIAS: No almacenar  el alimento en lugares húmedos, calientes, y mal ventilados,','hágalo en sitios secos y protegidos de roedores, insectos y otros animales.Estibar sobre tarimas y no dejar el ','alimento directamente sobre el suelo y/o en contacto con paredes.Evite el ','acceso a sus bodegas a pesonas extrañas y toda clase de animales. Dé salida al alimento que tenga más tiempo','en sus bodegas para evitar su envejecimiento.','USO VETERINARIO            CONSULTE AL MEDICO VETERINARIO.','Fecha de caducidad: 6 meses después de la fecha de producción ','5629','5629C29CABALLO GANADOR 12 % '),
