	('4438',' ',' ','B38','LECHERO 21%',' ',' ','Alimento balanceado  para vacas lecheras ','Autorización SAGARPA','A-0544-488',' ','21%','2.0%','12.0%','10.0%','10.0%','45.0%','V0001','Granos de cereales rolados (maíz o sorgo), subproductos de cereales ','(salvado de trigo, salvado de maíz, pulido de arroz, cascarillas), pastas de ','oleaginosas (soya, canola, cártamo), subproductos de oleaginosas, melaza ','de caña, semilla de algodón, nitrógeno no proteico (máximo 1.5%), ','carbonato de calcio, ortofosfato de calcio, sal común (cloruro de sodio).',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ','Alimento balanceado con semilla de algodón, para vacas lecheras en producción.','LECHERO 21% es un producto diseñado para vacas productoras de leche que por sus necesidades de ','producción necesitan ser alimentadas con proteína suplementaria de alta calidad, que el forraje no ','puede proporcionarles y al mismo tiempo la energía necesaria para lograr una mayor producción de ','leche sin sacrificar la condición corporal del ganado y sin afectar parámetros producidos. Por las ','características de los ingredientes que conforman este alimento dentro de su fracción proteica, tienen ','la ventaja de estar incluidos justo a las necesidades de fermentación ruminal como son soya, canola, ','cártamo, salvado de trigo y semilla de algodón; en proporciones que al iniciar su degradación lo hacen ','de manera controlada, degradándose en diferente tiempo en función de la disponibilidad de las ','fuentes energéticas permitiendo una mayor eficiencia ruminal aprovechando los nutrientes de los ','forrajes para lograr una mayor producción de leche.',' ','DOSIS Y VIA DE ADMINISTRACION: Guía de alimentación con Lechero 21% de acuerdo a la producción ','de leche promedio por vaca*** ','CALIDAD DE PASTURA kg de materia seca: MALA (fibrosa) marca 5% de proteína más 50% FND** ','PRODUCCIÓN DE LECHE (lts): Más de 20 kg concentrado / forraje: 12-14 / 10-12                                      ','Entre 10 y 1