	('4410',' ',' ','B10','APILECHE 17% ',' ',' ','Alimento balanceado medicado con monensina para vacas lecheras','Autorización SAGARPA','A-0544-518',' ','17%','3.0%','12.0%','9.0%','9.0%','50.0%','V0001','Maíz o sorgo, pastas y subproductos de oleaginosas, subproductos de ','cereales, melaza de caña, semilla de algodón, nitrógeno no protéico (1.5% ','máximo), grasa de sobrepaso de origen vegetal, carbonato de calcio, ','ortofosfato de calcio, sal común (cloruro de sodio), buffer (bicarbonato de ','sodio u óxido de magnesio), vitaminas estabilizadas (A, D, E), minerales ','traza (iodo, hierro, cobre, magnesio, manganeso, zinc, selenio, cobalto), ','monensina sódica (20 g/Ton.).',' ',' ',' ',' ',' ',' ',' ',' ','Alimento balanceado medicado con monenisina para vacas lecheras','APILECHE 17%, es un alimento diseñado, formulado y elaborado con ingredientes de excelente calidad, ','que proveen los nutrimentos necesarios y de fácil digestión para vacas lecheras en producción. Este ','alimento es un concentrado, por lo que además deben de suministrarse forrajes de buena calidad (que ','nos aporta fibra necesaria para una buena digestión).','Mantener en todo momento agua limpia y fresca.','DOSIS Y ADMINISTRACION:Oral.La cantidad a ofrecer de este alimento depende además','de otros factores, de la producción promedio de leche:','Se recomienda ofrecer 1 kilo de este alimento por 3 litros de leche producida','Para formulación especial de racion integral con el uso de este alimento favor de contactar al ','servicio Tecnico de maltacleyton','ADVERTENCIAS: Suspender el consumo 3 dias antes del sacrificio para el consumo humano ','No se administre a Equinos','No almacenar el alimento en lugares húmedos, calientes y mal ventilados, hagalo en sitios secos','y protegidos de roedores, insectos y otros animales.','Estibar sobre tarimasy nunca dejar el alimento directamente en el suelo y/o en contacto con paredes','Dé salida al alimento que tenga más tiempo en sus bodegas para evitar el envejecimiento y pérdida','de propiedades nutrimentales.','','','','','','','',' ',' ',' ',' ',' ',' ',' ',' ',' ','USO VETERINARIO.','CONSULTE AL MEDICO VETERINARIO.','SU VENTA REQUIERE RECETA MÉDICA.','Fecha de caducidad: 3 meses después de la fecha de producción ','4410','4410B10APILECHE 17%   '),
	('4407',' ',' ','B07','ABABE PLUS',' ',' ','Alimento para becerros y terneras','Autorización SAGARPA','A-0544-139',' ','20%','2.0%','12.0%','8.0%','8.0%','50.0%','V0001','Maíz o sorgo, subproductos lácteos de origen bovino, pastas de oleaginosas,','harina de pescado, aceite vegetal, gluten de maíz 60%, subproductos de ','cereales, vitaminas liposolubles A, D, E y K, vitaminas hidrosolubles, tiamina, ','piridoxina, ácido pantoténico, ribloflavina, cianocobalamina, ácido flólico, ','inositol, carbonato de calcio, cloruro de sodio, fosfato de calcio, yoduro de ','potasio, sulfato ferroso, sulfato de magnesio, sulfato de manganeso, sulfato ','de cobre, óxido de zinc, cobre, zinc y selenio quelatados.',' ',' ',' ',' ',' ',' ',' ',' ','ABABE PLUS es el primer alimento seco para becerros y terneras, empiece a suministrarlo desde los 5 ','días de edad en pequeñas cantidades de 10 a 12 g adicionales al día, aparte de su ración diaria de leche ','más agua.',' ','Los primeros días, coloque en la boca del animal unos cuantos comprimidos frescos (no sobrantes del ','pesebre) hasta que se acostumbre a comerlo. El objeto de esta reducida cantidad de ABABE PLUS es el ','promover consumo de alimento sólido a temprana edad para estimular la actividad del Rumen. ',' ','Una vez que se ha acostumbrado a comerlo, ponga al alcance de la ternera en comedero limpio ABABE ','PLUS para que lo consuma por sí sola. A las 4 ó 5 semanas de edad, su consumo deberá haber ','aumentado hasta 500g diarios aproximadamente y a la 6ª ó 7ª semana en unos 800g al día.','De la 7ª semana en adelante su consumo debe ser gradualmente mayor, hasta que el animal a los 4 ','meses de edas esté comiendo de 2 a 2 ½ kg al día.',' ','Recuerde que desde la 8ª semana de edad, debe proporcionar forrajes secos de leguminosas (alfalfa o ','trébol) de buena calidad y forrajes húmedos hasta los 6 meses. No debe faltar agua potable, limpia y ','fresca siempre al alcance de los animales.',' ','ADVERTENCIAS: No almacene este alimento en lugares húmedos, mal ventilados o calientes, ','almacénelo en sitios secos y al abrigo de la luz solar directa, libre de roedores, insectos y otros ','animales nocivos.','Estíbelo sobre tarimas o polines pero nunca directamente sobre el suelo y se evitará que el alimento ','absorba humedad del suelo.','Dé salida al alimento que tenga más tiempo en sus bodegas para evitar su envejecimiento.',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ','USO VETERINARIO.','CONSULTE AL MEDICO VETERINARIO.','SU VENTA REQUIERE RECETA MÉDICA.','Fecha de caducidad: 3 meses después de la fecha de producción ','4407','4407B07ABABE PLUS  '),
