	('4404',' ',' ','B04','ABAHOR PLUS',' ',' ',' ','Autorización SAGARPA','A-0544-515',' ','14%','2.5%','12.0%','11.0%','8.0%','52.5%','V0001','Granos de cereales (maíz o sorgo o trigo), subproductos de cereales ','(salvado de trigo, salvado de maíz, pulido de arroz), pastas de oleaginosas ','(soya, canola, cártamo), subproductos de oleaginosas, melaza de caña, ','carbonato de calcio, ortofosfato de calcio, sal común (cloruro de sodio), ','nitrógeno no proteico (máximo 1.0%), vitaminas estabilizadas (A, D, E), ','minerales traza (iodo, hierro, cobre, magnesio, manganeso, zinc, cobalto).',' ',' ',' ',' ',' ',' ',' ',' ',' ','INDICACIONES: Alimento balanceado para vacas secas.','Este producto es un alimento balanceado que satisface las necesidades de las hembras jóvenes en ','gestación y vacas adultas secas.',' ','ABAHOR PLUS desarrolla animales normales vigorosos en buen estado de carnes, sin grasa superflua ','preparándolos adecuadamente para sus funciones de reproducción y producción lechera futura.',' ','A las vacas jóvenes como a las adultas secas en gestación, les proporciona los nutrientes necesarios ','para ella y el becerro en formación, conservándolas en las mejores condiciones para su parto feliz.',' ','Mantener en todo momento agua limpia y fresca para su ganado.',' ','DOSIS Y VIA DE ADMINISTRACION: Oral. Ofrecer ABAHOR PLUS a razón del 1 al 3% del peso vivo, de ','acuerdo a la etapa del animal.',' ','A los 4 ó 5 días del parto, sustituya gradualmente ABAHOR PLUS por el alimento para vacas ','productoras según las necesidades de los animales y de acuerdo con los forrajes que suministren.',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ','USO VETERINARIO.','CONSULTE AL MEDICO VETERINARIO.','Fecha de caducidad: 3 meses después de la fecha de producción ','4404','4404B04ABAHOR PLUS  '),
	('4402',' ',' ','B92','ABALAC 32%',' ',' ','Concentrado proteico para mezclar con granos, para alimentación de vacas lecheras.',' ',' ',' ','32.0%','5.0%','12.0%','7.0%','14.0%','30.0%','V0001','Pastas y subproductos de oleaginosas, granos y subproductos de cereales, ','gluten de maíz 60, harina de pescado, melaza de caña, grasa de sobrepaso ','de origen vegetal, nitrógeno no proteico (3% máximo), carbonato de ','calcio, ortofosfato de calcio, sal común (cloruro de sodio), buffer ','(bicarbonato de sodio u óxido de magnesio), saborizante, metionina, lisina, ','vitaminas estabilizadas (A, D, E), minerales traza (iodo, hierro, cobre, ','magnesio, manganeso, zinc, cobalto). ',' ',' ',' ',' ',' ',' ',' ',' ','ABALAC 32% tiene un alto valor nutritivo y es ideal para mezclar con granos y otros ingredientes; ','cuenta con un elevado nivel de proteína de alta calidad, y está formulado y elaborado con grasa de ','sobrepaso, amortiguadores del pH ruminal, y fuentes que proporcionan un elevado contenido de ','proteína de sobrepaso, así como metionina y lisina, que en su conjunto proporcionarán una buena ','producción en sus vacas lecheras. Mezclado en proporción adecuada con granos rolados o molidos de ','buena calidad, se obtiene un alimento balanceado que satisface las necesidades de mantenimiento y ','producción del ganado lechero. ',' ','RECOMENDACIÓN DE USO: Dependiendo de lo requerido en el alimento final, deberá de mezclar este ','concentrado con granos u otros ingredientes en diferentes proporciones.','Por ejemplo, para producir un alimento de 16% proteína, mezclar 300 kg de ABALAC 32% y 700 kg de ','granos (sorgo, maíz, trigo o su combinación); y para producir un alimento de 18% proteína, mezclar ','400 kg de ABALAC 32% y 600 kg de granos (sorgo, maíz, trigo o su combinación). ','Del alimento preparado, deberá ofrecer alrededor de 1 kg. por cada 3 litros de leche producida, ','además de forraje de buena calidad.','Para formulación especial de ración integral con el uso de este concentrado, favor de contactar con el ','Servicio Técnico de maltaCleyton®.','Mantener en todo momento agua limpia y fresca para sus animales. ',' ','CONSEJOS PRÁCTICOS: No almacenar el alimento en lugares húmedos, calientes y mal ventilados, ','hágalo en sitios secos y protegidos de roedores, insectos y otros animales.','Estibar sobre tarimas y nunca dejar el alimento directamente sobre el suelo y/o en contacto con ','paredes.',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ',' ','CONSULTE AL MEDICO VETERINARIO ZOOTECNISTA.','Fecha de caducidad: 3 meses después de la fecha de producción ','4402','4402B92ABALAC 32%  '),
